INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_125", /*message*/"Check information on updates and maintenance and other important messages from the operations team. Pay close attention, as it will contain important information relating to the game.");
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_127", /*message*/"Here, you can check a record of Live Shows you&apos;ve played and rankings of your most used members. You can select which school idols appears as guests for your Friends based on their Attribute.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_129", /*message*/"Here, you can check illustrations that you have seen in the various stories. You can expand an illustration by clicking on it in the list.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_13", /*message*/"Video Mode allows you to watch the school idols perform without using LP.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_130", /*message*/"You can see bond point ranking by member for each player here.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_131", /*message*/"You can receive a variety of rewards from gaining achievements.");
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_132", /*message*/"By linking your Love Live! School Idol Festival and this app (All Stars) via your SIF ID, you can gain rewards in both apps based on your achievements which are tracked with the ID.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_133", /*message*/"Change the game&apos;s options.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_134", /*message*/"Change Live Show settings.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_135", /*message*/"By linking your play data to an SIF ID, your Game Center account, or Google Play account, you can play on the same file with multiple devices. Furthermore, you can transfer your data to a new device if your current device is lost or malfunctions.");
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_136", /*message*/"Check your purchased Star Gems and items.");
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_137", /*message*/"The policy surrounding use of this service, service details, the privacy policy, forbidden actions, disclaimers, and other important contracts are written here. Using this service will be seen as agreeing to the terms of service. Please make sure you read them before you agree.");
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_138", /*message*/"School idols&apos; status can change during Live Shows due to skills, abilities, Insight Skills, show tricks, and more.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_139", /*message*/"Skills, Abilities, and Insight Skills are categorized as either &quot;Show Skills&quot; or &quot;Passive Skills.&quot;
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_14", /*message*/"There are seven song attributes: Smile, Cool, Pure, Active, Natural, Elegant, and None.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_140", /*message*/"The SIFAS Big Live Show, or SBL, is a co-op event in which multiple players perform a song. You can select which of the available Big Live Show songs you would like to play.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_141", /*message*/"Support Notes are Notes that allow you to aid other participants.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_142", /*message*/"Those who do particularly well in Big Live Shows will be presented with special awards. There are multiple types, varying by event and song. Here are a few examples.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_143", /*message*/"Big Live Shows have two different rankings, and you are able to gain SBL Medals from both.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_144", /*message*/"Because a Big Live Show requires all players to connect and play at the same time, if you face connection issues during play, your game may end immediately.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_145", /*message*/"You unlock new songs to play as you go through the story.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_146", /*message*/"These are Live Shows that happen as you progress through the story.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_147", /*message*/"The Bond Board will allow you to power up all versions of a member.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_148", /*message*/"Bond Boards offer a wide variety of booster tiles and bonus effects.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_149", /*message*/"The Dream Live Parade is an event in which you clear an array of stages in order. Sometimes, multiple Parades are held. You can choose which one you&apos;d like to take part in on the Parade select screen.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_15", /*message*/"These are other players who help you during Live Shows.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_152", /*message*/"Bonus school idols are school idols that confer an advantage in events.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_153", /*message*/"This will show lists of consumables, Training items, Scouting Tickets, power-up items, and accessories. Lists for consumables, Training items, and Scouting Tickets will only show items you currently possess.");
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_154", /*message*/"This is a type of formation that allows you to play a song with only one strategy. It is good for beginners as it is intended to make songs easier to clear.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_155", /*message*/"This type of formation consists of three specialized strategies that you switch through as you play songs.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_156", /*message*/"You can designate school idol attributes, groups, and strategy conditions to create a recommended formation.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_157", /*message*/"In a Live Show Stage, you&apos;ll need to meet the Voltage goal. You won&apos;t be able to move on to the next stage until you get enough Voltage.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_158", /*message*/"PP are the points you use to perform Live Shows in the Dream Live Parade.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_159", /*message*/"Through completing Goals, you can gain a variety of rewards such as items and Titles. Daily Goals are reset daily at 12:00 am JST. Weekly Goals are reset weekly on Mondays at 12:00 am JST.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_16", /*message*/"The stat needed to continue Live Shows.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_17", /*message*/"The value that shows how strong your show formation is.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_18", /*message*/"There are five note outcomes: Wonderful, Great, Nice, Bad, and Miss.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_19", /*message*/"A critical is when you gain increased Voltage regardless of note outcome. The word &quot;CRITICAL&quot; will appear on screen to let you know when you&apos;ve scored one.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_2", /*message*/"You need enough of these points to play Live Shows.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_20", /*message*/"Icons that appear on the left and right sides of your screen.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_21", /*message*/"Notes with arrows drawn on them are Flick Notes.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_22", /*message*/"Two notes that are connected by a band are called Hold Notes.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_23", /*message*/"Two notes that are connected by a line are called Sync Notes.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_24", /*message*/"Some notes have special tricks to them.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_25", /*message*/"Appeal Chances are special missions that occur during Live Shows.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_26", /*message*/"Notes in the shape of stars are Bonus Notes.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_27", /*message*/"Formations come with three strategies, each with three school idols that take the spotlight. Strategies have bonuses when they are active, and when they are switched. Pick the correct strategy according to your stamina and Voltage.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_28", /*message*/"When you switch strategies during a Live Show, you will gain a variety of bonuses.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_29", /*message*/"SP skills are powerful techniques you can activate during Live Shows.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_3", /*message*/"You need enough of these points to conduct Training.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_30", /*message*/"You go into Special Time after activating an SP skill.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_31", /*message*/"Progressing through the story will unlock new songs.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_32", /*message*/"By meeting the conditions set by each Live Show, you can earn the rewards it provides.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_33", /*message*/"There are three kinds of Practice.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_34", /*message*/"You can gain experience points from doing Live Shows and Training.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_35", /*message*/"You can increase school idol levels by using up gold and experience points. The higher their level, the more their Appeal, Stamina, and Technique will increase. You can increase school idol levels from the Practice screen.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_36", /*message*/"These denote a school idol&apos;s performance abilities. They are divided into three stats: Appeal, Stamina, and Technique.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_37", /*message*/"School idols have six attributes: <img src=\"Common/Icon/tex_common_icon_attribute_1\" width=\"30px\" height=\"30px\" offsetY=\"-6px\"/>Smile,　　　<img src=\"Common/Icon/tex_common_icon_attribute_2\" width=\"30px\" height=\"30px\" offsetY=\"-6px\"/>Pure,　　　　<img src=\"Common/Icon/tex_common_icon_attribute_3\" width=\"30px\" height=\"30px\" offsetY=\"-6px\"/>Cool,
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_38", /*message*/"There are four school idol types: <img src=\"Common/InlineImage/Icon/tex_inlineimage_icon_role_1\" width=\"30px\" height=\"30px\" offsetY=\"-6px\"/>Voltage Type,　　<img src=\"Common/InlineImage/Icon/tex_inlineimage_icon_role_2\" width=\"30px\" height=\"30px\" offsetY=\"-6px\"/>SP Type,
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_39", /*message*/"School idols have the following three rarities:
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_4", /*message*/"This is needed for school idols&apos; Practice, synthesizing accessories, and more.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_40", /*message*/"When a school idol activates her skill during a Live Show, you can gain a variety of effects that give you an advantage.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_41", /*message*/"There are two types of School Idol abilities: those that have effects during Show Formation, and those that activate during the Live Show.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_42", /*message*/"There are two types of Insight Skills: Those that have effects during Show Formation, and those that activate during Live Shows. You can discover Insight Skills through conducting Training.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_43", /*message*/"Here, you can select the school idols that will perform in the Live Show. You can also change their position, costumes, and the strategies and accessories they will use.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_44", /*message*/"You can change the costumes your school idols will wear on the Show Formation screen.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_46", /*message*/"In the Team Formation screen, you can change your school idols&apos; position or swap them in and out of your formation.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_47", /*message*/"This allows you to select the strategies and accessories you will use in your Live Show.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_48", /*message*/"Sending your school idols to Training will gain you the items you need for Practice. There are eight regimens available, and you will select three in one Training session. The regimens you select will change the items you can obtain.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_49", /*message*/"There are eight training regimens, and you can select up to three during a single training session. The training regimens you select will determine the items and Insight Skills you can obtain. You can also select duplicate regimens.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_5", /*message*/"These items can be used in a variety of ways, such as scouting, restoring your LP or AP, adding accessory inventory spaces, and more.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_50", /*message*/"Items you can use during Training.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_51", /*message*/"On rare occasions when you make school idols go through Training, they will discover an Insight Skill.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_52", /*message*/"When you set an accessory to a strategy, your school idol&apos;s parameters will increase, and she will be able to use the accessory&apos;s skills.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_53", /*message*/"Each accessory can have a maximum of two accessory skills.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_54", /*message*/"You can use power up items or other accessories to power up your accessories. This increases the accessory&apos;s level and changes its stats.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_55", /*message*/"By using duplicate accessories as materials, you can make your accessories increase their limits. These Limit Increases will boost the level limits of both the accessories and their accessory skills.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_56", /*message*/"Accessory skills can be powered up by using accessories with skills as materials.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_57", /*message*/"Accessories come in the following three rarities:
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_58", /*message*/"By fulfilling the conditions below, you can perform a Rarity Boost on an accessory.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_59", /*message*/"You can obtain items used for Rarity Boosts by disassembling accessories. You can gain a different amount of items if the disassembled accessory has had its limit increased.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_6", /*message*/"Accessing Titles from the Menu screen or tapping the Title icon at the top of the Home or Profile screen will allow you to check and set your Titles.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_60", /*message*/"Scouting allows you to recruit particular school idols.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_61", /*message*/"This scouting does not have a limited time.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_62", /*message*/"A bonus obtained after conducting a scouting.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_63", /*message*/"When Shiny Quartz expire, they become Shiny Pieces.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_64", /*message*/"You can purchase Star Gems at the shop.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_65", /*message*/"In the Item Exchange on the Shop screen, you can trade Shiny Quartz and Shiny Pieces for school idols and items. More Exchanges will be added in the future.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_66", /*message*/"You can also purchase sets that have a variety of items in them.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_67", /*message*/"A Bonus Pass allows you to gain extra items every day on top of your login bonus, for a certain period of time starting from when you purchase it. Also unlike login bonuses, the items are updated every day at 12:00 am JST.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_68", /*message*/"Here, you can watch the school idols&apos; story unfold. Getting through story chapters will unlock new songs and grant new goals.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_7", /*message*/"The member who assists you on the home screen.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_70", /*message*/"While playing a story chapter, you can select the skip function from the menu button on the top right.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_71", /*message*/"While playing a story chapter, you can select the hide window function from the menu button on the top right.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_72", /*message*/"While playing a story chapter, you can select the log display function from the menu button on the top right.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_73", /*message*/"While playing a story chapter, you can select the repeat function from the menu button on the top right.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_74", /*message*/"While playing a story chapter, you can select the auto function from the menu button on the top right.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_75", /*message*/"After fulfilling certain conditions, you can read each member&apos;s exclusive episodes.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_76", /*message*/"School idols have bond levels. You can increase this bond level through Live Shows and interacting with them on the home screen. When their bond levels increase, their parameters will increase and their Bond Episodes will be unlocked.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_77", /*message*/"When a school idol&apos;s bond level increases, her Bond Episodes will be unlocked. You can increase bond level through Live Shows and interacting with them on the home screen.");
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_78", /*message*/"Through school idol Practice, you can read their exclusive Side Episodes.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_79", /*message*/"By selecting Change Outfit on the member details screen, you can set outfits and backgrounds you&apos;ve obtained.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_8", /*message*/"This is a designated reward you gain once per day for opening the app and visiting the home screen.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_80", /*message*/"When you gain rewards from login bonuses and other places, they will be sent to your Present Box.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_81", /*message*/"Here, you can check to see all of the presents you&apos;ve accepted in the past.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_82", /*message*/"This allows you to take a maximum of 200 items from the top all at once.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_83", /*message*/"This allows you to check your friends&apos; profiles and organize your friends list.
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_84", /*message*/"Here, you can look at the players that have sent you friend requests.");
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_85", /*message*/"Here, you can look at the players you have sent friend requests to.");
INSERT INTO `m_dictionary` VALUES (/*id*/"help_detail_text_86", /*message*/"Here, you can enter another player&apos;s Player ID and search for them.
