INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_1", /*message*/"Honoka is a second year high school student and the founder of μ&apos;s. Her key characteristics are that she is always seen with a smile on her face and that she is full of energy. Whimsy and intuition dictate many of her choices, but once she decides on something, she races toward her goal without any hesitation. Even if things look grim, she overcomes such times with super positive thinking. She is the engine that drives μ&apos;s forward.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_101", /*message*/"The second-year student at Uranohoshi Girls&apos; High School who launched Aqours. The youngest of three sisters, she comes from a ryokan-owning family and is proud of their open-air, ocean-view bath. She is sociable and rarely gives in easily. Her positive, can-do attitude gradually begins to affect everyone around her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_102", /*message*/"A second-year student who joined Chika&apos;s class after moving from Akihabara, Tokyo. She may look calm and mature, but she often flies into a panic, jumping to conclusions and making mistakes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_103", /*message*/"A third-year student who is breezily mature and she rarely sweats the details and usually maintains a calm, cool demeanor.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_104", /*message*/"A third-year student who leads the student council. She is from an old fishing family whose name is well-known in the area. Prideful and perfectionistic in her ways, she can&apos;t abide it when things done are done sloppily or incorrectly.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_105", /*message*/"A second-year classmate of Chika&apos;s. Good enough at the high dive to qualify for the national team. She tends to take action without thinking matters over first. Her father captains a ferry, and she&apos;d like to have his job someday.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_106", /*message*/"A first-year student who likes the &quot;little devil&quot; look and calls herself &quot;the fallen angel Yohane&quot;. Born in the urban side of Numazu City, she&apos;s bright, self-assured, smart, and thoughtful. She&apos;s also cursed by extremely bad luck, running into all kinds of unforeseen trouble wherever she goes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_107", /*message*/"A first-year student, the daughter of a family who&apos;s run a nearby temple for generations. A fan of reading, she has a deep fondness for Japanese literature. She&apos;s also a gifted singer, earning her a spot in a choir and gentle and caring to those around her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_108", /*message*/"A third-year student. Her mother is Japanese, while her father is Italian-American and manages a hotel chain. Cheerful in personality, she often prefers to work by herself. Mari always keeps her chin up when faced with hardship and ready to try her hand at anything.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_109", /*message*/"A first-year student who&apos;s almost always nearby her good friend Hanamaru. Fearful and tends to cry a lot, but she has a tough interior, forged by her role as a girl in a rich, well-known family. Always looked up to pop idols. Needlework is the only thing she&apos;s really great at.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_2", /*message*/"Eli is a third year high school student. She is a quarter Russian. She is clear-headed, has unparalleled physical flexibility, and can do almost everything at an above-average level. Even at school, she is very popular, and is admired for having a strong sense of responsibility.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_201", /*message*/"A second-year student at Nijigasaki High School, she&apos;s a hard worker who takes anything and everything on diligently. She started being a school idol at the suggestion of her childhood friend. She&apos;s a highly caring friend who always supports her beloved pal in her endeavors.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_202", /*message*/"A first-year at Nijigasaki High School. She loves cute things and admires school idols far more than the average person. She hates losing, and gets angry when people call her by her nickname, Kasukasu. She&apos;ll do all sorts of mischief to overcome her rivals, but often ends up doing what everyone else does.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_203", /*message*/"A recent addition to Nijigasaki High School and first-year. A straight-laced star student, Shizuku is part of the theater club. She&apos;s athletic, but poor at ball sports. She wants to grow up to be an actress, and she seeks to use her school idol experience to that end.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_204", /*message*/"A third-year at Nijigasaki High School. She has looks and proportions unlike any high school student and has been an amateur model before. Karin is surprisingly stubborn in contrast to her mature appearance. She hasn&apos;t taken much seriously until now, but ever since becoming a school idol on a whim, she&apos;s really gotten into it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_205", /*message*/"A second-year at Nijigasaki High School. Ai is easy to get along with and very caring, leading her to have plenty of friends. Her flashy appearance leads to many a misunderstanding, but she goes to great lengths for friends and family and loves her grandmother. Her favorite food is miso-pickled vegetables.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_206", /*message*/"A third-year who just enrolled into Nijigasaki High School. Though passionate about cooking and doting on her younger sister Haruka, Kanata battles against sleep when it comes to anything else. She also knows all the best spots to take a secret nap in Nijigasaki&apos;s campus.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_207", /*message*/"A second-year at Nijigasaki and a rising star of the school idol world. Setsuna&apos;s energetic smile and great performances draw many eyes. She loves anime and manga, and if you get her talking about either, she won&apos;t stop. Since she&apos;s so busy with her idol work, she has urban legend-style rumors surrounding her, stating that no one has ever seen her on campus.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_208", /*message*/"A third-year at Nijigasaki High School. A foreign exchange student from Switzerland, Emma very recently entered Nijigasaki. With a laid-back personality, she&apos;s a gentle girl who loves the mountains and nature of her homeland, as well as Japanese bread. She also has a bit of a ditzy side to her, and she&apos;ll throw those around her for a loop on occasion.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_209", /*message*/"A first-year at Nijigasaki High School who went to its attached middle school. She has a lot of trouble expressing her emotions through facial expressions, so she draws a face on white paper -- the &quot;Rina-chan Board&quot; -- and uses that to communicate.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_3", /*message*/"Kotori is a second year high school student and Honoka&apos;s very first friend. These childhood friends have been together since kindergarten. In direct contrast with Honoka, she has a soft and quiet demeanor befitting of her honors student status. While she may be quiet, she is a strong and confident girl.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_4", /*message*/"Umi is a second year high school student. She was brought up in the household of a dance school headmaster, which has helped her to become a graceful girl with a refined air. She has practiced archery since childhood and has flawless etiquette. She is the type of girl who is hard on those around her, but is especially hard on herself. She does not like doing anything remotely criminal, and abhors laziness. Honoka and Kotori are her childhood friends.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_5", /*message*/"Rin is a first year high school student who is quite athletic and optimistic. She would rather take action and keep moving instead of sit and think. She will participate in anything, as long as it seems to be fun. She finds joy in helping and looking after others, especially her good friend, Hanayo. No matter what anyone says, she always gives practice her all.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_6", /*message*/"Maki is a first year high school student whose parents run a large, successful hospital. She is known among her peers as being an outstanding singer who is also rather adept at playing the piano. She is high-handed to the point of arrogance and has difficulty expressing her feelings. She is quite courageous, never hesitating to incite an argument, even with her upperclassmen. Even so, she has a side that she keeps hidden as best she can--she gets lonely very easily.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_7", /*message*/"Nozomi is a third year high school student. In direct contrast to Eli, she has an easygoing personality and has a unique manner of speaking, due to her relaxed-sounding Kansai dialect. She and Eli make a good combination, with Nozomi acting as Eli&apos;s foil. She has a motherly heart, leading others to think that she is the most mature of the members. Although she seems nonchalant, she can be surprisingly conniving.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_8", /*message*/"A first year high school student, Hanayo struggles more than others to stand out in class due to her meek personality. She lacks any traces of self-confidence and tends to give up on everything she attempts. She adores µ&apos;s, so she decides to join the school idol group along with her reluctant friends, Rin and Maki. She gets along well with Rin, and they quickly grow inseparable. She is perfectly happy eating a bowl of nothing but white rice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_description_9", /*message*/"Nico is a third year high school student. She works hard to become an idol day in and day out--a true idol otaku. As their senior in school idol experience, she often bosses Honoka and the others around. While she may talk big, she does mess up a lot, making her an unexpectedly klutzy girl. Her catchphrase is &quot;Nico-Nico-Ni!&quot;");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_face_board_lock_text_209", /*message*/"After completing Bond Episode 12, you can attach or detach the Rina-chan Board during Live Shows.");
INSERT INTO `m_dictionary` VALUES (/*id*/"m_dic_member_face_board_unlock_text_209", /*message*/"The Rina-chan Board&apos;s display settings will only be applied during Live Shows.");
