INSERT INTO `m_dictionary` VALUES (/*id*/"member_love_panel_new_title01", /*message*/"Bond Board");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_101_1", /*message*/"You are staring off at the setting sun when mysteriously, mikan oranges roll right up to you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_101_10", /*message*/"Chika&apos;s solo live show is a huge success. The increase in reservations at her family ryokan inn nets Chika even more praise, which puts her over the moon. But she&apos;s also thinking about her real goal...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_101_11", /*message*/"All the members of μ&apos;s and Aqours come to Nijigasaki High School to discuss the upcoming School Idol Festival.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_101_2", /*message*/"The day after you help her with her mikans, Chika wants to repay you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_101_3", /*message*/"Chika invites you into her room, and you find something of interest there.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_101_4", /*message*/"You open Chika&apos;s lyrics-writing notebook and find all her hard work and love for Aqours. You&apos;re impressed, and then Chika does something for you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_101_5", /*message*/"There&apos;s so much love in Chika&apos;s lyrics. She feels inspired by your encouragement. Will the song be done by the day of the show?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_101_6", /*message*/"You video chat with Chika to talk about how things have been lately. As you&apos;re talking, she begins to show interest in one particular topic.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_101_7", /*message*/"Chika&apos;s catch-up with you has piqued her interest in singing solo. She jumps right into planning for a solo live show and breaks the news to Riko and You. How will they react?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_101_8", /*message*/"Chika reveals her solo live show idea to the other members. Despite their surprise, they all support her decision. Though Chika&apos;s more enthusiastic about the live show than ever before, she&apos;s forgetting something very important...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_101_9", /*message*/"The day of Chika&apos;s solo live show has finally arrived. Her excitement is rising as the start of the show approaches. However, you sense a hidden concern within her excitement.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_102_1", /*message*/"A poster for a piano concert catches your eye, so you decide to buy a ticket. Inside the venue, you run into someone you never would have expected.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_102_10", /*message*/"One night, you give Riko a call. The conversation seems casual, but Riko starts to notice something off.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_102_11", /*message*/"As the event for Nijigasaki draws closer, you find yourself wistfully gazing out over the Uchiura sea. Riko finds you out there and calls out to you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_102_2", /*message*/"The pianist in the concert is actually Riko&apos;s old teacher! Riko is reminiscing about the past, but there seems to be something else on her mind.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_102_3", /*message*/"You meet up with Riko again in Numazu. You ask what she talked with her old teacher about, which turned out to be her life in Uchiura and more.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_102_4", /*message*/"Riko is experimenting every day to try to write songs just for Aqours. Seeing she can&apos;t come up with something she likes, you ask her for a favor.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_102_5", /*message*/"The two of you go to the Uranohoshi Girls&apos; High music room so Riko can play piano for you, and you request she play a certain song.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_102_6", /*message*/"Thanks to you, Riko&apos;s back to feeling optimistic about songwriting again! You&apos;re relieved to see that she&apos;s back to her normal self.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_102_7", /*message*/"Riko composes music for her group of nine members, whereas you compose music for nine solo members. While your experiences may be different, you bond over your connection as fellow songwriters.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_102_8", /*message*/"Riko visits Nijigasaki High School after receiving your invitation. All of the club members give her a warm reception and she decides to watch them practice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_102_9", /*message*/"Riko suddenly calls you one night just as you were thinking about her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_103_1", /*message*/"It&apos;s your first time on Awashima. Who and what will you encounter here? Your heart fills with expectations.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_103_10", /*message*/"You expect that you&apos;ll be seeing the effects of the PR video you all filmed soon, so you visit the diving shop. There, you find that business is booming and Kanan has her hands full with customers.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_103_11", /*message*/"Kanan&apos;s family diving shop is busy as usual. Seeing Kanan so happy fills you with joy too. Then, a question pops into your head.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_103_2", /*message*/"You&apos;re impressed by Kanan&apos;s talk about diving. She even lends you a hand in a little scuba adventure!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_103_3", /*message*/"After seeing the beauty of the ocean while diving with Kanan, you want to share those sights with lots of people.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_103_4", /*message*/"Mari joins you and Kanan in a little meeting to strategize how you can show everyone the beauty of Uchiura&apos;s ocean!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_103_5", /*message*/"Mari decides to help out with spreading the appeal of Uchiura&apos;s diving spot. She starts with...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_103_6", /*message*/"The diving shop is bustling after the popular promotional video you helped make. You and Kanan start out quite pleased with yourselves, but sometimes reality comes crashing down hard.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_103_7", /*message*/"Along with Kanan, Dia, and Mari, you have a meeting about the production of a second promotional video. While everyone has their say, nothing seems to come of it until you all receive a hint from an unexpected source.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_103_8", /*message*/"You have all decided to create a solo live show video for Kanan, but you can&apos;t have a performance without any songs.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_103_9", /*message*/"You celebrate the completion of the promotional video with Kanan, Mari, and Dia in Kanan&apos;s room. There, you hear stories from their past.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_104_1", /*message*/"You run into Dia when she&apos;s picking up garbage for the school cleanup. She encourages other students as student council president, which you find very refreshing compared to her usual school idol self.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_104_10", /*message*/"All three of you are enjoying your time at the karaoke tournament when Ai&apos;s phone lights up. It seems some urgent business has come up.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_104_11", /*message*/"It&apos;s just you and Dia after Ai leaves. After you depart from the shopping district, Dia tells you there&apos;s a place she wants to go with you. And that place is...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_104_2", /*message*/"You are reading a magazine with Ruby in the Uranohoshi Girls&apos; High clubroom when you notice a mysterious melody. It seems to be coming from a Japanese-style room in the school.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_104_3", /*message*/"The Japanese-style room you find Dia in is actually the flower arrangement clubroom. Dia, who is also held in high regard by this club, invites you and Ruby in to try out flower arrangement.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_104_4", /*message*/"Ruby leaves, having a previous engagement with Hanamaru, so you and Dia go to the clubroom. After talking about how you and Ruby read idol magazines, you wonder if Dia reads them too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_104_5", /*message*/"In the evening as you&apos;re about to head home, you ask Dia if she isn&apos;t pushing herself too hard with all the things she does. Dia&apos;s answer is...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_104_6", /*message*/"You and Ai are hanging out in Harajuku on your day off. While the two of you try to decide where to go first, you spot an unexpected person.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_104_7", /*message*/"You set off with Dia and Ai to explore Harajuku. You all get pushed around by the crowd on your way to a certain place...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_104_8", /*message*/"Dia seems a little tired after walking around Harajuku. Seeing this, Ai suggests going somewhere else to hang out. Where might she be taking you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_104_9", /*message*/"Dia receives a warm welcome after spontaneously joining a karaoke contest. It reminds her of Uchiura and warms her heart.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_105_1", /*message*/"You&apos;ve come out to Numazu to hang out. As you leave the station, you have a chance encounter with You who calls out to you, and you head out together to see Numazu.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_105_10", /*message*/"You and You&apos;s Odaiba date is coming to a close. It&apos;s almost time to go home. The last thing the two of you do is...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_105_11", /*message*/"You decide to visit Yokohama on your day off. As you&apos;re wondering where you want to go, a figure approaches you from behind...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_105_2", /*message*/"The first place you go is the station-side mall. Inside, you find an arcade and try your luck at a crane game.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_105_3", /*message*/"You and You discuss where to go next over some cake. The aquarium, or castle ruins? This fun-filled day has just begun!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_105_4", /*message*/"You both arrive at a very large water gate. Excitement peaks as you look at the beautiful scenery from the observation deck. However, You is rather quiet.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_105_5", /*message*/"It grows late, and it&apos;s time you head back to Tokyo. You promise to hang out with You again and make your way through the ticket gate.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_105_6", /*message*/"After a fun trip to Numazu with You, you find yourself thinking you&apos;d like to show her around Odaiba next time. While pondering your plans, you suddenly receive a call from a certain somebody.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_105_7", /*message*/"It&apos;s finally the day to explore Odaiba. One other person appears at your meeting spot with You. What kind of day will it turn out to be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_105_8", /*message*/"The three of you hop off the Ferris wheel and go to a shopping mall. Various events are apparently held at the mall&apos;s outdoor plaza. Will the day come when the club can perform here?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_105_9", /*message*/"You&apos;s singing attracted more people than the venue could hold. The three of you manage to escape, but where are you headed to now?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_106_1", /*message*/"You find something strange on the side of the road. Just when you go to turn it in to the police box, Yoshiko calls out to you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_106_10", /*message*/"After the fan meet-up, Yoshiko&apos;s follower count rockets up, much to her delight. She&apos;s planning to record a new video, and you have a suggestion.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_106_11", /*message*/"You are talking to Yoshiko about what to do for her next video when she suddenly gets up in a panic and starts trying to leave. Confused by what could have brought this on, you ask her what happened.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_106_2", /*message*/"To thank you for fixing her key chain, Yoshiko makes you the right-hand to the fallen angel Yohane. Another little demon has been spawned!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_106_3", /*message*/"Yoshiko asks you to help with her little demon recruitment video. She says there&apos;s something she wants to try with the recording, but what could it be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_106_4", /*message*/"Filming day has arrived. Yoshiko is disappointed while you couldn&apos;t be more nervous and excited. She seems to not be satisfied with the game she&apos;ll be playing on the stream.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_106_5", /*message*/"The live stream starts, and you begin the game with Yoshiko in Yohane-mode. As you wonder how everything will turn out, all you can hear are the screams of Yoshiko.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_106_6", /*message*/"You&apos;re headed to Yoshiko&apos;s house to help her shoot a video when you get a panicked call from her, saying there&apos;s an emergency! What could have happened?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_106_7", /*message*/"Yoshiko has decided to attend the meetup. However, she seems to be full of concerns, such as what to wear and what to talk about. You offer up ideas to help solve each of her problems.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_106_8", /*message*/"The day of the meet-up has arrived. Yoshiko can&apos;t hide her nerves as you take her to the meet-up venue. Will she be able to get through the event without tripping up?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_106_9", /*message*/"The fun meetup comes to a close. After saying goodbye to the little demon girls, Yoshiko once again realizes how many people are cheering her on.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_107_1", /*message*/"Taking a walk on your break, you decide to check out the library. As you walk around inside, you hear a familiar voice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_107_10", /*message*/"The four of you come together to discuss the script for the play. As big fans of various stories, Hanamaru and Shizuku enthusiastically talk and eventually narrow it down to three themes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_107_11", /*message*/"In order to decide which genre to make your play, you, Hanamaru, Ruby, and Shizuku try to have a mystery-style experience. But how on earth do you experience a mystery?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_107_2", /*message*/"As you wait for Hanamaru to check out her books, you and Ruby look at the notice board. Of the many postings, one in particular stands out.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_107_3", /*message*/"Although interested in the library anthology, Hanamaru won&apos;t make up her mind about joining in. Not wanting to waste her potential, you and Ruby encourage her to submit.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_107_4", /*message*/"You and Ruby support Hanamaru&apos;s decision to contribute to the anthology, but first she&apos;ll have to get over one little problem in writing it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_107_5", /*message*/"The day the anthology is published, you, Ruby, and Hanamaru go to the library. You find the display containing Hanamaru&apos;s contribution right away.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_107_6", /*message*/"You&apos;re in your room, talking on the phone with Hanamaru. Hanamaru has been writing more since submitting her story to the library anthology. She&apos;s beginning to find real joy in crafting tales of her own.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_107_7", /*message*/"Shizuku appears to be troubled by something. Upon asking about her qualms, you find out exactly is going on.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_107_8", /*message*/"You and Shizuku head over to Numazu to see Hanamaru. She&apos;s supposed to pick you two up, but is nowhere to be found. Could something have happened?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_107_9", /*message*/"You, Shizuku, and Ruby watch over Hanamaru during her solo live show. After seeing her performance, Shizuku has a proposal for Hanamaru.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_108_1", /*message*/"While walking around in Tokyo, a foreign tourist asks you for directions and you don&apos;t know how to answer. Just then, an unexpected savior arrives!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_108_10", /*message*/"Mari closes out her live show to raucous cheers and applause. The members of the school idol club are impressed by her performance and suggest she become a solo artist as well. Mari responds with...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_108_11", /*message*/"You&apos;re visiting Aqours to see them practice. Seeing how Mari relaxes with her group during their break, you feel like there&apos;s a completely different air about her than when she was at Nijigasaki.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_108_2", /*message*/"You tag along with Mari on her sightseeing trip around Tokyo. When you ask where she&apos;s going, she only answers with a giggle. You end up at...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_108_3", /*message*/"It takes everything you have just to keep up with Mari&apos;s pace. On top of that, the tourist site she wants to head to isn&apos;t exactly typical.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_108_4", /*message*/"Your destination is Nijigasaki High School! You guide Mari through the halls, and run into Nijigasaki school idol Ayumu.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_108_5", /*message*/"Mari finally decides to head back to Numazu, but before she does you ask her what she was up to, sightseeing in Tokyo. What does she answer?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_108_6", /*message*/"Mari appears while you&apos;re passing out flyers for the upcoming live show. At first, it seems she&apos;s back in Tokyo to check out schools under the pretense of sightseeing, but soon it&apos;s clear she may have another reason.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_108_7", /*message*/"You visit various schools with Mari to interview school idols. You find out about the role of school idols and their different circumstances, leading you to once again realize the weight of school idol activities.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_108_8", /*message*/"Mari&apos;s real intention was to gather information that would help Aqours grow. You head off with Mari to the final destination of her secret Tokyo sight-seeing trip.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_108_9", /*message*/"Mari visits Nijigasaki High School on open campus day to cheer on the School Idol Club members. Their live show is just about to begin!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_109_1", /*message*/"One day, you forget something in the Uranohoshi clubroom. When you go back to get it, you find Ruby working by herself, even as the sun sets outside.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_109_10", /*message*/"The magazine featuring Ruby goes on sale. The other members heap praise on her for overcoming her fears and modeling. You feel as though Ruby has even greater potential than you knew before.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_109_11", /*message*/"After her modeling session, you continue to support Ruby however you can, whether it be offering advice during her dance practices or finding new work for her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_109_2", /*message*/"You help Ruby finish up the costume alterations, but just when you think it&apos;s done, Ruby still doesn&apos;t seem satisfied with them. What could the issue be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_109_3", /*message*/"You and Ruby travel to a handicraft shop outside of Numazu to gather materials for brooches. Will you be able to find what you need?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_109_4", /*message*/"Let the brooch making begin! Ruby thinks hard about each member&apos;s specific design, revealing to you Ruby&apos;s deep passion for Aqours.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_109_5", /*message*/"The brooches are done! You and Ruby marvel at the beautiful, original accessories you&apos;ve made. You notice something off, however. How did this happen?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_109_6", /*message*/"You stop by the Aqours clubroom to find Ruby teaching Chika and Yoshiko how to make accessories. Ruby&apos;s gained a lot of credibility after making such gorgeous brooches for the last live show, and she&apos;s quite happy about it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_109_7", /*message*/"You are hanging out in town with Ruby. As you leave a café and begin to walk, a woman introduces herself to Ruby. It appears as though she has been looking for her. Who could she be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_109_8", /*message*/"Chika and the others are ecstatic after finding out that Ruby has been asked to model for a magazine, but Ruby doesn&apos;t seem too thrilled about the prospect herself.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_109_9", /*message*/"Ruby&apos;s solo live show is a huge success. Ruby has a little more confidence in herself now and makes a decision.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_1_1", /*message*/"You end up helping μ&apos;s with their everyday activities. While unsure if they&apos;ll accept you into their group, you go to their clubroom where Honoka awaits.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_1_10", /*message*/"Honoka&apos;s wish for her songs to reach everyone remains the same. She steps out to perform her solo live show with her hopes close to her heart.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_1_11", /*message*/"Honoka&apos;s first solo live show was a big success. Umi and Kotori are dazzled by how different Honoka seemed compared to her performances at μ&apos;s&apos; usual live shows. Naturally, Honoka begins to plan her next solo live show...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_1_2", /*message*/"Honoka accepts you as one of the group, being someone headed in the same direction as them. You head to Otonokizaka High, but you get lost on your way!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_1_3", /*message*/"After getting lost, you end up at Honoka&apos;s house. Honoka is someone who always encourages everyone to keep going forward, but it seems like there&apos;s an unknown aspect to her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_1_4", /*message*/"Honoka can&apos;t seem to put effort into anything but school idols, which she loves. Yet you come to realize that&apos;s more like her than anything. You offer a suggestion having learned about her favorite food.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_1_5", /*message*/"You and Honoka are glad to have become friendly outside of club activities. Honoka even extends a helping hand with the song-writing you&apos;re working on.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_1_6", /*message*/"The two of you move forward together, hand-in-hand, joyful that you help each other. Honoka, however, just can&apos;t wait for you to arrive and takes matters into her own hands.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_1_7", /*message*/"Honoka seems restless after what Yukiho casually mentioned. Still, the Nijigasaki solo live show appears to have inspired her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_1_8", /*message*/"You and Honoka discuss what kind of live show to put on after you suggest the μ&apos;s members each perform solo. Her hopes for the show start to grow and grow... But maybe a little too far?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_1_9", /*message*/"Honoka is fired up about her solo live show, but she wants to do too many different things! You decide to help her figure out the one thing she wants to do most.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_1", /*message*/"Your long-time friend Ayumu stops by as you sleepily eat breakfast at home, and you head to school together.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_10", /*message*/"Ayumu is passing out flyers for the club&apos;s next live show. Someone comes to help her pass out flyers and informs her of a certain something.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_11", /*message*/"Ayumu wants to repay her fan club members for passing out flyers with her. She asks you for advice on how to show her gratitude.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_12", /*message*/"It&apos;s the night before Ayumu&apos;s live show, where she will display her gratitude to her fan club members. She gives you a surprise after finishing the preparations.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_13", /*message*/"It was a live show that showed appreciation to her fans! After the memorable show ends, Ayumu gets an idea.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_14", /*message*/"After a successful solo live show, Ayumu discusses her desire to grow even more as a school idol with you. But, the next day, you end up catching a cold...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_15", /*message*/"Ayumu has nursed you all the way back to good health, but now she&apos;s the one with a cold!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_16", /*message*/"The number of applicants seeking to join Ayumu&apos;s fan club is skyrocketing! What does Ayumu think of this?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_17", /*message*/"You and Ayumu began brainstorming what she could do for her next event to really make her fans happy. One day, Ayumu calls you, but...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_2", /*message*/"At lunch, you and Ayumu go to the cafeteria together. You&apos;re very impressed by Ayumu&apos;s homemade, beautifully done boxed lunch.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_3", /*message*/"On your way home together on the train, you realize this is the first time you and Ayumu are in the same club. Ayumu seems happy that the realization makes you glad.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_4", /*message*/"One day after classes, you&apos;re writing the club log in the clubroom. Ayumu asks what you write in it, so you read it to her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_5", /*message*/"It&apos;s the day of a live event. Among the Nijigasaki members participating, this is Ayumu&apos;s first show. You send them on stage, hoping Ayumu will have a good first one.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_6", /*message*/"Ayumu is worried about her solo event. She wants to convey to everyone that although she has a long way to go, she hopes everyone will watch over her as she grows.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_7", /*message*/"After the first solo live show, you go over the footage in the club room. Ayumu asks if she can look over the footage with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_8", /*message*/"You step out onto the balcony for a refresher during homework one night. Ayumu also happens to be outside.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_201_9", /*message*/"Ayumu checks the surveys on her fellow club members who are becoming more popular. She is feeling left behind because everyone is so busy, but...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_1", /*message*/"Freshman Kasumi seems to get teased by the other members. She gets mad, but you reassure her that it&apos;s only because they love her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_10", /*message*/"You and Kasumi decide to create an official fan club website for Kasumi. Will it have a successful launch?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_11", /*message*/"After Kasumi&apos;s official fan club website launches, she steadily gains members. Kasumi thinks of a plan to gain more subscribers than Ayumu and Ai. She comes up with a way to show everyone the wonders of her fan club.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_12", /*message*/"Kasumi decides to write a song about the joys of her fan club and debut it at the next live show. The song is complete, but she still seems worried about something.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_13", /*message*/"After the live show, Kasumi happily reads comments from her fans. You feel a little inadequate by comparison.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_14", /*message*/"You are now Member Number 001 of Kasumi&apos;s Fan Club, and she wants to talk to you about something.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_15", /*message*/"The Kasumin Fan Club bread roll event is a huge success! However, Kasumi seems to have found a fatal flaw in the Kasumin Fan Club!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_16", /*message*/"Kasumi opts to stay back after the club finishes their practice session. What is the reason behind her decision?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_17", /*message*/"As the Nijigasaki idols make steady progress in their activities, the number of fans in their fan clubs is on the rise as well. How is Kasumi&apos;s fan club doing?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_2", /*message*/"Kasumi shows up to the clubroom with a huge bag. What could be inside? Kasumi has a big smile on her face while she opens it up.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_3", /*message*/"The school has an open campus on the weekend, and the School Idol Club is poised to participate in the club introduction event.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_4", /*message*/"It&apos;s the final day of the vote for who will earn the center spot. Kasumi is confident with her incredible cuteness and tricky planning, but who will win?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_5", /*message*/"The members make it through the introduction of the club successfully. Kasumi talks with everyone as usual, but her feelings about everything are complicated.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_6", /*message*/"Kasumi wants to do something that will feel special to the people cheering her on at the solo event. She asks for advice on how to show off her cuteness in a way that grabs people and makes them feel closer to her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_7", /*message*/"Kasumi is still immersed in her lingering memories of the solo event. She tries to come up with a plan to show off her charm so her fans will praise her cuteness even more.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_8", /*message*/"Kasumi comes up with a brilliant plan that&apos;ll let her show off her charm to captivate her fans even more! What could it be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_202_9", /*message*/"Kasumi decides to create a fan club for herself but becomes competitive when she learns Ayumu and Ai already have fan clubs. How will Kasumi&apos;s fan club turn out?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_1", /*message*/"You talk with Shizuku, who is on a break from idol club practice for Theater Club. She practices for theater every day to make sure she&apos;s ready for stage rehearsal any time.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_10", /*message*/"Shizuku learned several things from μ&apos;s and Aqours. She knows what direction to go in now but still can&apos;t pin down what she needs to do.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_11", /*message*/"Shizuku aims to express herself as her own school idol through impersonating her Nijigasaki friends. She shares with you about what kind of school idol she wants to be!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_12", /*message*/"Shizuku realizes she wants to act and become someone else, so she creates a character! With only a few days left until the solo event, she throws herself into intense training.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_13", /*message*/"Shizuku successfully performed as the character you created together. Now that it&apos;s over, Shizuku is showing you a new side to herself, less worried than before.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_14", /*message*/"Shizuku&apos;s solo event goes off without a hitch. You notice her smiling happily to herself one day. What seems to have sparked such joy within her?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_15", /*message*/"Shizuku decides to show you around for a day of fun to thank you for everything. Now what kind of day will it be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_16", /*message*/"You have recently noticed further improvements in Shizuku&apos;s expressiveness. Apparently, a current obsession of hers is the driving force behind her growth. What exactly is this obsession of hers?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_17", /*message*/"Shizuku decides to make a fan club of her own, just like her favorite musical troupe. She wants to give her fans something entirely Shizuku-esque, but...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_2", /*message*/"Shizuku, who loves theater, loves making up stories in her life, too. Her imagination has been just as wild ever since she was a kid.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_3", /*message*/"One day, Shizuku asks you to be her reading partner. She seems unable to get into character for this particular part.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_4", /*message*/"When you return to the clubroom to pick up a forgotten item, you find Shizuku wriggling in a strange fashion. What&apos;s happening to her?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_5", /*message*/"You practice volleyball with Shizuku so that maybe she can overcome her lack of skill at ball games. Can she do it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_6", /*message*/"Shizuku is worried by the low number of fan messages before her solo event. She decides that she needs to work even harder to become a perfect school idol, but that&apos;s not the real solution.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_7", /*message*/"Shizuku asks for your impression of her solo event performance. She feels relieved by your response but is still a little uneasy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_8", /*message*/"To figure out what it means to be a school idol who is true to herself, Shizuku heads to Numazu to ask Aqours a question.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_203_9", /*message*/"After hearing what Aqours had to say, Shizuku goes to see Honoka for even more answers. She finds the exchange between the μ&apos;s members eye-opening.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_1", /*message*/"Karin is never lacking in the effort department. One day, when you head back to the club room, you find Karin there, staying behind after everyone left.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_10", /*message*/"Karin still seems a bit off, so you call out to her while she&apos;s practicing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_11", /*message*/"Concerned, you reach out to Karin, but she dodges your questions by asking you to continue watching her. The preparations for the next live show begin. What kind of performance will she put on?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_12", /*message*/"You make a song demo for Karin different from her usual style. She&apos;s interested and decides to perform it at the next live show. The day before the show, she asks you something she&apos;s been thinking about for a while.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_13", /*message*/"The song you created for Karin, who wanted to meet everyone&apos;s expectations, had the message that she can rely on others more and be honest. How does Karin feel after performing a song like that at the live show?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_14", /*message*/"After a successful live show, you notice Karin wandering around town one day and call out to her. Where might she be heading?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_15", /*message*/"Karin and you end up going on a date to the zoo. And why the zoo? For the pandas, of course!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_16", /*message*/"Karin is serious when it comes to both her school idol and her modeling activities. What is her reaction when you suggest that she start up a fan club?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_17", /*message*/"Karin is hesitant about creating a fan club due to her past experiences in an amateur model fan club. She said she got too fired up about it, but what could that mean?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_2", /*message*/"Karin says she was looking for you, and it&apos;s for a...date?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_3", /*message*/"You&apos;re worried about Karin because she&apos;s staying after every day to practice, but once you hear what she has to say...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_4", /*message*/"After hearing how satisfied Karin is being in the School Idol Club, you want to support her even more. One day, she comes to you wanting to discuss something about performing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_5", /*message*/"Karin doesn&apos;t know how to use her strengths, but the other members help her figure it out. Just practicing seems to have brought her to a stand-still, however.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_6", /*message*/"Karin isn&apos;t getting as many followers on social media lately. At this rate, it may affect her solo event. What&apos;s her new strategy for bringing up her follower count?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_7", /*message*/"Kasumi keeps staring at Karin one day in the clubroom after the solo event has ended. What does Kasumi want to ask her?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_8", /*message*/"After talking to Kasumi, Karin is motivated to find what makes her unique. Meanwhile, the other club members say they want to put on more enticing performances, so Karin watches over their practice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_204_9", /*message*/"You try to convince Karin that her dancing is more mature and captivating than any of the other girls&apos;, but she doesn&apos;t seem happy. The girls go to a diner together after club practice, but she&apos;s still acting strange.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_1", /*message*/"Ai is energetic and gets along with everyone. As popular as ever today, everyone seems to want to talk to her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_10", /*message*/"Ai decides she will write song lyrics for the next event for Misato and all of her Ai Pals. This is her first time attempting anything like this, and she finds herself struggling.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_11", /*message*/"Ai takes your advice and enthusiastically puts her true feelings into lyrics. Meanwhile, Misato wants to see you, so you go to her house where she brings something up.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_12", /*message*/"You learned that Misato is the manager of the Ai Pals group and planning a surprise for Ai. Ai is also working on writing song lyrics as a surprise for her Ai Pals.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_13", /*message*/"At the event, Ai unveiled a song she wrote the lyrics for with her Ai Pals in mind. Her surprise for her Ai Pals was a big success! But what surprise do the Ai Pals have in store for Ai?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_14", /*message*/"Ai&apos;s solo event is a huge success! You and Ai decide to head over to Harajuku to watch another school idol group&apos;s live show.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_15", /*message*/"Ai has revealed an unexpected side to you: She&apos;s afraid of thunder. You invite her to go see another school idol live show together, but she appears to already have other plans.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_16", /*message*/"Ai invites you out on a date after finding you pondering over what to do on the weekend. She plans on showing you around town all day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_17", /*message*/"Ai is always on the lookout for fun things to do. So what&apos;s this game she&apos;s come up with for everyone to play?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_2", /*message*/"Whether older or younger, Ai has so many friends. So, she invites them all to the club&apos;s first karaoke session!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_3", /*message*/"Things are always bustling around Ai, and that attracts people to her. One day, you end up having lunch with her and Rina.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_4", /*message*/"Ai loves her grandma and older sister more than anything. You think that&apos;s where she gets her friendliness, but what is this &quot;help-help situation&quot; she speaks of?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_5", /*message*/"Ai wants to make everyone smile with her school idol performances. On the day of the show, just how does it turn out?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_6", /*message*/"What Ai wants most is to become friends with everyone, and for everyone who likes her to become friends, too! What strategy will she come up with to make this happen?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_7", /*message*/"Ai invites you to celebrate after her solo event ends without a hitch. Where could she be taking you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_8", /*message*/"After going to Ai&apos;s family&apos;s monjayaki shop, you see where she gets her friendly nature from. One morning, Ai asks what your plans are after the club. It seems that there is someone she wants you to meet.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_205_9", /*message*/"You meet Ai&apos;s friend Misato, who she loves like a sister. Her request for you to support Ai gives you motivation. Meanwhile, Ai is happy to learn about the Ai Pals group. What exactly is Ai Pals?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_1", /*message*/"As usual, everyone&apos;s ready to start club practice, but where&apos;s Kanata? You go off searching for her and find her sleeping in the nurse&apos;s office.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_10", /*message*/"After asking Haruka how she really feels, you decide to call Kanata up to the roof and tell her the truth.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_11", /*message*/"Kanata is staying late after practice every day. She&apos;s bursting with motivation after learning Haruka&apos;s true feelings and makes a decision.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_12", /*message*/"Kanata puts all of her feelings into her song and finishes it the day before the live show. She&apos;s worried whether everyone will like it, but your support gives her confidence.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_13", /*message*/"The live show was a huge success! Kanata is relieved that she was accepted for who she is. Then, she receives a message from Haruka.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_14", /*message*/"Kanata pulls off a hugely successful solo event and makes amends with Haruka! After the event, you get a call from Kanata to hang out.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_15", /*message*/"You tag along with Kanata and Haruka on their fishing trip. You decide to head over to Uchiura, where Chika and Kanan decide to join in too!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_16", /*message*/"Kanata is already in the clubroom when you drop by for lunch. Her delicious-looking boxed lunch is all handmade. What goodies are in it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_17", /*message*/"Kanata had originally thought it was too much of a pain to make a fan club, but after hearing that her fans would be at her beck and call, she finally agreed to make one! What could she be planning to do with it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_2", /*message*/"You head over to Kanata&apos;s class to make sure she gets to practice on time, but you can&apos;t find her. Where could she be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_3", /*message*/"As you write lyrics during club, Kanata comes over to you. She tells you all about how much she loves her little sister, Haruka.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_4", /*message*/"Kanata approaches you in the cafeteria during lunch. She wants you to eat some of her lunch because she made too much.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_5", /*message*/"Kanata falls into a deep sleep as soon as practice ends. Everyone&apos;s worried because she just won&apos;t wake up. You suddenly recall the reason Kanata explained to you as to why she&apos;s always sleepy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_6", /*message*/"Kanata is excited to have everyone hear her wish at her solo event. What exactly is her wish?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_7", /*message*/"Kanata is in a trance after her successful solo event. What is your reaction to seeing her think about what more she could do for her fans?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_8", /*message*/"You and Ayumu are eating lunch in the courtyard to enjoy the nice weather when Kanata appears, hysteric, out of nowhere. You ask her what happened.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_206_9", /*message*/"Kanata is sad because she thinks Haruka doesn&apos;t like her. She&apos;s been too troubled about it to sleep at night. You stay behind with Kanata, who has fallen sound asleep in the club room, and ask her about Haruka on the walk home.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_1", /*message*/"Setsuna spends her days as the school idol Setsuna Yuki, but also as the student council president Nana Nakagawa. How does that make you feel?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_10", /*message*/"Setsuna spends the night at your house. You finally decide to ask her about the conversation with her parents that led her to run away from home.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_11", /*message*/"After hearing your advice, Setsuna decides she will try to make her parents understand what she loves. Although her decision has been made, she seems nervous when it comes time to actually call them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_12", /*message*/"Setsuna calls her parents and invites them to her performance so they can understand what she loves. The day before the show, Setsuna suddenly disappears from the club room. You go looking for her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_13", /*message*/"Setsuna put on a heartfelt performance to convey her love for everyone who supports her, as well as her parents. What do Setsuna&apos;s parents think?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_14", /*message*/"Setsuna&apos;s event is a roaring success and her parents approve of her school idol activities! After the event, you spot Setsuna and Riko out in town. What does this odd pair have in common?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_15", /*message*/"One day, after Setsuna and Riko bonded over their shared interests, you decide to join in for a gaming session in the clubroom. Games are just one more thing that she loves.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_16", /*message*/"Setsuna is not only happy with her school idol life, but also with her hobbies that she loves. One day, you find Setsuna in the clubroom in a cheerful mood.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_17", /*message*/"Setsuna feels motivated to keep working hard after reading her fan letters. You go to her to make a suggestion.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_2", /*message*/"You respect Setsuna for working so hard as both of her personas, Setsuna and Nana. Things seem to be getting out of hand, however, leading Setsuna to say she has to skip practice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_3", /*message*/"Setsuna is hiding her school idol life from her parents. There&apos;s one more thing she loves as much as school idols, but what is it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_4", /*message*/"Setsuna loves manga and anime. So, you invite her to your house where you have the whole collection of manga she wants to read.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_5", /*message*/"Just like anime and manga, school idol stuff is banned at Setsuna&apos;s house. That&apos;s why she uses the fake name &quot;Setsuna Yuki&quot; to be in the club. Seeing how passionate she is, you help her with student council stuff alongside Shizuku and Rina.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_6", /*message*/"Setsuna is pushing herself harder and harder as her solo event nears. Seeing her like this worries you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_7", /*message*/"Setsuna is unusually late to the event because her parents held her back. Her conversation with them afterward also goes poorly and she runs out of patience.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_8", /*message*/"Setsuna talks to her parents about being a school idol for the first time since stepping down as student council president. She&apos;s annoyed with them for not understanding her and decides to run away from home. She heads to Karin and Emma&apos;s dorm room for her first night away.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_207_9", /*message*/"Setsuna is still living away from home. After letting Setsuna spend the night at her house, Kasumi is in desperate need of your advice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_1", /*message*/"Emma works so hard every day as a school idol, but why did she leave Switzerland to come to Japan in the first place?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_10", /*message*/"You and Emma hold a meeting after practice to discuss the new song. She offers a suggestion.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_11", /*message*/"You go with Emma to the roadside stage where she always sings. She&apos;s singing alone as usual, but then, a boy starts to sing along.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_12", /*message*/"You come across Emma sighing in the club room one day before the live show. It&apos;s unusual for her, so you ask her about it and she shares that she&apos;s not feeling confident.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_13", /*message*/"Emma finished her live show that she wanted to heal people through. Meeting with her fans at the show deepens her resolve!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_14", /*message*/"You head over to the clubroom early one day to find Emma already there. What has she been doing all morning?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_15", /*message*/"You are grateful to Emma for always cleaning the clubroom each morning to keep it spick-and-span. One day, you find Setsuna consoling Emma. What could have happened to her?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_16", /*message*/"You and Emma are searching for clues about the school idol she looked up to. On the way home, the two of you spot a photo studio offering kimono dressing and decide to head inside.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_17", /*message*/"Emma was delighted that the studio you both stumbled upon would take photos of her in a kimono. A conversation starts up as you two look over the finished products, and Emma reveals a surprising turn of events.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_2", /*message*/"Emma came to Japan after falling in love with school idols from a video she saw as a child. You ask her about her life in Switzerland, wondering what it was like.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_3", /*message*/"You and Emma promise to hold a school idol concert in Switzerland someday. One day, the club members discuss what kind of school idols they want to become. What does Emma say?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_4", /*message*/"Emma decides to find out what kind of school idol she wants to become by watching some school idol videos. Then, in Emma&apos;s room you discuss what to do to prepare for the next live show.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_5", /*message*/"Seeing Emma, you feel like she&apos;d be the kind of school idol that shares her kindness with everyone. You decide to speak with her about something.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_6", /*message*/"Emma decides on a theme for her solo event but can&apos;t come up with any concrete ideas. What exactly does healing mean?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_7", /*message*/"One day, you come across Emma watering plants in the courtyard for an underclassman. While you help her, you&apos;re reminded of the last solo event.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_8", /*message*/"Emma received cookies from an underclassman as thanks for watering the plants. While eating them in the club room with everyone, Emma talks about what happened when she received the cookies.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_208_9", /*message*/"Emma asks you to volunteer at the daycare with her on Sunday. Since it&apos;s rare for Emma to ask you for anything, you happily accept, but then...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_1", /*message*/"Rina arrives as you and Ai are talking. She&apos;s surprised that you can tell how she feels before she changes the expression on her board.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_10", /*message*/"Rina is working hard to improve her social media presence so she can connect more with everyone. One day, she calls you to the rooftop and asks for your advice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_11", /*message*/"Rina isn&apos;t sure if she should stop using her Rina-chan Board. What decision does she come to after posting her solo event video and reading comments from her fans?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_12", /*message*/"Rina decides she won&apos;t use her Rina-chan Board at her next live show. The day before the live show, she informs you of her decision.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_13", /*message*/"Rina did her first live show without her Rina-chan Board, hoping to make it her best performance yet. How did it go?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_14", /*message*/"Rina&apos;s event is met with huge praise. While everyone practices as usual, something about Rina seems off. She always rushes to leave the minute practice is over. What is she doing after school?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_15", /*message*/"Rina has been looking after a kitten on campus after school. Upon realizing this, the club members all decide to take care of it. One day, Rina bursts into the clubroom in a panic.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_16", /*message*/"Fishpuff has settled in nicely amongst the club members at Nijigasaki. She has also become a popular addition to the whole school and is thought of like an idol by all.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_17", /*message*/"Rina launches her fan club to connect with her fans even more. It seems she already knows exactly what she wants to do with them first, too...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_2", /*message*/"Thanks to the Rina-chan Board, Rina can connect with the people around her. She says she wants to connect with even more people.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_3", /*message*/"You invite Rina to a school idol show. Rina is very surprised to see how many people are there to see a school idol.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_4", /*message*/"Rina works hard at practice to connect with people at shows, just like how she saw before. However, there&apos;s a problem she can&apos;t ignore when it comes to performing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_5", /*message*/"The day of Rina&apos;s first show has arrived, and she&apos;s ready to stand on stage with her new equipment. She performs, hoping she can connect with everyone that came to see her, but will her feelings get through?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_6", /*message*/"Rina is seen by more people now that she&apos;s a school idol. She wants to connect with even more people and invite everyone from school!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_7", /*message*/"Rina is absentminded after her solo event. Kasumi and Shizuku are worried and come to you for help. You try asking Rina about it, but...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_8", /*message*/"Rina is still remembering her solo event. She realizes again that she wants to treasure her connection with everyone who supports her. In order to do this, she asks Ai for advice about social media.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_209_9", /*message*/"Rina is delighted by her first selfie with you and Ai. She begins posting her own selfies to social media and gets more hits. With the increase in her number of views, Rina even gets featured on television!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_2_1", /*message*/"Singing and dancing aren&apos;t the only things that make up a live show! There&apos;s something behind it all.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_2_10", /*message*/"Eli practices hard to show off her dazzling dance skills. However, it seems as though she has some apprehensions about taking to the stage on her own.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_2_11", /*message*/"Eli has carefully prepared a solo live show that is uniquely her own. On the day of her big event, you aren&apos;t her only passionate fan in the audience...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_2_2", /*message*/"Eli is the student council president of Otonokizaka High. You sit in on student council, but you end up doing much more?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_2_3", /*message*/"Thanks to Eli, your support of their club activities is going well, leaving you reassured. But then you hear something.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_2_4", /*message*/"Eli&apos;s scream echoes through the quiet school. Is she just startled, or could there be something wrong?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_2_5", /*message*/"You find out about Eli&apos;s appeal, and everyday club life gets better and better!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_2_6", /*message*/"With you to support her, Eli&apos;s been having some pleasant days. It seems like her younger sister Alisa is curious about you, as well.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_2_7", /*message*/"Eli is thinking about you more after Alisa&apos;s passing comment. She wants to rely on your support, even when she&apos;s getting ready for her solo performance.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_2_8", /*message*/"Though Eli has agreed to each member of μ&apos;s having a solo performance, she can&apos;t seem to get in contact with the chairwoman for her approval. You worry about whether or not the show can go on at all.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_2_9", /*message*/"The chairwoman has still not approved the solo live shows, but the preparations must begin regardless. You decide to help out Eli.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_3_1", /*message*/"Now that you&apos;re helping out μ&apos;s with their club activities, you sit down to talk with Honoka, Umi, and Kotori, who were friends before they became school idols.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_3_10", /*message*/"Kotori&apos;s solo live show will also feature a fashion show. She is filled with enthusiasm about bringing everyone joy by showing off her style.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_3_11", /*message*/"Preparations for Kotori&apos;s solo live show proceeded full steam ahead once she decided to put on a fashion show! Kotori wears the outfits she made with all her heart and goes on stage for the main event.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_3_2", /*message*/"Kotori is usually so kind, supporting Honoka and Umi. However, she has an issue she just can&apos;t compromise about for any reason!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_3_3", /*message*/"μ&apos;s&apos; costume designer is Kotori. Now that you know her quirk, you suddenly run into her on the street. Wait, is that really Kotori?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_3_4", /*message*/"Kotori is working at a maid cafe under the pseudonym Minalinsky. Working a job and being an idol has her busy, and she&apos;s worried about μ&apos;s&apos; costumes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_3_5", /*message*/"Seeing that Kotori is worried about her costume design, you take her to a museum. She looks heartened to have someone like you around when she&apos;s feeling down.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_3_6", /*message*/"Kotori seems very glad that you helped her, and that she got to go out with you. The subject of conversation naturally shifts to you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_3_7", /*message*/"Kotori cares about spending time with you, just like how she cares about Honoka and Umi. Kotori wants to check something with you before doing μ&apos;s&apos; solo live show.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_3_8", /*message*/"Kotori seems to be more excited about watching everyone else&apos;s solo live shows than performing her own. She discusses what kind of performance it should be with you. However...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_3_9", /*message*/"Kotori loves being on stage with the other members, so she is not sure what to do for her own solo live show. You help her discover what she wants to do.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_4_1", /*message*/"Now that you&apos;re helping μ&apos;s, you decide to ask Umi how she feels about school idols. What&apos;s a school idol to Umi?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_4_10", /*message*/"Umi goes to an amusement park with her worries about her solo live show in tow. Her fears gradually fade away without her even realizing it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_4_11", /*message*/"With the courage she gained at the amusement park, Umi wants to put on a live show performance that creates a fun atmosphere for everyone. And so, she takes to the stage to do just that.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_4_2", /*message*/"Honoka&apos;s and even Umi&apos;s dream is to be a school idol. You find out that Umi handles most of μ&apos;s&apos; lyric writing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_4_3", /*message*/"You get Umi to show you how she writes lyrics at her house. While she passionately writes, you...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_4_4", /*message*/"You feel yourself being drawn to Umi as you watch her many expressions as she writes. One day, you go with her to her archery tournament.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_4_5", /*message*/"You begin to see many sides of Umi&apos;s charisma outside of club activities. You both want to go on getting to know each other more.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_4_6", /*message*/"You&apos;ve been providing μ&apos;s with solid support and getting closer to Umi. It seems, then, that she wants to express her feelings for you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_4_7", /*message*/"Umi wrote you a letter full of gratitude. You receive this passionate letter, and...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_4_8", /*message*/"You and Umi decide to work together to prepare for her solo live show when you discover an unexpected weakness of hers.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_4_9", /*message*/"Umi is worried and does not feel like she has the confidence to stand on stage alone. You invite her out in the hope of inspiring her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_5_1", /*message*/"Rin is full of energy. You go to greet her as well as Maki and Hanayo.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_5_10", /*message*/"Rin wants everyone to have fun at her solo live show... But what exactly is &quot;fun&quot;?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_5_11", /*message*/"Rin wants her audience to have just as much fun as she does at her solo live show! She heads to the show venue, carrying her handmade maracas to give out to every attendee.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_5_2", /*message*/"Hanayo and Rin always get along. You ask if your assistance is required for anything.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_5_3", /*message*/"You&apos;re filling in for Hanayo by cheering on Rin.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_5_4", /*message*/"Rin looks so happy eating Hanayo&apos;s rice balls. But she seems somewhat embarrassed, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_5_5", /*message*/"Rin is so happy you&apos;re there to cheer her on that she can hardly taste the ramen she&apos;s eating!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_5_6", /*message*/"Rin places great stock in your support. Will you be able to go out together if she works hard at her club activities? Well, she&apos;s planning to make sure you do!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_5_7", /*message*/"Rin is looking forward to club time and outings with you, but her reaction is a bit different when her solo is mentioned.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_5_8", /*message*/"Rin is not so enthusiastic when you suggest starting to prepare for her solo live show. What could be the problem?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_5_9", /*message*/"Rin decides to give her all for her upcoming solo live show. However, what kind of solo live show should she put on?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_6_1", /*message*/"Now that you&apos;re helping μ&apos;s, you decide to talk to their song writer, Maki.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_6_10", /*message*/"Maki wants to show everyone a good time at her solo live show. What does &quot;having a good time&quot; mean to her fans?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_6_11", /*message*/"Maki wants to share the gift of a happy moment together with her audience during her solo live show. On behalf of her fans, you suggest what you think people want to see during her performance. Maki puts her trust in you and goes up on stage...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_6_2", /*message*/"Maki tells you she doesn&apos;t feel like she needs your help. Even still, she doesn&apos;t seem to want to reject you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_6_3", /*message*/"Although awkward, Maki tells you kindly that she&apos;d like to get along better with you. You meet coincidentally in the music room, and...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_6_4", /*message*/"Talking while you both played piano has brought you closer together, and you relate to each other&apos;s reasons for playing. Maki just so happens to walk by while you&apos;re composing, and...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_6_5", /*message*/"Maki tells you that you have a knack for writing music. You feel so inspired by Maki&apos;s kind words, and by μ&apos;s&apos; music in general.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_6_6", /*message*/"Maki welcomed you with open arms, saying she could make a new μ&apos;s with you. This change of heart appears during the filming of her self-introduction movie, as well.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_6_7", /*message*/"Maki can&apos;t stop thinking about you and seems hesitant. It&apos;s like she can&apos;t give you a straight answer, even about solo live show ideas.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_6_8", /*message*/"Maki says that there&apos;s no point in performing a solo show if it&apos;s no different from a regular live show. The two of you go to ask the Nijigasaki girls for their insight as soloists, but Maki seems more fixated on something else.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_6_9", /*message*/"Maki ponders the purpose of a live show all for herself. The answer gradually becomes clear to her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_7_1", /*message*/"Nozomi is glad an interesting girl has arrived, but what does that mean?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_7_10", /*message*/"Nozomi ends up prioritizing others over her own solo live show preparations. However, she realizes there is somebody waiting for her performance.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_7_11", /*message*/"Nozomi doesn&apos;t show her emotions, but she has strong intentions for her solo live show as long as there are people looking forward to watching her perform solo. Now that you&apos;re done preparing, you head over to the shrine.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_7_2", /*message*/"Nozomi is working as the vice president of the student council. You get to see how she goes about her school life.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_7_3", /*message*/"Nozomi&apos;s fortune telling has a shocking outcome!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_7_4", /*message*/"You receive a very bad fortune that only Nozomi&apos;s advice can help you out of!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_7_5", /*message*/"Nozomi&apos;s advice paves the way for you to pass the upcoming test.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_7_6", /*message*/"You&apos;ve managed to naturally get along with everyone, thanks to Nozomi. It looks like she&apos;s waiting for you in the clubroom today, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_7_7", /*message*/"Nozomi is happy when you come to the clubroom, but she acts strange when you try to talk about her performing solo.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_7_8", /*message*/"Nozomi is thrilled to put on a solo live show since it will be unlike any μ&apos;s has done before. You pledge your support for her and for her performance, but she doesn&apos;t react quite how you&apos;d expect.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_7_9", /*message*/"Nozomi promises to reach out if she has any trouble, but she has yet to ask for your help. You wish she would stop helping others and start focusing on her own solo live show.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_8_1", /*message*/"What does Hanayo love more than anything else? The answer is, of course...");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_8_10", /*message*/"Hanayo gets to work to create a show only she is capable of, one that makes everyone watching want to become school idols themselves.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_8_11", /*message*/"Hanayo wants to put on a solo live show that inspires others to become school idols themselves! The big day finally arrives, and Hanayo has practiced her heart out to share her feelings with the audience.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_8_2", /*message*/"Hanayo was reticent at first, but Rin took her hand and led the way.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_8_3", /*message*/"You see Hanayo as you walk through Akihabara in the morning, but she doesn&apos;t seem like her usual self!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_8_4", /*message*/"Hanayo seems happier than usual today. What could the reason for that be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_8_5", /*message*/"Your bond with Hanayo deepens after going out with her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_8_6", /*message*/"The bond between you and Hanayo is gradually growing stronger. Though she wants to work at morning practice with you, there&apos;s something she&apos;s worried about.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_8_7", /*message*/"With Nico&apos;s help, Hanayo has started practicing for morning practices. Will her efforts pay off in her solo performance?");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_8_8", /*message*/"Hanayo seemed excited and ready to give it her all for her solo live show, but she clearly appears to be worried about taking the stage on her own. You step in to help put her mind at ease.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_8_9", /*message*/"Hanayo wants to work hard to prepare for her solo live show, but worries that she may be unable to. However, you come up with a solo live show that only she can pull off!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_9_1", /*message*/"You&apos;re going to help μ&apos;s with club activities, but one of the group doesn&apos;t seem very happy about it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_9_10", /*message*/"Nico wants to create the cutest solo live show around, yet she seems to look sadder and sadder as the day of her performance nears.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_9_11", /*message*/"She always seems so confident, but she does have a sensitive side. Nico has diligently prepared for her solo live show. The day of the show has finally arrived, and someone unexpected is out there in the audience.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_9_2", /*message*/"You want to show Nico how serious you are, but she just can&apos;t hide her doubt about you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_9_3", /*message*/"You work hard to meet expectations, and Nico starts to notice the passion that drives you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_9_4", /*message*/"Nico asks you why you don&apos;t become a school idol even though you love them so much.");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_9_5", /*message*/"You want Nico to accept you. Now it&apos;s time to show off your special training!");
INSERT INTO `m_dictionary` VALUES (/*id*/"member_story_description_9_6", /*message*/"Nico has acknowledged you as a comrade in creating μ&apos;s&apos; performances. Eli and Nozomi are pleased with this, but what does Nico herself think?");
