INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000110014", /*message*/"Coming up with lyrics sure is tough stuff. Like, all I can come up with is &quot;Yayyy!&quot; and &quot;Nooo!&quot; and stuff.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000110015", /*message*/"I thought I&apos;d get better at studying if I became a school idol, but that was just wishful thinking.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000110024", /*message*/"Eli&apos;s our school&apos;s student council president. It&apos;s great that we have someone so responsible around!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000110025", /*message*/"I think even I&apos;d have good grades if Eli were a teacher here! Urgh, no need to give me that look.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000120012", /*message*/"Apples, mikans, and cherries! How about munching on some fruit and relaxing?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000120013", /*message*/"Kotori made me such a cute costume!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000120014", /*message*/"I&apos;ve been with Umi and Kotori since we were little. I hope we&apos;ll always be friends!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000120015", /*message*/"I had no singing or dancing experience, but I figured if I was going to go all out, being a school idol was my only choice!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000130012", /*message*/"I think minding the Homura Bakery would be fun in this outfit!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000130013", /*message*/"Taisho Roman style is really cute! It&apos;s a great combination of East and West!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000130014", /*message*/"Om, nom. Mmm, today&apos;s bread is as tasty as ever!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000130015", /*message*/"If there was a song about bread, I feel like I could put EVERYTHING into my voice when I sang it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000210014", /*message*/"I&apos;m Eli Ayase, a third-year at Otonokizaka High School. Good to work with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000210015", /*message*/"I spent my childhood in Russia. It&apos;s my other home country.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000210024", /*message*/"When you wear the same costume a lot, it starts to feel like a comrade you&apos;ve fought on the same stage with.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000210025", /*message*/"I&apos;d run into problems if I couldn&apos;t fit into my costume, so I&apos;m always mindful to maintain my figure.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000220012", /*message*/"I like sweet treats, but fruits are so nice and fresh that it&apos;s like my body is celebrating them!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000220013", /*message*/"Think peeling fruits is a pain? *Giggle* Let me peel them, then. Eat up plenty, okay?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000220014", /*message*/"Have you met my sister, Alisa? Cute little Alisa is like a treasure to me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000220015", /*message*/"I&apos;m the student council president of Otonokizaka, too. If you have any problems, come speak to me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000230012", /*message*/"A wedding dress-style costume, huh? *Giggle* It makes you think about a lot, huh?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000230013", /*message*/"If you were having a wedding, what season would you have it in? You&apos;d want to be a June bride, right? Ah, but I&apos;m getting ahead of myself.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000230014", /*message*/"Mm, well, I&apos;ve done ballet, so I&apos;m more flexible than most.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000230015", /*message*/"You don&apos;t need to be formal with me just because I&apos;m an upperclassman. We&apos;re both school idol friends here!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000310014", /*message*/"I&apos;m Kotori Minami. I&apos;ll do my very best to make our live shows as fun as can be!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000310015", /*message*/"Honoka and Umi have been my dear friends since we were little.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000310024", /*message*/"Umi can do both archery and Japanese dances. She&apos;s so pretty, and she can get a handle on just about anything.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000310025", /*message*/"My hair matches with Honoka&apos;s slightly. I really like that!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000320012", /*message*/"Do you like apples? I&apos;ll peel you some, so hold on.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000320013", /*message*/"I truly love fruit costumes! I really pay attention to the texture when I make them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000320014", /*message*/"I love sewing! I&apos;m so happy when I&apos;m making everyone&apos;s costumes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000320015", /*message*/"I&apos;m very careful with colors and textures when it comes to costumes. I&apos;m always trying to make them different.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000330012", /*message*/"I&apos;m a police officer today! Wearing the costume makes me feel like I&apos;m doing the actual job.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000330013", /*message*/"You&apos;re going to be bad because you want to get arrested? Oh no, you don&apos;t!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000330014", /*message*/"Nozomi sees everything with her fortune telling. She probably knows everything about me, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000330015", /*message*/"I don&apos;t exactly love studying in school, but...I do want to know as much as I can.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000410014", /*message*/"I am Umi Sonoda, a second-year at Otonokizaka High School. Pleased to make your acquaintance.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000410015", /*message*/"I&apos;m writing down phrases and my thoughts in my notebook, as a base for our song lyrics.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000410024", /*message*/"Writing lyrics doesn&apos;t require any kind of special abilities, but it probably needs imagination.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000410025", /*message*/"I still get nervous when I wear cute school idol costumes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000420012", /*message*/"Eating fruit in the morning apparently really wakes you up. How about we have some together next time?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000420013", /*message*/"I quite like this fruit costume. It&apos;s so colorful that just looking at it is fun.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000420014", /*message*/"Eli and Nozomi are members of the Otonokizaka student council. They do a lot of work for the school.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000420015", /*message*/"Honoka&apos;s house is a sweets shop that makes sweet buns. You should really try Homura Bakery&apos;s sweet buns!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000430012", /*message*/"Is this costume&apos;s skirt not too short?! I&apos;m going to talk it over with Kotori!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000430013", /*message*/"A yukata is nice and summery. I love how it&apos;s been arranged to be like a dress, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000430014", /*message*/"Hanayo and Nico know a lot about school idols. I have to study up, too!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000430015", /*message*/"*Stare* Oh, sorry! I ended up staring at you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000510014", /*message*/"I love moving around! There&apos;s nothing more fun than running or dancing!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000510015", /*message*/"Skirts are nice for keeping cool during the summer, but they&apos;re a little too cold in winter.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000510024", /*message*/"Umi&apos;s really grounded and beautiful, but she&apos;s kind of airheaded sometimes. It&apos;s really cute!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000510025", /*message*/"Nozomi says she can use spiritual power! But what is spiritual power, anyway?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000520012", /*message*/"I love fruits, but peeling them is so annoying. Kayo-chin peels them for me sometimes!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000520013", /*message*/"Kotori is amazing, making a costume based off of food! I want her to make a ramen costume, too!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000520014", /*message*/"Kayo-chin, Maki and me are all first-years. We all get along well!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000520015", /*message*/"I don&apos;t really know about cute hairstyles, so I think I&apos;ll ask Kotori.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000530012", /*message*/"This dancer outfit has so many beautiful accessories! It&apos;s so fun how they all jingle and stuff.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000530013", /*message*/"I love outfits that are easy to move around in! Time to dance my heart out!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000530014", /*message*/"Kayo-chin&apos;s so cute, so wonderful, so nice. I just love, love, love her!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000530015", /*message*/"You like school idols, too, right? I think we&apos;ll all get along really well!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000610014", /*message*/"I am Maki Nishikino, a first year at Otonokizaka High School. I&apos;m classmates with Rin and Hanayo.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000610015", /*message*/"You like μ&apos;s&apos; songs? *Giggle* Of course you do, I compose them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000610024", /*message*/"I love music. I compose songs for μ&apos;s.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000610025", /*message*/"Subjects I&apos;m bad at? Of course I don&apos;t have any of those! Well, I am a little less than good at PE.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000620012", /*message*/"I like to have fruits as they are, but having them arranged in a glass as dessert is pretty great, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000620013", /*message*/"This fruit-based costume is so fresh-looking and beautiful! It&apos;s like art brought up by nature.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000620014", /*message*/"Honoka sometimes acts on impulse, right? But that&apos;s good, it suits her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000620015", /*message*/"Eli is the student council president of Otonokizaka. She moves straight forward, resolutely. She&apos;s got that kind of strength.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000630012", /*message*/"You want to know the secret to my magic trick? Now, what ever are you talking about?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000630013", /*message*/"If I could read your mind like magic, I wouldn&apos;t have to go through all this frustration, you know?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000630014", /*message*/"I hadn&apos;t thought at all that I&apos;d become a school idol. *Giggle* It&apos;s a real surprise.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000630015", /*message*/"The costumes Kotori makes are always so cute! I&apos;ll have to do my best to make them look good on me, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000710014", /*message*/"I&apos;m Nozomi Tojo. I&apos;m a third-year at Otonokizaka High School. Good to meet you!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000710015", /*message*/"Curious about the way I talk? Ahaha, well, it suits me, right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000710024", /*message*/"I help around a nearby shrine. Come visit if you have time!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000710025", /*message*/"I&apos;ll hear you out if you have any troubles. My power can solve all problems!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000720012", /*message*/"Kotori makes her costumes with such gentle care, so they always feel great to wear.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000720013", /*message*/"Kotori and Umi are arguing over how long the costume skirt should be. A pretty tough problem.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000720014", /*message*/"You won&apos;t have any energy if you skip breakfast. I&apos;ll put plenty of fruits in this yogurt, so eat up!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000720015", /*message*/"Put this apple jam I&apos;m making on some toast when it&apos;s done! We can eat together.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000730012", /*message*/"I love Halloween costumes! They make me feel like I can use magic!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000730013", /*message*/"I mean, can&apos;t we wear Halloween costumes all year? They&apos;re so cute and stuff!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000730014", /*message*/"If you want info on school idols, just ask Hanayo or Nico-chi.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000730015", /*message*/"Eli-chi&apos;s really good at making accessories. The earrings she made for me are my treasure.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000810014", /*message*/"I love school idols, but I never thought I&apos;d become one myself!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000810015", /*message*/"Rin&apos;s always been there to take the lead, ever since we were little. I&apos;ve always looked up to her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000810024", /*message*/"All of Maki&apos;s songs are so beautiful, and they have this strength that stays in your heart. I love them!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000810025", /*message*/"You want to check out the school idol shop? Then let&apos;s run over right now!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000820012", /*message*/"Just wearing a fruit motif costume like this feels like it&apos;ll give you a ton of vitamins!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000820013", /*message*/"Rin, I&apos;ll peel this apple, so just hang on. Let&apos;s eat it up together!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000820014", /*message*/"Rin and Maki are in my class. They&apos;re great friends, and every day is fun!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000820015", /*message*/"Nico has pride as a school idol. I hope I can become like her someday!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000830012", /*message*/"Red, white, yellow, pink and purple. Hm, if I&apos;m making a costume, how many colors of flowers should I go with?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000830013", /*message*/"Red for pickled plum, white for rice, yellow for pickled daikon... H-Huh? Wait, we were talking about costumes, right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000830014", /*message*/"Kotori&apos;s really nice, and she&apos;s so good at being considerate. I really think she&apos;s wonderful!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000830015", /*message*/"I&apos;m not very athletic, but...I&apos;ll do my best to keep up with everyone!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000910014", /*message*/"If there was a school idol textbook out there, I&apos;d be on the cover!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000910015", /*message*/"Don&apos;t hope to make it a good show, vow to yourself to make it an amazing one!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000910024", /*message*/"I&apos;ve got to stop by the supermarket today. What should tonight&apos;s dinner be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000910025", /*message*/"Don&apos;t you think Eli and Nozomi are such busybodies? I&apos;m pretty grateful to them, though.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000920012", /*message*/"Strawberries, peaches, and cherries! Fruits are a perfect match for me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000920013", /*message*/"Kotori really put a lot of effort into this costume. I can&apos;t wait to get on stage in it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000920014", /*message*/"Om, nom. Hey, can I have your fries?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000920015", /*message*/"You want to study about school idols? That&apos;s a good stance!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000930012", /*message*/"H-Hey, don&apos;t touch my tail!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000930013", /*message*/"You should treat me better. That&apos;s a request right from Li&apos;l Devil Nico.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000930014", /*message*/"The new school idol magazine is on sale today! I&apos;m going to buy it with Hanayo!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1000930015", /*message*/"I&apos;m always, always going to be a school idol. And you should stick with me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010110014", /*message*/"I overslept! I&apos;d set an alarm, but I think I woke up and turned it off!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010110015", /*message*/"We&apos;ll usually practice our singing and dancing on the roof. It gives us a great view of all of Uchiura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010110024", /*message*/"Time for a strategy meeting for our new song! Everyone, gather up in the club room!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010110025", /*message*/"Our next song&apos;s going to be a great one!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010120012", /*message*/"I feel like I&apos;ve become a real cheerleader! Maybe I should start my cheerleading career?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010120013", /*message*/"We&apos;re always getting cheered on, so we&apos;re going to be the ones cheering this time!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010120014", /*message*/"When I&apos;m standing on the stage, the moment the light comes down on me, I feel like I&apos;m a different me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010120015", /*message*/"We&apos;ve practiced so much! We&apos;re definitely going to make today&apos;s show a success.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010130012", /*message*/"When I wear costumes like this, it makes me want to run towards the sea!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010130013", /*message*/"Look, look! Can you tell what the flag&apos;s pattern is?! It&apos;s a mikan! I love it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010130014", /*message*/"Your cheers have reached us! Thanks for always supporting us!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010130015", /*message*/"I want to run with Aqours as far as I can.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010210014", /*message*/"I want to shine with everyone in a new world!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010210015", /*message*/"I had no idea making a song with someone could be this fun. All the wasted time.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010210024", /*message*/"Me moving to Uchiura was by the guidance of the god of school idols. Heh, kidding.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010210025", /*message*/"Lots of people remember you when you become famous, but it&apos;s surprising when strangers call out to you, isn&apos;t it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010220012", /*message*/"Fight, fight! Hmm, should I say some other phrase? Cheering is pretty tough.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010220013", /*message*/"The mic part is a heart, see? It&apos;s small, but cute, isn&apos;t it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010220014", /*message*/"A friend from Otonokizaka sent a message cheering on Aqours. It&apos;s a little embarrassing, but I really liked it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010220015", /*message*/"I&apos;ll sing my heart out, and put my everything into the song.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010230012", /*message*/"I-I&apos;m not a real angel! This is just a costume, s-so don&apos;t pray to me like that!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010230013", /*message*/"This halo&apos;s like a tiara, isn&apos;t it? I feel like a princess with it on. An angel princess. Wow, that&apos;s even more out of my depth!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010230014", /*message*/"We&apos;re all going to get together and discuss the new song. I wonder what we&apos;ll come up with.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010230015", /*message*/"Energetic songs, heart-rending songs, cool songs. They&apos;ve all got Aqours&apos; mark on them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010310014", /*message*/"I wonder if I should cut my hair. Hm? It&apos;s fine as it is? Well, if you say so, I guess I could leave it be.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010310015", /*message*/"Sometimes Mari plays with my hair. It ends up in a weird shape if I don&apos;t stop her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010310024", /*message*/"If I ended up reincarnated, I&apos;d want to be a sea creature. I&apos;d be fine with something that swims around, or something that just stays still.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010310025", /*message*/"A sea animal I want to meet? Oh, there&apos;s plenty! Dolphins, whales, sharks. Okay, the shark I can stand to see from afar.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010320012", /*message*/"Roller skates are so easy to get around on, you know? If I&apos;m just going out a little, I think I could take these.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010320013", /*message*/"This is really nice and easy to move around in. I mean, I could wear this top pretty normally. It&apos;d be really cool in summer.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010320014", /*message*/"I get really nervous before live shows, but I never show it. I mean, I am the oldest one here.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010320015", /*message*/"When my heart gets really loud from pre-show nervousness, I make myself remember times I&apos;m diving deep into the sea.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010330012", /*message*/"This is my first time holding up a Japanese umbrella like this. It&apos;s got some nice aesthetics to it; I really like it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010330013", /*message*/"The hair accessory even has a fish on it! I&apos;m so glad that there&apos;s sea elements right down to the little details!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010330014", /*message*/"It&apos;d be nice if Aqours&apos; activities bring business to my family&apos;s diving shop.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010330015", /*message*/"If I hadn&apos;t become a school idol, I wouldn&apos;t have noticed how many people I could cheer up with my songs.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010410014", /*message*/"Our songs will have our audience&apos;s hearts aflutter!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010410015", /*message*/"Bringing the greatest of smiles to the audience&apos;s faces, at any time. That is a school idol&apos;s duty.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010410024", /*message*/"Giving things your all wholeheartedly at all times truly inspires people.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010410025", /*message*/"Eep! What are you doing?! What? I was furrowing my brow? Then say that, don&apos;t give me a noogie!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010420012", /*message*/"The cheerleader costume feels very much like a uniform. That is probably why wearing it is so sobering.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010420013", /*message*/"I quite like designs this simple. It is a little problematic how revealing it is, but I will close my eyes to that.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010420014", /*message*/"Since I&apos;ve started working with Aqours, I have learned the wonder of making people happy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010420015", /*message*/"And if I&apos;m going to do this, I&apos;m going to aim to do it perfectly. That is how we can do right by the people cheering us on.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010430012", /*message*/"It takes quite a bit of time and effort to wrap my hair like this.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010430013", /*message*/"Hm? Hmm? How do I tie the strings around my legs again? Intersect them like this? Hm, wait, was that wrong?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010430014", /*message*/"You should do things as much as needed until you can accept the results. That will always lead to good things.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010430015", /*message*/"The first cheers I heard from the stage still reverberate deep within my ears.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010510014", /*message*/"Can you please come with me to dance practice?! I&apos;ll treat you to ice cream later!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010510015", /*message*/"People have been recognizing me as You from Aqours. It kind of makes me blush!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010510024", /*message*/"When&apos;s the next live show? I want to sing my heart out again.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010510025", /*message*/"We&apos;ve made a bunch of Aqours songs, right? And we got this far all thanks to you and the team.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010520012", /*message*/"Is getting excited just from having a sailor collar like this a bit too...basic? But I like it, okay!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010520013", /*message*/"Your voice is key when you&apos;re cheering! Let&apos;s belt it out from the belly!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010520014", /*message*/"I&apos;m going to give today&apos;s live show my all! Our zest is going to energize the audience!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010520015", /*message*/"There was a lot of tough stuff to get through at first, but I wonder if I&apos;m a little bit more like a school idol now?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010530012", /*message*/"It&apos;s got a lot of small decorations and making it was really hard, but the feeling of accomplishment in the end was amazing!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010530013", /*message*/"Wanna touch the rabbit ears? They&apos;re surprisingly fluffy and feel really good to touch!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010530014", /*message*/"Let&apos;s make a song with a ship and sea theme next time!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010530015", /*message*/"I get a little scared when I think about what would happen to me if I didn&apos;t join Aqours.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010610014", /*message*/"The day my charisma rules this world draws ever closer! Be ready for it, humans!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010610015", /*message*/"You could search the whole universe over, but Aqours is the only school idol group with a fallen angel among their ranks!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010610024", /*message*/"Now, I&apos;m always unlucky, but I&apos;m worried that I might drag other people into my misfortunes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010610025", /*message*/"See, I&apos;ve got wings. They&apos;re as black as darkness, but they used to gleam like the whitest snow.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010620012", /*message*/"I&apos;ll cheer you on from the bowels of hell! Be inspired, little demons!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010620013", /*message*/"Roller skates are pretty nice when you get used to them! Just look at how beautifully I skate along-- W-Wait, how do you stop this thing?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010620014", /*message*/"I&apos;ve gotten through a bunch of live shows by now, so I wonder if the amount of my little demons has gotten to three digits?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010620015", /*message*/"Singing and dancing songs we all made together. Who would have thought there was something so fun on the surface?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010630012", /*message*/"I love how totally dark this costume is!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010630013", /*message*/"The way the wings are just bones is awesome. It&apos;s got that foreboding feeling in the midst of beauty. Pretty demonic, huh?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010630014", /*message*/"Let&apos;s put a cursed melody into our next song to bring out Aqours&apos; appeal even more!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010630015", /*message*/"One day, I&apos;ll defeat the lord of hell and succeed the throne myself!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010710014", /*message*/"There&apos;s so many English words in these lyrics, zura. What if I can&apos;t pronounce them all?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010710015", /*message*/"School idol songs sure are different from hymns and nursery rhymes, huh?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010710024", /*message*/"Even if I go out far away, I just can&apos;t calm down unless I smell the sea, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010710025", /*message*/"I want to write a story where Aqours are the main characters someday. Wait, that would mean there&apos;s nine main characters. That sounds tough, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010720012", /*message*/"I helped making the pom poms. The feeling of tearing plastic bags is surprisingly addictive.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010720013", /*message*/"Wearing this costume makes me want to cheer someone on, zura!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010720014", /*message*/"The scenery I saw from the stage during our first show was even more radiant than the sea. I can&apos;t forget it, even now.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010720015", /*message*/"Someone told me they started saying &quot;zura&quot; to mimic me! I don&apos;t know whether to be happy or feel bad for them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010730012", /*message*/"This is a ram horn, zura, not a goat&apos;s!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010730013", /*message*/"My shoulders are so fluffy and warm, zura!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010730014", /*message*/"Will people give me funny looks because I speak so weird for a school idol, zura?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010730015", /*message*/"I couldn&apos;t keep on being a school idol without everyone&apos;s help and support.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010810014", /*message*/"I take my hairstyle pretty seriously, and I got it perfect again today!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010810015", /*message*/"Kanan won&apos;t do anything if I touch her hair, so I have fun with it a bunch! She gets mad about it later, though.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010810024", /*message*/"Sorry! I ran into a fan of mine on the way here. It sure is tough being popular!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010810025", /*message*/"If we get our shininess all around the globe, world peace&apos;ll be real close!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010820012", /*message*/"Mmm. Should I put the ribbon on the headphone on the right? On the left, it kind of overshadows my curl.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010820013", /*message*/"The top is tight and sporty, and the bottom is all lacey and cute, with nice and active roller skates on your feet! This costume sure is packed with detail!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010820014", /*message*/"My heart-piercing, fiery passion will burn atop the stage!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010820015", /*message*/"You can&apos;t give up on anything before you do it! Even if I crash and get smashed to bits after trying, I won&apos;t regret it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010830012", /*message*/"This costume is so cute! It&apos;s like a doll&apos;s dress!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010830013", /*message*/"The rose patterns on the skirt are so elegant, I love them. What store can you get this from?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010830014", /*message*/"How about we make our next song a really hard rock one?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010830015", /*message*/"School idols put smiles on everyone&apos;s faces, right? Then we need smiles on our faces, first.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010910014", /*message*/"I pray to the gods that I won&apos;t trip on stage before I go on!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010910015", /*message*/"I&apos;ve got to practice really hard to make sure I don&apos;t fall behind everyone!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010910024", /*message*/"I hope our song can give someone the courage they need to take that first step.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010910025", /*message*/"It&apos;s really hard to learn singing and dancing, but...I&apos;ve always wanted to do this, so I&apos;ll never run away.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010920012", /*message*/"Eek! I can barely stand up straight! Ahh, I&apos;m slipping!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010920013", /*message*/"I used a lot of cheerleaders&apos; uniforms as reference when making this costume. They were all so cute!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010920014", /*message*/"If I&apos;m a school idol, will I get the chance to meet other school idols, I wonder?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010920015", /*message*/"The first time I took the stage, my mind was a total blank with nervousness and joy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010930012", /*message*/"I had a dream where I was speaking with my puppet! Maybe it&apos;s because I had it by my pillow when I went to sleep.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010930013", /*message*/"Circus costumes are packed with so much fun. Just like school idol costumes!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010930014", /*message*/"The costumes we all made together have all of our feelings in them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1010930015", /*message*/"It really is amazing, making something with your own abilities.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020110014", /*message*/"I&apos;ll do my best to be the ideal school idol!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020110015", /*message*/"I&apos;m starting to understand school idols more and more. This feeling must be...");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020110024", /*message*/"It sure feels good to stretch, doesn&apos;t it? I&apos;ve been sure to do mine before I sleep　lately.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020110025", /*message*/"Hey, I can touch my toes now! Check it out!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020120012", /*message*/"Eheheh. It&apos;s my first costume. Do I look cute in it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020120013", /*message*/"Give the ribbon in the back a touch. It&apos;s really soft!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020120014", /*message*/"I feel like I get more excited around you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020120015", /*message*/"The steps I take with you feel special.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020210014", /*message*/"I&apos;m very particular about my costumes, you know.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020210015", /*message*/"I wonder if I&apos;ve advanced even higher?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020210024", /*message*/"One, two, one, two. What do you think? Aren&apos;t I really putting in the effort?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020210025", /*message*/"Uwah, can I take a break?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020220012", /*message*/"*Giggle* I sure am cute, aren&apos;t I?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020220013", /*message*/"How about this pose? It&apos;s my Enchanting Pose Number 18!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020220014", /*message*/"Ahh! I spilled my treat! Didn&apos;t get anything dirty, though, so there&apos;s that!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020220015", /*message*/"Hey, come to rehearsal with me for a bit!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020310014", /*message*/"I&apos;ll do my best to become a school idol who moves people!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020310015", /*message*/"I&apos;ve built up just a bit of confidence. I&apos;ll do my best not to get too proud!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020310024", /*message*/"I&apos;m thinking of increasing my running distance a bit. What do you think?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020310025", /*message*/"I love moving around!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020320012", /*message*/"What do you think of this costume? It&apos;s a little embarrassing, since it&apos;s not like theater stuff.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020320013", /*message*/"Huh?! Make the skirt a little shorter? I&apos;ll... I&apos;ll think about it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020320014", /*message*/"I can really relax when I&apos;m speaking with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020320015", /*message*/"I&apos;m practicing my dances with Kasumi and Rina!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020410014", /*message*/"There can be a more mature kind of school idol, right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020410015", /*message*/"I think I&apos;m starting to understand things a little more.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020410024", /*message*/"When I&apos;m hungry after a lesson, I eat nuts.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020410025", /*message*/"I&apos;m really happy when I see results.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020420012", /*message*/"What do you think of this costume, from your point of view? And be honest, now!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020420013", /*message*/"You know what &quot;absolute territory&quot; is?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020420014", /*message*/"I&apos;m a little nervous. Hey, can you hold my hand? Aww, what&apos;re you getting all red for?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020420015", /*message*/"When you&apos;re watching me, I feel like I can be more daring than normal. Heheh.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020510014", /*message*/"Just leave it to me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020510015", /*message*/"Oh-hoh, now I&apos;m excited!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020510024", /*message*/"Ahh, it&apos;s so hot!
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020510025", /*message*/"Ever have Rinari&apos;s special drink? The flavor&apos;ll really surprise you!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020520012", /*message*/"I really love this costume! What do you think of it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020520013", /*message*/"Don&apos;t say my costume&apos;s too revealing, call me frugal with my cloth!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020520014", /*message*/"Ta-da! I almost wanna dance right here!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020520015", /*message*/"Hey, you sing too!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020610014", /*message*/"I wonder where my favorite blanket is?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020610015", /*message*/"I&apos;m reading this book, &quot;Quality Sleep.&quot; You can go right to sleep when you read this.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020610024", /*message*/"*Yawn* Oh, did you see that just now? That was just a deep breath.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020610025", /*message*/"I&apos;m really flexible, so I can sleep in any position.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020620012", /*message*/"I&apos;m like a princess, huh?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020620013", /*message*/"Hey, what kind of costume do you want me to wear?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020620014", /*message*/"Could you wrap me up with a blanket right now? It&apos;s not cold, but...I&apos;m sleepy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020620015", /*message*/"If you don&apos;t say ten good things about me, I&apos;ll go right to sleep.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020710014", /*message*/"My ambition to spread my love -- I&apos;m going to bring it to fruition!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020710015", /*message*/"I feel like I&apos;ve gotten one step closer to my goal!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020710024", /*message*/"When I say I &quot;love&quot; stuff, I get filled with energy!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020710025", /*message*/"Ah. A novel I love came out today.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020720012", /*message*/"Hey, don&apos;t tell anyone I&apos;m a little bad at tying a tie, okay?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020720013", /*message*/"With this costume, I feel like I could dance all night!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020720014", /*message*/"I can&apos;t really help making funny faces in front of a mirror. Oh, keep that secret!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020720015", /*message*/"What color should I do my lips? Oh, hey, could you pick for me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020810014", /*message*/"Let&apos;s do our best to be school idols! Woo!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020810015", /*message*/"I think I feel a bit more energized!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020810024", /*message*/"Stretches for stiff shoulders? I&apos;ve never done them. Why do you ask?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020810025", /*message*/"I sure get hungry when I practice, you know?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020820012", /*message*/"It&apos;s a bit like a national costume, right? I like it a bunch!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020820013", /*message*/"I want to talk over costumes with you　next!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020820014", /*message*/"I&apos;m going to go to Shizuku&apos;s place to pet her dog!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020820015", /*message*/"Karin gave me some nice nuts.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020910014", /*message*/"Comfy Clothes Are Best");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020910015", /*message*/"I&apos;m still growing, so maybe I should get my clothes a little bigger.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020910024", /*message*/"Just watch me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020910025", /*message*/"*Pant* *Pant* ...I really need more stamina.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020920012", /*message*/"Rina-chan Board says, &quot;Let&apos;s hop!&quot;");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020920013", /*message*/"I&apos;m proud of this costume. I spoke about it with Ai a bunch. I want to talk about the new one with you, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020920014", /*message*/"Jump, jump!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_1020920015", /*message*/"Do I look like I&apos;m having fun? I hope so.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000120012", /*message*/"What do you think? I&apos;m pretty good at my job as the face of my family business, huh?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000120013", /*message*/"Would you mind helping out at our shop?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000120014", /*message*/"I want to perform a live show where people have even more fun.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000120015", /*message*/"Every day is full of fun and joy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000230012", /*message*/"I feel so elegant when I put this costume on.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000230013", /*message*/"I used to dance Swan Lake all the time in ballet. Want to see? *Chuckle* Sometime later, okay?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000230014", /*message*/"Hm? What&apos;s the matter? I know you have something you want to say. If you don&apos;t start talking, I&apos;m gonna start tickling you!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000230015", /*message*/"I wish I could be with you more. I feel like I could talk to you about just about anything.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000320012", /*message*/"You want to practice using the sewing machine? That&apos;s awesome! You&apos;re welcome to come by and practice any time you like.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000320013", /*message*/"I&apos;ll be waiting in the room today, as usual. Come and see me, okay?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000320014", /*message*/"A new cheesecake shop opened up! Let&apos;s check it out on the way home.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000320015", /*message*/"Creating costumes is fun. It makes me so happy seeing my ideas take shape.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000330012", /*message*/"I-I&apos;m so embarrassed.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000330013", /*message*/"Is it cute? Oh, I&apos;m talking about the costume, not me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000330014", /*message*/"I wonder why I feel happy just from being with you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000330015", /*message*/"I need to start thinking about my next costume. I wonder what would be good?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000430012", /*message*/"If I were to hold anything, it&apos;d have to be a fan, right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000430013", /*message*/"I should be more elegant in my ways to match the feel of my costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000430014", /*message*/"I&apos;m gonna make you tag along with me all day today! *Chuckle* Just kidding.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000430015", /*message*/"*Yawn* Oh no! Pretend you didn&apos;t see that right now! Please!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000530012", /*message*/"Wanna get somethin&apos; to eat on the way home? There&apos;s a ramen place nearby I super, super recommend!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000530013", /*message*/"I wanna go to a theme park. I wanna ride the rides!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000530014", /*message*/"Do you think if I grow my hair out, I&apos;ll look more girly?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000530015", /*message*/"I love looking out at the crowd from the very edge of the stage! Oh, best of all is getting to see Kayo-chin and everyone sparkling right next to me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000630012", /*message*/"I want to show my true self to you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000630013", /*message*/"I&apos;m waiting for you, so hurry it up!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000630014", /*message*/"There&apos;s somewhere I want to stop by on the way back. Want to go with me? Th-This isn&apos;t a date!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000630015", /*message*/"You don&apos;t understand your homework? I suppose I could be convinced to help you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000830012", /*message*/"Frilly outfits are a little embarrassing, but they&apos;re so cute!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000830013", /*message*/"I want to wear this costume over and over again.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000830014", /*message*/"I wonder why I can&apos;t help but close my eyes whenever I eat a delicious meal?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000830015", /*message*/"You stay by my side for my sake, don&apos;t you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000930012", /*message*/"*Giggle* School idol costumes are the cutest, aren&apos;t they?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000930013", /*message*/"It looks good on me, right? I knew it would!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000930014", /*message*/"Why do I always wind up having so much fun when I&apos;m with you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2000930015", /*message*/"I&apos;m so cute, I might get flooded with TV interview requests!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010120012", /*message*/"A new world will be waiting for you if you take the first step! Let&apos;s get running!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010120013", /*message*/"My heart is filled with sparkling dreams. They&apos;re so bright and warm... I wish it could be like this forever.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010120014", /*message*/"I come up with great lyrics when I talk to you. You really do come up with good ideas when you enjoy yourself.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010120015", /*message*/"I want to do everything I can to create the best live show!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010130012", /*message*/"It&apos;s amazing the way costumes can open up your imagination. I&apos;m already thinking of dances I can do with this!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010130013", /*message*/"Hmm... I think I need to go on a diet... Huh? You don&apos;t think so? Aw, thank you! I&apos;m glad!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010130014", /*message*/"Ugh, Kanan&apos;s training regimens are way too hard! I&apos;m so exhausted...");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010130015", /*message*/"Hey, let&apos;s go to the beach! It&apos;ll be fun!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010530012", /*message*/"I&apos;m here with you at my beloved seashore. What more could I want? We have to enjoy this moment to its fullest!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010530013", /*message*/"When I take off the top, I&apos;m basically in a swimsuit. I&apos;m gonna go for a swim!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010530014", /*message*/"I lost my duck! I wanted to take it on a tour of all the beaches in the world one day! Captain Duck, where are you?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010530015", /*message*/"Huh? Don&apos;t I get scared diving from so high up? Not at all! It&apos;s such a rush!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010630012", /*message*/"Hmph, you there! Together with me, you shall fall in... Ahhh, why are you running away?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010630013", /*message*/"Whoa! H-Hey, what are you doing? This zipper is supposed to be left open! You don&apos;t have to zip it up!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010630014", /*message*/"Perhaps I should have made the wings a little bigger. I can&apos;t fly with these tiny things.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010630015", /*message*/"You can&apos;t become a fallen angel in a day. You must train diligently every day and strengthen your magical abilities.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010730012", /*message*/"I feel like I could speak with the angels right now, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010730013", /*message*/"I feel like my singing voice could reach all the way up into the sky.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010730014", /*message*/"Maybe I&apos;ll try making a cake at home.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010730015", /*message*/"I think one of the snacks is crispy fried dough cakes. Want to eat some together?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010830012", /*message*/"A wallflower? No, I&apos;ve just been waiting for you this whole time. You took so long to get here, I almost sprouted roots.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010830013", /*message*/"With the grace of a butterfly and as light as the wind, I will take you to the land of dreams.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010830014", /*message*/"Wanna go somewhere on our next day off? We haven&apos;t had any time because of all the practice and live shows, so we should go on a well-earned date!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010830015", /*message*/"Oh my gosh... A chairwoman&apos;s work is never done, is it? Hey, do you mind helping out? Just a teensy, weensy bit!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010920012", /*message*/"The pink, white, and blue in this costume make it look kinda like candy. It&apos;s so cute.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010920013", /*message*/"Is this a good spot for the ribbon? More to the right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010920014", /*message*/"I&apos;ve been on stage for so many live shows now, performing in front of people doesn&apos;t bother me anymore... I take it back, it totally does! I&apos;m so nervous!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010920015", /*message*/"When Aqours gets mentioned in a magazine, I feel surprised and a little embarrassed. But above all, I feel really happy!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010930012", /*message*/"*Giggle* I really love this costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010930013", /*message*/"I feel like eating some candy. Let&apos;s have some together.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010930014", /*message*/"I wanna go to lots of different places with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2010930015", /*message*/"I want some kind of spell cast on me so that I don&apos;t go back to sleep right after waking up.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020430012", /*message*/"Going out to town with you makes my heart pound.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020430013", /*message*/"I&apos;m ready to go on stage. Give me a shout whenever you want to see me perform!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020430014", /*message*/"Let me guess what your favorite thing is. It&apos;s me, right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020430015", /*message*/"You can get used to anything if you do it every single day. Except waking up in the morning, which is always hard.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020530012", /*message*/"You think this outfit makes me look like a party girl? Psh, yeah! These kinda clothes get me totally amped up!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020530013", /*message*/"You can gimme that look all you want, but I think I rock this look, okay?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020530014", /*message*/"Puns! Get your puns here! Fresh out of the oven!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020530015", /*message*/"I never fail to check up on the latest trends!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020630012", /*message*/"I came up with an actual pajama design for both of us that matches my costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020630013", /*message*/"I want you to shower me with compliments if I get through the live show without falling asleep.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020630014", /*message*/"I won&apos;t take my drowsiness up with me on stage.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020630015", /*message*/"Do you use a pillow when you sleep or not? I don&apos;t care either way as long as I fall asleep.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020730012", /*message*/"When I have a relaxing cup of tea at home, I start picturing what our next stage will look like!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020730013", /*message*/"I&apos;m conducting research into what height of high heel is the easiest to move around in and looks the most beautiful!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020730014", /*message*/"Um, do you mind if I ask you to record some late-night anime again? Thank you!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020730015", /*message*/"I&apos;m going to go buy a new book cover. What color should I choose?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020830012", /*message*/"I want to take pictures and send them to my little siblings.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020830013", /*message*/"Do I feel all nice and warm because of the weather? Or is it because I&apos;m with you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020830014", /*message*/"I love going to the park and basking in the sun.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_2020830015", /*message*/"Oh! I need to go buy a stationary set!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000120012", /*message*/"Believe in the future you want to see. That hope is what&apos;ll lead you to the most wonderful encounters in life!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000120013", /*message*/"The power to change your fate always starts with a hint of courage.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000120014", /*message*/"All of your smiles give us strength. That&apos;s why we always work so hard to make sure you&apos;re having a good time!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000120015", /*message*/"Live shows get me so worked up, I can&apos;t sleep the night before. Umi and Nico get mad at me &apos;cause I sometimes get bags under my eyes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000130012", /*message*/"Does Princess Otohime travel by turtle like the hero in that story?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000130013", /*message*/"I&apos;m curious about how the fish dance at the dragon king&apos;s undersea palace. I wanna draw inspiration from them for μ&apos;s&apos; choreography!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000130014", /*message*/"I&apos;m so, SO glad I met everyone in μ&apos;s!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000130015", /*message*/"You know what? Sometimes I think that I was born to be a school idol.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000220012", /*message*/"You know, I can&apos;t help but feel that when it&apos;s snowing, a miracle&apos;s about to happen.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000220013", /*message*/"This white fur is really adorable, isn&apos;t it? It&apos;s a little like the coat I wore as a kid, so I really like this.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000220014", /*message*/"If you&apos;ve ever got some trouble, just ask me for help, because you&apos;ve helped me so much!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000220015", /*message*/"You end up thinking about me during class, too? Come, now. I appreciate the sentiment, but you&apos;ve got to focus on your studies.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000220022", /*message*/"Are you nervous? I&apos;ll be cheering you on, so let&apos;s both give it all we&apos;ve got!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000220023", /*message*/"This costume makes me feel like we can make real progress as long as we&apos;re together.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000220024", /*message*/"*Giggle* It&apos;s adorable how Kasumi can talk for hours just about bread.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000220025", /*message*/"Everything catches my eye when I go to florists, so it takes me a while to choose what I want.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000230012", /*message*/"I got flower seeds as thanks for performing at the flower event. Want to help me grow them?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000230013", /*message*/"I think plant lovers are kind people, just like you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000230014", /*message*/"Whether they flower or merely sport leaves, all plants have their own wonderful qualities.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000230015", /*message*/"You won&apos;t be able to move forward if you&apos;re afraid there&apos;s no reward awaiting you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000320012", /*message*/"When I put on a costume, I feel all warm and fuzzy in my heart. Honoka said the same thing!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000320013", /*message*/"I&apos;m really happy you said I look cute. Actually... Would you say it again?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000320014", /*message*/"Do you prefer milk and sugar in your coffee? *Giggle* I want to learn your tastes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000320015", /*message*/"Welcome home, Master!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000330012", /*message*/"Huh, I&apos;ve got cream on my face?
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000330013", /*message*/"It came out all sweet and fluffy. Want to taste it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000330014", /*message*/"I can really focus when I&apos;m baking, so it&apos;s always a nice change of pace!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000330015", /*message*/"What kind of sweets do you bake? I&apos;d love to try them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000420012", /*message*/"Ack! Y-You&apos;re so close! What&apos;s gotten into you all of a sudden? My ribbon was crooked? You should&apos;ve just said so!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000420013", /*message*/"Let&apos;s try dancing while wearing our costumes. We&apos;ll have them on throughout the entire live show, so if anything is uncomfortable we must not overlook it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000420014", /*message*/"Strangely enough, I find it easier to write lyrics after talking to you. I wonder why.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000420015", /*message*/"We don&apos;t have practice today. Why do you look so surprised about that? Resting in moderation is an important part of training as well.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000420022", /*message*/"I&apos;m going to practice my choreography today. I hope you&apos;ll be watching!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000420023", /*message*/"I&apos;m not going to wait for a miracle to happen. I&apos;m going to make it happen right before everyone&apos;s eyes!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000420024", /*message*/"It&apos;s so difficult to think of lyrics. Maybe I just have too much I want to convey.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000420025", /*message*/"No need to overwork yourself. Come join me for a break.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000430012", /*message*/"I&apos;ll get you right through the heart with my Love Arrow Shot!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000430013", /*message*/"Would such a cute costume really work on me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000430014", /*message*/"I feel really focused when I wear a show costume. Battle mode? *Giggle* You know, you could probably call it that.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000430015", /*message*/"I want us to go on a long trip, to someplace far away. E-Er, nothing, nothing!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000520012", /*message*/"I&apos;ll make the live show so much fun, you&apos;ll forget all about how cold the snow is.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000520013", /*message*/"Hmm? Am I cold wearing shorts? Nah, I&apos;m fine. In fact, since I can move around easier in these, I think they&apos;re perfect!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000520014", /*message*/"My favorite type of ramen? Lemme think. Soy sauce, and miso, and salt, and pork bone broth... I love all of them!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000520015", /*message*/"I love getting my body moving! That&apos;s why I think dance practice is such a blast. I wanna try all kinds of different dances!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000520022", /*message*/"*Sob* I can&apos;t tie my tie right! Kayo-chin, come do it for me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000520023", /*message*/"I can&apos;t help but play with the frilly bits of my jacket... Oh no! I-It came off!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000520024", /*message*/"Don&apos;t I wanna grow my hair? Hmm, I know you can style your hair lots of different ways if it&apos;s long, but I like how easy my hair is to deal with right now.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000520025", /*message*/"Live shows make my heart pound, but it also races when I&apos;m alone with you. I&apos;m not even on stage or anything. Why is that?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000530012", /*message*/"Nice weather puts me in a good mood.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000530013", /*message*/"Where should we hang out next?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000530014", /*message*/"I want to have lots of live shows!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000530015", /*message*/"*Giggle* I don&apos;t quite get it, but I&apos;m glad.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000530022", /*message*/"You like fried rice more than ramen? That&apos;s quite the opinion, but...I approve! Fried rice is just as tasty!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000530023", /*message*/"A ramen bowl of happiness, delivered from me to you!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000530024", /*message*/"I tripped in the hurdle race during PE today! How long has it been since that happened?! It didn&apos;t hurt or upset me. I was more surprised than anything!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000530025", /*message*/"You know, I kinda relate to kitties with brown fur.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000620012", /*message*/"I want to play a song you&apos;ve thought up one of these days.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000620013", /*message*/"The girls usually come over to watch me when I&apos;m composing, but it&apos;s really embarrassing. They praise me no matter what I play.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000620014", /*message*/"I&apos;m interested in how you write your music.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000620015", /*message*/"How do you tune your piano? I kind of want to discuss that.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000630012", /*message*/"I wonder if it&apos;ll ever snow during a live show again like it did that one time.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000630013", /*message*/"My costume might have a chilly theme, but my live show is gonna be on fire. Brace yourself for it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000630014", /*message*/"My vacation house? Well, it&apos;s by the mountains and the sea. Why? You wanna go? How about we go together then, sometime?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000630015", /*message*/"Hey, why are you getting all drowsy?! You were the one who said you wanted to hear me play the piano.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000720012", /*message*/"There&apos;s no need to rush. Let&apos;s hold hands and walk together!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000720013", /*message*/"I have to work at the shrine today. Do you wanna come too?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000720014", /*message*/"You don&apos;t believe in fortune-telling? *Chuckle* We&apos;ll see if you still think that way after you witness my powers.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000720015", /*message*/"I thought the windows could use a good cleaning. Clear windows make a room feel more inviting, don&apos;t they?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000720022", /*message*/"Do I believe in miracles? Of course I do. We&apos;re all living inside a miracle.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000720023", /*message*/"Hey, could you tie the ribbon around my neck for me? I want you to add the finishing touches to Nozomi the school idol before I go on stage.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000720024", /*message*/"Let&apos;s see how lucky you are today... Oops, sorry. These are my playing cards, not my tarot cards.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000720025", /*message*/"You should be proud to say that you love the things that you love. After all, that precious feeling is yours and yours alone.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000730012", /*message*/"You&apos;ll always have magic on your side. That&apos;s what I believe.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000730013", /*message*/"I have really warm hands. Want me to warm you up?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000730014", /*message*/"Let&apos;s take it slowly at our own pace.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000730015", /*message*/"Want me to cast a good luck spell on you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000820012", /*message*/"I bring rice balls with me when I go out. Eating them on the go makes it feel more special than usual, so I feel like they taste better.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000820013", /*message*/"Is it really okay for me to wear such a magnificent costume? Huh? It suits me? Th-Thank you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000820014", /*message*/"When I have time on my hands, I check out new school idols. There are so many of them full of charm! Ahh, it just makes me so happy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000820015", /*message*/"The most important thing about cooking delicious rice is water! Use high-quality water to cook delicious rice!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000820022", /*message*/"Don&apos;t give up! Let&apos;s keep giving it our all!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000820023", /*message*/"I don&apos;t want it to end as just a dream.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000820024", /*message*/"You&apos;ll be full of energy if you just have something tasty to eat!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000820025", /*message*/"The perfect thing for when you&apos;re tired is... Ta-da! Rice balls!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000830012", /*message*/"What do you think? Does it look good on me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000830013", /*message*/"I wanted to show you how I look in this costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000830014", /*message*/"*Giggle* I can clip the hook on my favorite skirt now. My diet worked great!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000830015", /*message*/"I got some rice from the first crop of the year. I just can&apos;t wait to eat it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000920012", /*message*/"Hey, do you know where my ribbon went? I can&apos;t find one of them. Come on, help me find it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000920013", /*message*/"Red is the color of overflowing love! It&apos;s the perfect color for me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000920014", /*message*/"The stage isn&apos;t the only place where idols should shine. No matter where we might be, we should never forget that we&apos;re idols.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000920015", /*message*/"Nico-Nico-Ni! Those are the magic words to bring you happiness. Say it together with me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000930012", /*message*/"A conductor&apos;s job is to bring smiles to the faces of passengers... The perfect job for me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000930013", /*message*/"Nico-Nico-Ni! I&apos;m all aboard with smiles again today!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000930014", /*message*/"Hey, do you happen to have a mirror? I feel like my perfectly-styled hair is three millimeters off.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3000930015", /*message*/"Um, I&apos;ll get what&apos;s on special at the supermarket... I mean, eat at a fancy restaurant for dinner tonight!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010130012", /*message*/"A wondrous feeling comes upon me when I&apos;m draped in a sparkling costume. It feels like I can do anything!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010130013", /*message*/"It&apos;s hard to hold mikan oranges with these hands. Hey, do you mind feeding me? Ahh!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010130014", /*message*/"When you think of Numazu, you think of mikan oranges, and vice versa! So here are some for you!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010130015", /*message*/"Let&apos;s give our best at practice today with all of Aqours!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010220012", /*message*/"I always feel like going on a walk when the weather is nice outside.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010220013", /*message*/"Uchiura&apos;s clear blue sea and sky... I&apos;ll never forget how emotional it was when I first saw them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010220014", /*message*/"Those girls from the other day were so cute. I&apos;ve always wanted a sister.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010220015", /*message*/"Sometimes I just need to lay down the law! I wish I knew how, though.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010220022", /*message*/"All of Aqours&apos; costumes are special.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010220023", /*message*/"I feel like I can fly through the sky.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010220024", /*message*/"We&apos;ll always be together, right?! I feel so reassured and happy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010220025", /*message*/"What kind of books do you like? I want to know more about your preferences.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010230012", /*message*/"If I really do look like a flower, I can&apos;t help but wonder what kind of flower that might be.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010230013", /*message*/"My hair looks different than normal? You were the one who said I&apos;d look cute if I curled it, remember?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010230014", /*message*/"Just the sight of colorful flowers energizes me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010230015", /*message*/"I&apos;ve loved playing the piano ever since I was small. And now, I&apos;m able to use my passion to support all of Aqours. I&apos;m glad I stuck with it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010320012", /*message*/"I don&apos;t often tie a ribbon onto my head like this. *Giggle* I feel like a bunny.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010320013", /*message*/"No matter what, always keep a sparkle in your heart. Even the slightest light will provide you with support.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010320014", /*message*/"Do I prefer the sky or the sea for diving? Obviously the sea! Although, I am a little curious about the sky.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010320015", /*message*/"Every now and then I have the passing thought that Aqours has become more lively now.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010330012", /*message*/"I&apos;ll guide you off to dreamland. Just kidding!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010330013", /*message*/"Since this costume is inspired by pajamas, maybe I can wear it to sleep... Actually, forget it. It&apos;ll get all wrinkly.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010330014", /*message*/"*Yawn* I&apos;m getting sleepy. What you wear sure does affect how you feel.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010330015", /*message*/"You don&apos;t need a special reason to give someone a hug. Which leads me to my next point. This hug&apos;s for you!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010420012", /*message*/"The hibiscus is pretty, isn&apos;t it? *Chuckle* I&apos;m proud of this costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010420013", /*message*/"I will show everyone a shining performance worthy of this costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010420014", /*message*/"Have you eaten? Did you finish your homework? I&apos;ll make sure everything that must be done is done.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010420015", /*message*/"I don&apos;t intend on carrying out my practice or student council duties half-heartedly. That obviously also applies to being a school idol!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010420022", /*message*/"Please don&apos;t stare so much... You&apos;re making me blush.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010420023", /*message*/"*Chuckle* Ruby said I look good in this costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010420024", /*message*/"Mari can be so excessive. It&apos;s a real problem.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010420025", /*message*/"Perhaps I should work on polishing my speaking abilities.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010430012", /*message*/"It would be rather fun to sneak out with you while wearing this costume, I think.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010430013", /*message*/"It&apos;s about time for the live show. Let us unleash our everything onto today&apos;s stage.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010430014", /*message*/"Ruby and I are having a contest to see who can read the most books next month. Though I am currently in the lead, she is really putting in the work.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010430015", /*message*/"How I take care of my hair? Well, I do not do anything particularly special, but compliments like these make me want to put in the effort.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010520012", /*message*/"Niceoodles are my specialty! I can really go all out with them!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010520013", /*message*/"Hey, can you get that plate? I&apos;ll let you taste some of them!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010520014", /*message*/"You&apos;re not going to have any energy if you don&apos;t eat a lot. Want me to make you something?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010520015", /*message*/"I feel like I want to get moving around! Hey, want to run over to the shrine with me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010530012", /*message*/"I&apos;ve got a few other designs based on the sea too. I hope I can make them all into real costumes someday.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010530013", /*message*/"I like the sea the best when it&apos;s nice and blue. A clear, sunny day on top of it would be the cherry on top!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010530014", /*message*/"Should I just stick with my training swimsuit or get something new?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010530015", /*message*/"What would I have done if I didn&apos;t choose high diving? Hmm, maybe freestyle or breaststroke?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010620012", /*message*/"Hey, can I switch the feather on my hat with a black one? I want to include my identity as Yohane somewhere.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010620013", /*message*/"Yohane&apos;s heart is always filled with dark radiance. Aren&apos;t you the same yourself, little demon?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010620014", /*message*/"You want to take me on in video games? Mu, ha, ha. Sure. Try and steal victory from my clutches!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010620015", /*message*/"I actually incorporated a code, which only my dark minions understand, into the songs I sang at the live show the other day. Did you understand it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010620022", /*message*/"Don&apos;t I look like I&apos;m about to hop and fly away?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010620023", /*message*/"Who said only kindergarteners wear white stockings?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010620024", /*message*/"Are you aware of the one thing a fallen angel cannot live without? That&apos;s right! It&apos;s elegance! Just the kind that Yohane has!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010620025", /*message*/"Sure, you can call me &quot;Yoshiko&quot; every once in a while. Maybe once a year in your sleep.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010630012", /*message*/"I want to wear fallen angel costumes with everyone again.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010630013", /*message*/"Little demons, today is the day we fall into the underworld!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010630014", /*message*/"I think it&apos;s about time to give you a name as one of my little demons! Any requests, perhaps?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010630015", /*message*/"You can&apos;t be a proper fallen angel if you let spots of bad luck get you down. Remember that!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010630022", /*message*/"I will give you some of the fruits from the netherworld. Here, give me your hand.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010630023", /*message*/"Heh heh! Look at how wonderful even a vegetable costume can be when it is touched by my fallen-angel powers!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010630024", /*message*/"It&apos;s better to be open to lots of different foods. Huh? Mikan oranges? Well, they&apos;re...");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010630025", /*message*/"Let&apos;s go eat something tasty!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010720012", /*message*/"Ribbons on my head, hips and shoes. Can I really pull off wearing this many ribbons?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010720013", /*message*/"These socks were kind of hard to put on because they&apos;re so long. When I tried to pull them up in one go, I nearly fell over, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010720014", /*message*/"When I&apos;m reading a good book, I just forget all about time. Like, it&apos;s often night before I know it, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010720015", /*message*/"When I&apos;m singing and dancing on that shiny stage, I still think I&apos;m dreaming sometimes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010730012", /*message*/"I researched yukatas from all kinds of hot spring inns when making this costume. They were all so cute, I wanted to try every last one of them on, zura!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010730013", /*message*/"Chika taught me the proper way to wear a yukata, but I still don&apos;t have the confidence to put one on by myself, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010730014", /*message*/"Mmn... *Gasp* Oh no, I fell asleep again, zura. I told myself I was going to read all the books I&apos;ve had to put off, too!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010730015", /*message*/"All of my friends taught me how to use a computer, zura. See, you turn it on by pressing here! ...Huh? Wait, is that not it?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010820012", /*message*/"I want you to see how this costume looks under the blue sky.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010820013", /*message*/"Maybe I&apos;ll sneakily swap my costume with Dia&apos;s. *Giggle* I can&apos;t wait to see Dia&apos;s surprised face.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010820014", /*message*/"The feeling of satisfaction I get when singing is one that can&apos;t come from anything else.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010820015", /*message*/"Let me invite you to my room. I&apos;ll have lots of tasty sweets for us to eat.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010830012", /*message*/"Oh, I can&apos;t sit still! Hey, you come over here too!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010830013", /*message*/"I just love this costume!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010830014", /*message*/"A message from yours truly! Make sure your eyes are always, ALWAYS on me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010830015", /*message*/"You want to know the secret behind all my energy? Hmm, I don&apos;t know if I should tell you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010920012", /*message*/"The memories I have with my sister will always be in my heart.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010920013", /*message*/"It&apos;s always scary to try something for the first time, but I wanna do my Rubesty!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010920014", /*message*/"You wanna go to a festival with me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010920015", /*message*/"I always loved fireworks. They really make you feel like it&apos;s summer!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010930012", /*message*/"Can I scooch a little closer to you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010930013", /*message*/"Wanna go get cake together sometime?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010930014", /*message*/"Time really flies when I&apos;m with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3010930015", /*message*/"*Giggle* I can&apos;t help but smile when I&apos;m with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020120012", /*message*/"I love rainbows. I feel like happiness rains from the sky through them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020120013", /*message*/"No matter how hard it might rain, it&apos;ll eventually stop. The sun will shine again, so whatever happens, don&apos;t ever give up.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020120014", /*message*/"No matter how slow and steady you may be, as long as you keep moving forward, you&apos;ll reach your goal someday.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020120015", /*message*/"Do we get to go home together today? *Chuckle* There&apos;s so much I wanna talk about!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020120022", /*message*/"I&apos;ll make sure everyone&apos;s sounds are joined in harmony!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020120023", /*message*/"Come on, let&apos;s create some beautiful musical tones!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020120024", /*message*/"I wanna go somewhere to have a parfait with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020120025", /*message*/"You haven&apos;t left anything behind, have you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020130012", /*message*/"If I&apos;m going to cook in this costume, I should probably make Chinese food, huh?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020130013", /*message*/"Szechuan cuisine, Cantonese cuisine... I want to learn how to make all kinds of Chinese food. Wanna be my taste tester?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020130014", /*message*/"Doesn&apos;t it feel great when you can finally do something that you couldn&apos;t before? That&apos;s what keeps me going every day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020130015", /*message*/"Some people run, some walk. Some take the long route, others go back the way they came. Everyone has their own way of walking, so there&apos;s no need to hurry.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020220012", /*message*/"I want people to say that I&apos;m the only one for them!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020220013", /*message*/"I&apos;ll be the center of attention on stage in this!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020220014", /*message*/"What if this bread actually turns out tasting good? I-I mean, nothing! I didn&apos;t put spicy mustard in it or anything!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020220015", /*message*/"No matter what anyone says, I am the cutest around!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020220022", /*message*/"Leave performing with instruments to me! I&apos;ll play anything for... Ack! Forget what I just said! Seriously! Don&apos;t actually bring me any instruments!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020220023", /*message*/"How do people in marching bands manage to march and play their instruments properly like that? I&apos;m kinda curious about how they practice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020220024", /*message*/"You want me to smile? That&apos;s gonna cost you a pretty penny! Ready? *Grin* Huh? That&apos;s not what you meant? What do you mean, then?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020220025", /*message*/"Argh, I don&apos;t get my homework at all. What do I do? Won&apos;t someone help me? Like a certain nice upperclassman?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020230012", /*message*/"I&apos;m gonna saturate you in Kasumin so your thoughts are all dyed in shades of me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020230013", /*message*/"When it comes to cute costumes, no one wears them better than me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020230014", /*message*/"I wonder what kind of bread I should have today. I&apos;m gonna ask Honoka!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020230015", /*message*/"Let&apos;s see how many fan letters I have today. Wait, huh? None? That&apos;s strange.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020230022", /*message*/"Did you go crazy for me in this outfit?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020230023", /*message*/"It&apos;s actually scary how I can pull off any look...");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020230024", /*message*/"Let&apos;s trade boxed lunches!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020230025", /*message*/"If you&apos;re sleepy, I don&apos;t mind letting you sleep on my lap.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020320012", /*message*/"Please, tell me--does this outfit look good on me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020320013", /*message*/"I focus so much more when I&apos;m wearing my costume. It feels like I can do anything!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020320014", /*message*/"I really look up to Karin&apos;s dancing abilities. I wish I could express myself like that, too. Oh, I&apos;ve got to work really hard at it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020320015", /*message*/"Urgh. I&apos;ve been sneezing a lot! They say that happens when you&apos;re being talked about... You&apos;re not spreading rumors about me, are you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020330012", /*message*/"I feel like I&apos;ve become a star!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020330013", /*message*/"Am I shining?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020330014", /*message*/"I can do my best as long as I have you around.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020330015", /*message*/"Do you want to see a photo of Ophelia? She&apos;s absolutely adorable! I would love for you to have a look!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020420012", /*message*/"I heard you should put spit on your eyebrows to keep from getting bewitched. I&apos;d like to test it out sometime to see if it really works.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020420013", /*message*/"Yip, yip! We mysterious foxes love deep-fried tofu, so gimme some or I&apos;ll possess you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020420014", /*message*/"You&apos;re giving me such pleading eyes. What might you want from me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020420015", /*message*/"I feel like I can really loosen up when I&apos;m with you. *Chuckle* I mean that in a good way. Stay here with me a bit.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020420022", /*message*/"Let&apos;s dance to the rhythm of the music!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020420023", /*message*/"Parades are so exciting!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020420024", /*message*/"I&apos;m not ending this game until I win!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020420025", /*message*/"For you, I&apos;d be happy to call it a loss... Psych! Never let your guard down for a second!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020430012", /*message*/"Well? Did you like it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020430013", /*message*/"I can just feel my spirits rising whenever I put on my costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020430014", /*message*/"It&apos;s important for models to get their beauty sleep. Let&apos;s be sure to go to sleep at a reasonable time tonight.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020430015", /*message*/"Whether you&apos;re a school idol or modeling for magazines, you need to have stamina. So don&apos;t forget to hit that gym!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020520012", /*message*/"I can&apos;t stay still when I&apos;m wearing this costume!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020520013", /*message*/"One, two, three, four. I&apos;m practicing my dance steps!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020520014", /*message*/"No one is better at making monjayaki than me! Probably. Hehe!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020520015", /*message*/"Time flies when I&apos;m talking to you!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020620012", /*message*/"I wonder if I&apos;ll get in trouble if I take a nap in my costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020620013", /*message*/"If I&apos;m wearing this costume, I bet I can sing as well as I always do in my dreams.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020620014", /*message*/"You can count on me when something needs to get done. *Snore*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020620015", /*message*/"I feel so safe when I&apos;m with you...that it makes me really sleepy...");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020620022", /*message*/"All this excitement just makes all my sleepiness disappear.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020620023", /*message*/"Let&apos;s get this show on the road!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020620024", /*message*/"Hey, you wanna go on a walk with me? I&apos;m trying to wake myself up a little.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020620025", /*message*/"I&apos;ve been sleeping really well lately. What? I always sleep well?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020630012", /*message*/"Yukatas have a wide open neck area and sleeves, so the air just flows right through them. They feel amazing just after a bath.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020630013", /*message*/"After I wore this costume at the show, a hot spring inn contacted me. They asked if I could wear their yukatas, too. What a nice surprise.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020630014", /*message*/"Falling asleep while cooking? Oh, that would never happen. Sure, I might fall asleep during practice, but... Oops, pretend you didn&apos;t hear that.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020630015", /*message*/"Any problem I have, I can just sleep it off. Seriously, it clears up the mind.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020720012", /*message*/"Does this p-panda outfit...suit me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020720013", /*message*/"Pandas are soft, fluffy, and so adorable!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020720014", /*message*/"Why don&apos;t we watch something just the two of us next time?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020720015", /*message*/"I feel a little warmer when I&apos;m next to you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020730012", /*message*/"I believe saying passionate things while wearing a chilly-themed costume also works in its own way!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020730013", /*message*/"If your heart should ever become frozen, I will warm it up with my burning passion.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020730014", /*message*/"Today is the release date of a YA novel I have been looking forward to! It comes with a bonus character portrait.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020730015", /*message*/"La-la-laaaa! Hm? What am I listening to, you ask? The theme song to an anime airing right now! Would you like to have a listen with me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020820012", /*message*/"Nice weather puts me in the mood for fun. It makes me wanna go somewhere!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020820013", /*message*/"This is the first time I&apos;ve ever seen a rainbow-colored rose! I guess there are still a bunch of flowers in the world that I don&apos;t know about.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020820014", /*message*/"I got a letter from my family in Switzerland! I&apos;m so happy! I need to make sure I write back!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020820015", /*message*/"Kasumi&apos;s bread rolls are always so tasty. I&apos;ll give her some Swiss bread next time to show my gratitude!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020820022", /*message*/"Doo-dee-doooo! I&apos;m so happy I get to wear such a beautiful costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020820023", /*message*/"I love this costume! I wanna make a different-colored version of it as well!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020820024", /*message*/"I wanna have cheese fondue in the clubroom. Can I?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020820025", /*message*/"Beets are a must for a Swiss-style salad!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020830012", /*message*/"If I walk through the woods in this costume, do you think I&apos;ll run into a wolf?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020830013", /*message*/"Do I look good in this Little Red Riding Hood costume? *Giggle* Thank you. Here, have some bread for being so nice!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020830014", /*message*/"Switzerland is an amazing place. There&apos;s a lot of greenery and the air is so clean and fresh. I hope you can visit someday.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020830015", /*message*/"Learning Japanese was difficult, but I studied really hard because I wanted to make lots of friends in Japan.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020920012", /*message*/"I don&apos;t know if it suits me or not. What do you think?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020920013", /*message*/"I can&apos;t help but smile when I wear it. *Giggle* Weird, huh?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020920014", /*message*/"I love the poses Kasumi and Shizuku came up with.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020920015", /*message*/"I think it might be nice to...have someone tell me I look cool.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020930012", /*message*/"I wanna always connect with lots of people in cyberspace, but I also wanna perform live shows and become one with my audience. Is that asking for too much?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020930013", /*message*/"I&apos;m gonna connect my feelings to everyone&apos;s and we&apos;ll all become linked.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020930014", /*message*/"I&apos;m thinking about adding more Rina-chan Boards to my lineup. What kind of expressions do you think I should add?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020930015", /*message*/"I found a game app that looks like fun. Do you wanna play it with me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020930022", /*message*/"New costumes always get me all giddy and excited.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020930023", /*message*/"What do you think of this costume?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020930024", /*message*/"I&apos;ll tell you about all the nutrients found in tomatoes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_3020930025", /*message*/"I wanna eat together with everyone, so I wanna have hotpot in both summer and winter.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000120012", /*message*/"Dance with me! Ready? One, two, three, four!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000120013", /*message*/"I&apos;m going shopping with the rest of the μ&apos;s girls. You should come too! It&apos;ll be fun!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000120014", /*message*/"You want a sweet bun? Here you go!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000120015", /*message*/"You like school idols too? *Giggles* Just like me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000130012", /*message*/"Now this is exciting!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000130013", /*message*/"All right, let&apos;s do our best! Whooo!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000130014", /*message*/"Doesn&apos;t just hearing the word &quot;party&quot; get you all excited?! So, what kind of surprises do you like?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000130015", /*message*/"La di da. Eheh, I wish I could write music like Maki can!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000130022", /*message*/"Ooh, I&apos;m so happy! I feel such joy every time I look at my favorite costumes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000130023", /*message*/"If I were a princess, I&apos;d have to really buckle down on studying... Well, I guess I should be doing that anyway, ahaha...");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000130024", /*message*/"Texts and messages are nice, but I definitely wish I could talk to you face to face.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000130025", /*message*/"Ooh! A new bakery opened up! After school, I&apos;m gonna go try it out!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000220012", /*message*/"You look up to me? That kinda makes me blush.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000220013", /*message*/"I get fired up when I wear my costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000220014", /*message*/"Have you seen Honoka? Ugh, I look away for one second and she&apos;s gone again.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000220015", /*message*/"I want your advice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000220022", /*message*/"I feel instantly ready as soon as I put on my costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000220023", /*message*/"I&apos;m not gonna fall behind the others.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000220024", /*message*/"With you at my side, I can aim for greater heights.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000220025", /*message*/"*Yawn* Ack! Say something if you&apos;re standing there! I-I wasn&apos;t yawning just now!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000230012", /*message*/"Is there something on my face?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000230013", /*message*/"Stare all you want, I&apos;m not giving you any.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000230014", /*message*/"*Chuckle* I want to cherish times like these.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000230015", /*message*/"I&apos;ll always be by your side.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000320012", /*message*/"It makes me happy when people say my costumes are cute.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000320013", /*message*/"When I&apos;m making costumes, I like to imagine what we&apos;d all look like wearing them while we dance. It gets me really excited.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000320014", /*message*/"Seeing friends from my childhood really takes me back.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000320015", /*message*/"Sewing is my specialty. If anything happens, I can fix it right up.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000330012", /*message*/"Let&apos;s grow cherry tomatoes on the veranda!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000330013", /*message*/"Potatoes and pumpkins... I like sweet vegetables!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000330014", /*message*/"There&apos;s always room for dessert, so I can just eat and eat and eat!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000330015", /*message*/"Calling it &quot;Hellish Intensive Training&quot; sounds scary, so let&apos;s call it &quot;Heavenly Intensive Training&quot;!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000420012", /*message*/"The tops and bottoms are mismatched? Th-That&apos;s fine! That&apos;s what you call &quot;variety!&quot;");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000420013", /*message*/"Don&apos;t you think the red ribbon against the white costume adds a nice touch? I tried other colors while we were making them, but red was the right choice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000420014", /*message*/"Nothing would make me happier than knowing my songs give you encouragement.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000420015", /*message*/"I won&apos;t be able to practice as often because I have an archery tournament coming up. Could you check on my behalf to see if everyone is practicing properly?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000430012", /*message*/"The name Umi means ocean, so I feel connected to oceans all around the world.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000430013", /*message*/"I have to train my body and mind every day if I am to have a heart wider and deeper than any ocean.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000430014", /*message*/"No comprises on the practice schedule. If we&apos;re going to do something, we&apos;re going to do it right!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000430015", /*message*/"μ&apos;s will soar forevermore. Make sure you don&apos;t miss a second of it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000520012", /*message*/"*Giggle* Look at this clover hairpin. I picked it out all by myself. Does it look good on me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000520013", /*message*/"No matter what happens, I&apos;ll keep on running with everyone. To wherever we may go, forever.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000520014", /*message*/"Oh, the cat&apos;s asleep. It looks so peaceful. This place must be perfect for afternoon naps since it gets a good...amount of...sunlight... *Yawn*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000520015", /*message*/"I was asked to help out the track team, but I&apos;ve got practice with μ&apos;s today... What should I do?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000530012", /*message*/"I&apos;ll catch the big bad wolf!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000530013", /*message*/"I borrowed &quot;Little Red Riding Hood&quot; from the library and tried to read it so I could help make these costumes. I fell asleep halfway through it, though.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000530014", /*message*/"Singing practice is fun and I love it, but I love dance practice even more!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000530015", /*message*/"I played soccer during P.E. class, but my shot completely missed the goal! I thought I had it for sure! It was SO frustrating!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000620012", /*message*/"Hmm. Could you adjust the angle of the feathers on my hair clip a little? If I&apos;m gonna wear it, I want it to be perfect.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000620013", /*message*/"I like the color red. It&apos;s a strong, distinct color. It stands for powerful resolve and passion. It really does come off that way, don&apos;t you think?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000620014", /*message*/"Ever since I joined μ&apos;s, I&apos;ve started thinking idol songs aren&apos;t so bad after all. Don&apos;t ever tell Honoka and the others I said that, though.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000620015", /*message*/"You want me to write a song for you someday? Why would you say that? You&apos;re always on my mind when I compose.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000620022", /*message*/"The tiny hat is my favorite part! It alone is a statement of elegance.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000620023", /*message*/"Maybe I should go to school like this? ...That was a joke.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000620024", /*message*/"You want to support the people who are important to you. I understand those feelings now.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000620025", /*message*/"You&apos;re spacing out. If you&apos;ve got something on your mind, I&apos;ll help you figure it out.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000630012", /*message*/"Having flower petals floating in the bathtub is so relaxing. Why don&apos;t you give it a try?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000630013", /*message*/"You want to hear me play the piano? Well, if you insist... Come to the music room.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000630014", /*message*/"How are you doing in class? Let me know if you don&apos;t understand something and I&apos;ll explain it to you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000630015", /*message*/"I make new discoveries every time I play the piano with Riko. She&apos;s really amazing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000720012", /*message*/"Do you have something you want to say to me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000720013", /*message*/"*Giggle* I can feel you staring, you know.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000720014", /*message*/"Wanna go on a tour of natural power spots sometime?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000720015", /*message*/"No need to stand. Come sit by me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000730012", /*message*/"If I wave my sleeves like this... *Chuckle* Don&apos;t you feel like you&apos;re floating in the night sky?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000730013", /*message*/"Constellations all have their different stories. I want to share them with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000730014", /*message*/"The cards are speaking to me! They&apos;re telling me to give you a big bear hug!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000730015", /*message*/"School council duties may seem tedious at first glance, but they&apos;re important. Would you like to help out?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000730022", /*message*/"I really love the sound of rain. Just close your eyes and listen for a bit.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000730023", /*message*/"There will always be good things and bad things in life. But every storm cloud has a silver lining.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000730024", /*message*/"Sometimes, all it takes is a favorite umbrella to brighten up a rainy day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000730025", /*message*/"Hearing the thunder get closer and closer is pretty exciting, isn&apos;t it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000820012", /*message*/"Is my ribbon crooked? I&apos;ve checked myself in the mirror a bunch of times, but I can&apos;t stop worrying about it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000820013", /*message*/"My costume doesn&apos;t have any sleeves, so I can move my shoulders really easily. I wonder if I&apos;ll be able to dance more smoothly.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000820014", /*message*/"I&apos;ve always admired school idols. I&apos;m gonna do my very best so that I never have any regrets!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000820015", /*message*/"Ack! One of my contacts fell out! Wh-Where is it?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000830012", /*message*/"Sleep is very important. Make sure you get plenty of sleep so that you&apos;re full of energy as you live your life!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000830013", /*message*/"I always think about you as I&apos;m going to sleep. I feel like if I do, then maybe I&apos;ll get to see you in my dreams.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000830014", /*message*/"I wonder what I&apos;d be doing now if I wasn&apos;t a member of μ&apos;s. I can&apos;t picture it at all.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000830015", /*message*/"Practice is tough, but it&apos;s all to create a wonderful live show! I&apos;ll do my best!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000830022", /*message*/"Somehow, being in this costume makes me feel ready for the role!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000830023", /*message*/"I feel like I can solve any mystery when I wear this costume!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000830024", /*message*/"I accidentally burned myself when making rice balls with piping hot rice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000830025", /*message*/"I forget that I&apos;m hungry whenever I see your face. Why is that?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000920012", /*message*/"A totally white outfit is perfect for someone as pure-hearted as me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000920013", /*message*/"Huh? This outfit&apos;s cute? Well, of course, I&apos;m the one wearing it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000920014", /*message*/"Welcome to Nico World! I want you to have a ton of fun today, Nico!!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000920015", /*message*/"Phew, I&apos;m beat. Wh-Whoa?! You can&apos;t look at me when I&apos;m off, that&apos;s poor manners!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000920022", /*message*/"Trust in your hard work. You&apos;re going to make your dreams come true.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000920023", /*message*/"I&apos;m here for you, so no looking back. Just face forward and go for it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000920024", /*message*/"Seriously? You don&apos;t have an umbrella? Ugh, fine. Here. You can come under mine.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000920025", /*message*/"Man, my laundry&apos;s never gonna dry if this rain keeps up. Uh, that&apos;s what my housekeeper was saying anyway! I never do laundry myself!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000930012", /*message*/"I&apos;m gonna take a nice hot bath to freshen up my body and my soul!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000930013", /*message*/"I prepared a costume for you, too. You better wear it when we get out of the hot spring!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000930014", /*message*/"I thought I could be an idol even if I had to do it alone. But ever since I joined μ&apos;s, I can&apos;t even recall the last time I was alone.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4000930015", /*message*/"I&apos;ll make you love me so much, you won&apos;t be able to sleep at night! Wait, you already can&apos;t sleep? A-Are you all right?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010120012", /*message*/"Why are mikans so tasty? They&apos;re so small and cute and round! You love them, too, don&apos;t you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010120013", /*message*/"Since I&apos;m carrying so much, I can have about three as a reward, right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010120014", /*message*/"Guh! It&apos;s a sour mikan! But even sour mikans are tasty. That just goes to show how amazing mikans are!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010120015", /*message*/"I&apos;m a bit hungry, I think. Hey, wanna sneak in some snacks?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010120022", /*message*/"A different light shines on us today, tomorrow, and every day after. I hope I can find what makes me shine someday too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010120023", /*message*/"We&apos;ll see each other again someday, no matter how far apart we might be.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010120024", /*message*/"I get so hyped about dressing up whenever I go to Tokyo. I&apos;m gonna choose the perfect outfit for the big city!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010120025", /*message*/"I don&apos;t have to do any chores today! Let&apos;s go out and hang!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010130012", /*message*/"Come here, Little Red Riding Hood. Play with Chika-chi the wolf!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010130013", /*message*/"Wolves are pretty cool if you look at them closely! They&apos;re cool and... Actually, they&apos;re scary after all!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010130014", /*message*/"I don&apos;t like coffee, but I might be able to drink it if I dump in a LOT of milk and sugar.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010130015", /*message*/"No matter how many times I sing the same song, I never get tired of it. A new feeling of excitement bubbles up inside of me every time I sing!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010220012", /*message*/"I&apos;d like to sketch the star-filled night sky on the rooftop one day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010220013", /*message*/"It&apos;s a little embarrassing, but maybe costumes like this aren&apos;t bad either.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010220014", /*message*/"I&apos;ll write songs as much as I want, and then have a sandwich for a change of pace. Is this what they mean by a joyful day off?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010220015", /*message*/"The natural surroundings of Uchiura are so mysterious. It&apos;s almost as if they embrace you. I hope you experience that, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010230012", /*message*/"Being surrounded by all of these flowers makes me feel like I&apos;ve become a flower fairy or something.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010230013", /*message*/"One of the flowers came off my costume. I was just about to go fix it with You. I need to treat my costumes well if I want them to last.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010230014", /*message*/"I wish I could listen to Maki play the piano forever... Oh wait, I should be playing too!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010230015", /*message*/"Karin is so alluring and grown-up. Hang on... Does that mean I look like a kid to her?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010230022", /*message*/"I want to hear your voice. Can I call you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010230023", /*message*/"Just like I pour my heart into playing the piano, people who make costumes pour their hearts into the clothes. I want to honor that as I wear each piece.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010230024", /*message*/"It&apos;s so frustrating to have feelings that just don&apos;t get through to someone.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010230025", /*message*/"Where are we going today? What would you do if I said...that I&apos;ll go anywhere as long as it&apos;s with you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010320012", /*message*/"Wanna go diving together sometime?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010320013", /*message*/"You know, it kinda feels like we&apos;re always together these days.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010320014", /*message*/"You want to be with me that badly? I guess the same goes for me, actually.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010320015", /*message*/"You know, I&apos;ve been waiting for you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010320022", /*message*/"I wonder if someday, we&apos;ll come together, put on these costumes, and sing again. I hope all nine of us will be there when we do.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010320023", /*message*/"Every end is a new beginning. There&apos;s no need for sadness or tears. We should walk towards tomorrow with hope in our hearts.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010320024", /*message*/"I have to learn English if I want to explore diving in seas all across the world. Maybe I&apos;ll ask Mari for lessons.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010320025", /*message*/"I&apos;m a bit...scared to hug you, actually. You&apos;d be able to feel everything I feel in my heart.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010320032", /*message*/"I need to practice more so I can do any dance style!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010320033", /*message*/"Hey! Stop staring at me! It&apos;s embarrassing...");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010320034", /*message*/"I was making a new practice schedule, but something&apos;s missing... Can you take a look?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010320035", /*message*/"I feel great today for some reason. *Giggle* Maybe it&apos;s thanks to your support.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010330012", /*message*/"I wonder if a bunch of fish would swim to me if I jumped into the ocean wearing this?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010330013", /*message*/"I wonder if it&apos;s possible to make Princess Otohime-style diving suits. I wanna sell them at my family&apos;s diving shop.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010330014", /*message*/"I make sure to train every day. It&apos;s important to get a little stronger every day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010330015", /*message*/"Anything you can&apos;t do alone, you can definitely do with the help of your friends!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010330022", /*message*/"I always keep my eye on the weather. It&apos;s vital for us divers!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010330023", /*message*/"For divers, our body is our most key asset! Rain or storm or shine, we&apos;ve gotta keep ourselves fit!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010330024", /*message*/"I hope tomorrow will be sunny. I&apos;m really itching to get out and move!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010330025", /*message*/"The tumultuous sea we see today will someday return to its peaceful lull. I think life is like that, too. That&apos;s just one more thing the ocean taught me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010420012", /*message*/"You must get those heels tapping and dance!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010420013", /*message*/"This costume is rather form-fitting... Does it suit me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010420014", /*message*/"Writing down what&apos;s important helps to keep track of what&apos;s in my head.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010420015", /*message*/"Your advice always cheers me up.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010430012", /*message*/"School idols cast magic spells on everyone&apos;s hearts.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010430013", /*message*/"It is a school idol&apos;s duty to look after her health. Please be careful not to catch a cold.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010430014", /*message*/"I simply cannot ignore a crying child.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010430015", /*message*/"Some things cannot be expressed in words. I think having the desire to express those feelings despite that is very important.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010430022", /*message*/"We have promptly decided to go to a Chinese restaurant for our live show after-party.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010430023", /*message*/"Chinese food is one of the three grand cuisines. It&apos;s loved all over the world for its long history, varicolored dishes, and cooking techniques.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010430024", /*message*/"Please stay put after today&apos;s practice. Everyone&apos;s required to attend the review meeting about our last live show!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010430025", /*message*/"Oh? &quot;Aqours&quot; is written in the sand. I wonder who could have written this. I-It wasn&apos;t me this time!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010520012", /*message*/"The blue here actually doesn&apos;t represent the ocean! Today, it&apos;s the color of the sky!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010520013", /*message*/"Let&apos;s run as fast as we can beneath the never-ending sky!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010520014", /*message*/"I&apos;m so hungry. I know it&apos;s not lunchtime yet, but I&apos;m gonna have a little snack out of my boxed lunch.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010520015", /*message*/"Could you watch my dance practice video with me? I wanna hear what you think as well.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010520022", /*message*/"Hope this makes me beautiful... *Giggle* I&apos;ve got a wish tied up in this outfit.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010520023", /*message*/"I was just looking at photos of us up on stage! I love all of the outfits we&apos;ve worn up until now!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010520024", /*message*/"What are you into lately? Tell me everything, I wanna hear about lots of stuff!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010520025", /*message*/"Give it your best shot! Aye aye!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010530012", /*message*/"Maybe the gods will think I&apos;m a snow fairy when I wear this costume and make it snow for me...");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010530013", /*message*/"The fabric of this costume is cool to the touch to match the snow-and-ice theme! Just kidding, it&apos;s not. Wanna have a feel?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010530014", /*message*/"I don&apos;t know if it&apos;s because I make costumes, but I look more carefully at the fabric and seams when I buy new clothes at shops, now.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010530015", /*message*/"Look, look! I drew a portrait of you in the sand! It really looks like you... Ahhh! The waves! Aww, the drawing&apos;s gone...");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010620012", /*message*/"There is nothing to fear. You can fall from heaven now.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010620013", /*message*/"Uniform-style costumes are great, huh? They&apos;re just what you would imagine school idols wearing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010620014", /*message*/"You&apos;re gonna go to the magic metropolis Tokyo? That place is so dangerous!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010620015", /*message*/"Ack! Why&apos;d it suddenly start to rain?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010630012", /*message*/"No one other than Yohane can wear this costume so well!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010630013", /*message*/"You can&apos;t deceive Yohane&apos;s eyes!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010630014", /*message*/"You want to know how Yohane&apos;s hair is always so pretty? *Giggle* The trick is to apply a deep conditioner made from a secret netherworld formula!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010630015", /*message*/"My little demons love when I ask them to stay by my side. You do too...right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010720012", /*message*/"Oh no! My hat is falling off, zura!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010720013", /*message*/"The scarf on my costume and my school uniform are both yellow. They match, zura!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010720014", /*message*/"*Yawn* I was up late reading last night, so I&apos;m sleepy, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010720015", /*message*/"What do you think mikan oranges and red bean paste taste like together? I&apos;m gonna give it a try, zura!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010720022", /*message*/"Our feelings are always one.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010720023", /*message*/"I hope we&apos;ll meet up with a smile tomorrow.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010720024", /*message*/"I&apos;m not letting the wind or rain get in my way. I&apos;m gonna practice as always, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010720025", /*message*/"We&apos;re training hard every day, even in the summer heat and even in the snow.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010730012", /*message*/"These beautiful flowers might have lured a real fairy out here, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010730013", /*message*/"A landscape full of greenery sure is calming.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010730014", /*message*/"Love and patience are required to grow plants, zura. Give them all your attention and focus, and nurture them to their full potential.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010730015", /*message*/"You want me to sing a hymn? Sure! If that&apos;s what you want, then I&apos;d love to.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010820012", /*message*/"The chic, elegant purple coloring of this costume hits all the right notes. It&apos;s not too sweet and not too childish. It&apos;s just right for me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010820013", /*message*/"The star of passion in my pounding heart is what lights up the ribbon on my chest! I&apos;ll shine more brightly than the sun!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010820014", /*message*/"What does &quot;shiny&quot; mean? It means exactly that! It&apos;s a magical word that releases our burning-hot, shining passion!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010820015", /*message*/"No one knows what our future holds. I&apos;ll bet it&apos;s because it&apos;s shining too brightly for anyone to see.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010820022", /*message*/"I wanted to wear a white version of this costume too! Ah well!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010820023", /*message*/"I hope you think about me when you take your next step forward.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010820024", /*message*/"As a live show approaches there&apos;s a tense atmosphere created through nerves...that none of us experience at all. We do get nervous with excitement, though!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010820025", /*message*/"*Squeeze* Hehehe. My tried-and-true hug of energy! Well? Did it fill you up with energy too?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010830012", /*message*/"Ciao! How about spending a pleasant time on the train with me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010830013", /*message*/"No matter how far a journey may span, I don&apos;t think it&apos;ll ever be boring as long as I&apos;m together with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010830014", /*message*/"Nothing looks better than a smile! Come on and smile, shiny!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010830015", /*message*/"Come hang out at Uranohoshi Girls&apos; High! I&apos;ll show you my serious chairwoman side.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010920012", /*message*/"I don&apos;t know if I want to make the flower on the ribbon pink or yellow or light blue... I can&apos;t decide!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010920013", /*message*/"These fluffy, frilly skirts were hard to make, but they turned out super cute. I really love them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010920014", /*message*/"Tomorrow I&apos;m going somewhere with Dia, so I&apos;ll need to set a bunch of alarms to make sure I wake up on time.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010920015", /*message*/"Before I step on stage, I remember the feeling of your warm hands and your kind voice. It&apos;s my secret charm for making all my nerves disappear.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010930012", /*message*/"D-Don&apos;t laugh, okay?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010930013", /*message*/"I&apos;m going to put everything into my singing--all the fun and all the sadness, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010930014", /*message*/"I was thinking so hard about new stage costumes that it was morning before I knew it. *Yawn*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4010930015", /*message*/"La-di-da, la-di-da. Ah, wait, don&apos;t look! Not until I can do this dance well!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020120012", /*message*/"Doing detail-oriented work like this is strangely calming. I just forget all about time.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020120013", /*message*/"It&apos;s not the fastest process, but I enjoy seeing something get made bit by bit.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020120014", /*message*/"When people cheer me on, I just feel so much power bubble up in me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020120015", /*message*/"*Yawn* Ack?! W-Wait, did you see that just now? Ahh, that&apos;s so embarrassing!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020120022", /*message*/"I&apos;m only a school idol because I have everyone&apos;s help and support.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020120023", /*message*/"If there&apos;s something I can do, I want to help. Hey, can you give me some advice?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020120024", /*message*/"I don&apos;t know why, but I get so sleepy whenever I&apos;m near you... It&apos;s been this way since we were kids!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020120025", /*message*/"It makes me so happy when you compliment me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020130012", /*message*/"I hope we&apos;ll always get along like this.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020130013", /*message*/"I&apos;m always grateful to you. Thanks.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020130014", /*message*/"Every day is just so fulfilling!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020130015", /*message*/"I left something in the clubroom! Wait up while I go back for it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020220012", /*message*/"I feel like this outfit is a little childish, but...I&apos;m just imagining that, right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020220013", /*message*/"Hey! What do you think? You think I&apos;m super cute, don&apos;t you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020220014", /*message*/"*Sniff* *Sniff* I&apos;m practicing my fake tears right now.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020220015", /*message*/"Ahhh, my feet are so sore from these shoes!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020230012", /*message*/"I&apos;ll make an exception and show you my magic!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020230013", /*message*/"Look at me in my magical girl costume! I&apos;m the cutest girl in the world? That&apos;s right!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020230014", /*message*/"Ta-da! Behold my special, magic bread rolls! Care to try one?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020230015", /*message*/"Not bad!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020320012", /*message*/"I always aim to perform with an emotional range that&apos;s as broad as the colors of a rainbow.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020320013", /*message*/"Putting on my stage costume really helps me focus. It makes me want to put on my best performance for the audience.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020320014", /*message*/"I want to become such a good actress that even children are enchanted by my performance.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020320015", /*message*/"I don&apos;t think about anything else when I&apos;m acting. I really like that feeling.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020320022", /*message*/"The perfectly coordinated movements of a marching band are just so...magnificent! That&apos;s the only word for it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020320023", /*message*/"Marching bands sometimes have color guard or baton performances incorporated into them. They&apos;re fun for both the eyes and ears.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020320024", /*message*/"The drama club decided to do a play about idols, and they asked me to supervise the actors!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020320025", /*message*/"Sh-Should I eat this bread roll? I&apos;m scared to eat anything Kasumi brings. She covered a　roll with spicy mustard once.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020330012", /*message*/"If I could hop across the ocean in a single step, visiting other countries would be like a walk in the park.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020330013", /*message*/"Having a costume that looks like a uniform is just so befitting of school idols. It&apos;s just wonderful!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020330014", /*message*/"I&apos;d like to be in a play with everyone in the club one day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020330015", /*message*/"Sharpening one&apos;s performance actually sharpens the mind as well. Is that something you&apos;re interested in?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020420012", /*message*/"All of my costumes are my prized possessions. It almost feels like they&apos;re working just as hard as I am. Kinda like we&apos;re partners in crime.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020420013", /*message*/"This looks like a rainbow hanging in the sky, doesn&apos;t it? Don&apos;t you think it&apos;s the perfect costume for me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020420014", /*message*/"Kasumi might not look it, but she&apos;s a sweet girl. I hope you&apos;ll talk with her a lot and learn to understand her.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020420015", /*message*/"It must be nice to be able to write songs. If I could express my feelings through music... *Giggle* That&apos;d be just wonderful.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020430012", /*message*/"I thought cute dresses like this didn&apos;t look good on me, but...you said it would. So what do you think?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020430013", /*message*/"It would be so fun to be able to dive inside a painting! I&apos;d like to be a princess in a painting too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020430014", /*message*/"There&apos;s a café I love to go to lately. Let&apos;s go there together after school.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020430015", /*message*/"Are you tired? Here, lean against me and doze off for a bit, okay?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020520012", /*message*/"*Roar* Be careful, I&apos;m a wild animal right now! Hit me with an awesome pun if you want to pet me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020520013", /*message*/"Just like other cats, leopards are nimble. They can hop from tree to tree, right? So they&apos;re hard to spot. Get it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020520014", /*message*/"Dance practice, voice training, being an alternate for all the sports teams... I&apos;m so busy every day, I wish I had another copy of me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020520015", /*message*/"Did you watch my live show? *Giggle* Pretty good, right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020520022", /*message*/"All right, march in time with me! Forward, march!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020520023", /*message*/"Nijigasaki, forward march!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020520024", /*message*/"Rain or hail ain&apos;t enough to stop me! I&apos;m always going full throttle!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020520025", /*message*/"Our energy is gonna send your sorrows straight out the window!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020530012", /*message*/"I&apos;ll show everyone such good fun that they&apos;ll totally lose track of time!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020530013", /*message*/"If I were Princess Otohime and you were the hero going back to the surface... I don&apos;t know if I&apos;d let you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020530014", /*message*/"I&apos;m not done singing yet! I want you to sing with me this time!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020530015", /*message*/"Ugh, I didn&apos;t eat any of my grandma&apos;s pickles today so I&apos;m all weak.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020620012", /*message*/"One Kanata, two Kanatas, three Kanatas... *Snore*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020620013", /*message*/"I wish there was an event where you use a sheep as a pillow in a vast meadow with a gentle breeze blowing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020620014", /*message*/"You&apos;re worried if I can perform in the live show when I look so sleepy? Of course I&apos;ll be fine! When I put my mind to things, I get the job done!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020620015", /*message*/"You know how you smile a lot when I sing? Seeing that really lights a fire under me. I&apos;m dead serious.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020630012", /*message*/"Heh heh! No one can wear this costume but me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020630013", /*message*/"This costume is so meant for me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020630014", /*message*/"I want a fluffier pillowcase. Hey, let&apos;s go shopping together!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020630015", /*message*/"I feel so at ease when I&apos;m with you that it makes me sleepy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020720012", /*message*/"Come now, let&apos;s dance! The seven colors of light are giving us their blessing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020720013", /*message*/"I&apos;d love to wear this costume after the rain.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020720014", /*message*/"Live shows are so much fun! It&apos;s the kind of environment where anyone can be free.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020720015", /*message*/"Don&apos;t keep your feelings of love locked away. The world is your oyster!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020720022", /*message*/"I am not perfect, which is why I have to make elaborate preparations.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020720023", /*message*/"All done getting ready! Let us make this performance an extra-fulfilling one!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020720024", /*message*/"Should we do some stretches? It&apos;ll refresh your body!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020720025", /*message*/"I feel so relaxed in the clubroom. I guess it&apos;s like...the place where I can most be myself?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020820012", /*message*/"I&apos;ll dance like a wild serow hopping about in the Alps!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020820013", /*message*/"I&apos;m reminded of Switzerland when I wear this costume. I hope everyone is doing well.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020820014", /*message*/"I&apos;ll treat you to a special sandwich filled with cheese when you&apos;re feeling down.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020820015", /*message*/"I want to become a school idol who brings smiles to the faces of those who watch me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020830012", /*message*/"The sky after it rains is just so peaceful!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020830013", /*message*/"I like walking in the rain without my umbrella sometimes too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020830014", /*message*/"We don&apos;t have any beaches in Switzerland. I&apos;d love to see a rainbow over the ocean someday.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020830015", /*message*/"The forest is filled with sounds on rainy days. It&apos;s so relaxing to just sit and listen to them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020920012", /*message*/"Rina-chan Board says, &quot;Meow, meow!&quot; Just kidding.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020920013", /*message*/"Maybe it&apos;d be cuter if the ears and tail moved automatically?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020920014", /*message*/"How do I connect better with everyone? This is difficult...");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020920015", /*message*/"I&apos;m always serious when I write on the Rina-chan Board since it can&apos;t be edited later.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020920022", /*message*/"It feels great to march all in unison with the music.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020920023", /*message*/"I wonder what kind of instrument I could play. Maybe drums, cymbals, or a glockenspiel... A trumpet might be too hard, huh?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020920024", /*message*/"Karin gave me some strawberry-scented lip balm. It smells nice and sweet. I-I won&apos;t eat it. Even I know not to do that.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_4020920025", /*message*/"Oof... I was watching videos in the bath and I got a head rush. I feel so dizzy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020110014", /*message*/"Footraces make me nervous... Do you know any tricks to ease my nerves?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020110015", /*message*/"I put some extra rolled eggs in your boxed lunch today. Let&apos;s have lunch together!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020210014", /*message*/"I can&apos;t get into the spirit until you say I did a good job!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020210015", /*message*/"I know I won&apos;t lose in the bread-eating contest!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020310014", /*message*/"I&apos;m so bad at ball sports. I watch videos and practice, but I always end up getting hit in the face with the ball.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020310015", /*message*/"Argh, the ball hit me in the face instead of going in the net! Whyyy?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020410014", /*message*/"I&apos;m doing the three-legged race with Dia. Watch us move in sync!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020410015", /*message*/"Who are you going to eat lunch with? I bet I already know the answer!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020510014", /*message*/"Kanan and I spent way too long talking about cheerleading chants. But I didn&apos;t mind at all &apos;cause it was so fun!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020510015", /*message*/"Oh! Oh no! Shizuku got injured during the ball toss game! I&apos;m coming, Shizuku!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020610014", /*message*/"Ruby might make for a comfy body pillow... I&apos;m gonna ask her to nap with me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020610015", /*message*/"If you and Haruka cheer for me, I feel like I&apos;ll do well out there. C&apos;mon, let me hear you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020710014", /*message*/"Competition sure gets the blood pumping, doesn&apos;t it? It&apos;s because everyone wants to win!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020710015", /*message*/"Mari and Nozomi&apos;s secret meeting was actually about lunch! I&apos;m happy they asked me to join them!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020810014", /*message*/"I made my sandwich with ingredients that&apos;ll make me super strong! First place is as good as mine!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020810015", /*message*/"Why isn&apos;t snack time on the schedule? We&apos;re exercising a ton, so we should be allowed to refuel.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020910014", /*message*/"Lots of people wanted my special drink today. I gave some to everyone! Rina-chan Board says, &quot;Victory!&quot;");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_ca_5020910015", /*message*/"If I win first place...will you give me headpats?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0001", /*message*/"Welcome back! What shall we do today?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0002", /*message*/"I want to do another live show soon. What about you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0003", /*message*/"Everything&apos;s ready! We&apos;ll do our very best today!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0004", /*message*/"Welcome back! I&apos;ve been waiting for you all this time!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0005", /*message*/"I have so much to tell you. Will you come with me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0006", /*message*/"It&apos;s not just me, everyone&apos;s so motivated! It feels like we can do anything now.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0007", /*message*/"Hehe. Just seeing your face makes me happy!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0008", /*message*/"I worry if I haven&apos;t seen you in a while. I wish you were always with me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0009", /*message*/"I want to know so much more about you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0010", /*message*/"Yay!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0011", /*message*/"Haha!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0012", /*message*/"Hmph.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0013", /*message*/"No way.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0014", /*message*/"What?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0015", /*message*/"What do we do?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0016", /*message*/"Wow!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0017", /*message*/"Hehe.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0018", /*message*/"We wear a uniform every day, but I never get sick of it. After all, they are so well-made!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0019", /*message*/"Did you know that at Otonokizaka High, the color of your ribbon depends on what grade you&apos;re in?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0040", /*message*/"It&apos;s so cold! But once we start practicing I forget all about it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0041", /*message*/"When it gets cold, it&apos;s hard to get out of bed. It&apos;d be nice if you could come wake me up gently.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0044", /*message*/"I hope there&apos;s no pop quizzes today.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0045", /*message*/"After class finishes, let&apos;s hurry to the clubroom. I want to see everyone as soon as possible!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0046", /*message*/"I hope there&apos;s no homework today.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0047", /*message*/"I just listened to all μ&apos;s&apos; songs so far, and it made me think about how we&apos;ve had so much fun together.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0048", /*message*/"Hehe. Today&apos;s snack...is bread! Yum.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0049", /*message*/"Ngh... I&apos;m still...sleepy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0050", /*message*/"Mornings are for runs! It&apos;ll wake you up and keep you fit and healthy!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0051", /*message*/"Do you want to go shopping on our next free day? I want to pick out some clothes together.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0052", /*message*/"Now that we&apos;ve had lunch I&apos;m full of energy! I can&apos;t wait for club activities!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0053", /*message*/"I hope you can tell that I&apos;ve practiced and listened to your advice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0054", /*message*/"Mom! What&apos;s for dinner?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0055", /*message*/"Today was so much fun. See you again tomorrow!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0056", /*message*/"I wish I was just a little taller. I gotta drink more milk!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0057", /*message*/"Hehe. It feels good having my head patted.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0058", /*message*/"Is there something on my face? I-Is it breadcrumbs?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0059", /*message*/"When your face gets so close...my heart beats a lot faster.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0060", /*message*/"I have to work on my diet until our next show!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0061", /*message*/"What&apos;s up? Just felt like poking me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0062", /*message*/"Noooo, that tickles!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0063", /*message*/"Eek! If you start tickling me, I&apos;ll tickle you right back!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0064", /*message*/"HAPPY BIRTHDAY! Hehe, I&apos;m so happy I can celebrate with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0104", /*message*/"Don&apos;t you want to see the rest of the story? I&apos;m curious about what happens.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0105", /*message*/"We can still do live shows! Let&apos;s go!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0106", /*message*/"I feel full of energy now! Right, let&apos;s do some practicing!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0107", /*message*/"Hey! How about we go train together?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0108", /*message*/"Looks like there&apos;s goals to clear. It&apos;ll be no trouble if they&apos;re school idol goals.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0109", /*message*/"Looks like you have a notification. Check it out!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0110", /*message*/"What? There&apos;s a present? That&apos;s great!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0111", /*message*/"There&apos;s an event in progress! Can we join in?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0112", /*message*/"Looks like there&apos;s a new episode out. Let&apos;s read it together!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0113", /*message*/"A login bonus! It&apos;s important to be consistent.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0114", /*message*/"Hooray! You did really well!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0115", /*message*/"That was so much fun!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0116", /*message*/"I could really hear you!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0117", /*message*/"This is all thanks to you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0118", /*message*/"I trust you completely.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0119", /*message*/"I want...to get to know you even better.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0120", /*message*/"We&apos;re going to be together from here on out!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0123", /*message*/"Let&apos;s carry on working hard together!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0126", /*message*/"If there&apos;s anything you don&apos;t understand, you can ask me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0127", /*message*/"Is there anywhere you haven&apos;t been yet?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0128", /*message*/"You seem to have gotten pretty used to it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0129", /*message*/"What would you like to do today?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0130", /*message*/"It&apos;s gotten more and more fun, right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0131", /*message*/"Let&apos;s keep playing together!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0132", /*message*/"Thank you! I&apos;m so happy that you could celebrate my birthday with me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0133", /*message*/"あれれ～、残念っ");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0001_0134", /*message*/"も、もう一回お願いしまーすっ");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0001", /*message*/"Welcome back. What would you like to do today?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0002", /*message*/"The photos from our performance the other day are ready. I want you to see them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0003", /*message*/"I want to know more about you. Please tell me lots about yourself.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0004", /*message*/"Hm? Were you waiting for me? Hehe. I&apos;m back!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0005", /*message*/"I feel so calm when I see you. Thank you for always being with me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0006", /*message*/"Shall I try and guess what&apos;s on your mind? Hehe. I think I could, as I know all about you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0007", /*message*/"Oh, thank goodness. I was worried because I couldn&apos;t see you. Stay right beside me, okay?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0008", /*message*/"You&apos;re late. I&apos;ve been waiting for ages for you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0009", /*message*/"That&apos;s so kind. It&apos;s that part of you that I like.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0010", /*message*/"Yay! Isn&apos;t that great?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0011", /*message*/"Hehehe.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0012", /*message*/"Hey!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0013", /*message*/"Hmph.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0014", /*message*/"How troubling.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0015", /*message*/"*Sigh*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0016", /*message*/"Well, well, well. ♪");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0017", /*message*/"Hehe.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0018", /*message*/"You could say that for school idols, a school uniform is just another costume.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0019", /*message*/"When you wear a uniform, it&apos;s immediately obvious which school you&apos;re from, so...don&apos;t do anything strange, okay?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0040", /*message*/"Are you cold? Let&apos;s take a relaxing hot bath tonight.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0041", /*message*/"Autumn makes one thoughtful. I think about you often.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0044", /*message*/"Let&apos;s make an effort from the morning to make sure we have the best day possible!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0045", /*message*/"Do you wanna go shopping after class today? Maybe we can get something matching. Just kidding!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0046", /*message*/"Let&apos;s do our best with club activities today! I want to hear all your ideas.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0047", /*message*/"It&apos;s because you&apos;re always with me. Your smile gives me strength.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0048", /*message*/"Tomorrow will be hard if you stay up too late. Make sure you rest, okay?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0049", /*message*/"Hm? You can&apos;t sleep? Let me hold your hand.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0050", /*message*/"Good morning. Let&apos;s try our best today, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0051", /*message*/"Oh! There you are! The day can&apos;t possibly start without you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0052", /*message*/"If you&apos;re tired we should take a break.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0053", /*message*/"I wonder what Alisa is doing right now. Hehe. Aren&apos;t you curious, too?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0054", /*message*/"Well done today. I hope I can be with you tomorrow, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0055", /*message*/"Can I call you before bedtime? I feel like I&apos;ll have sweeter dreams if I hear your voice before I sleep.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0056", /*message*/"My grandma was proud of her blond hair, and so am I!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0057", /*message*/"Next time we go on a date, maybe I should do my hair the way you like it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0002_0058", /*message*/"They say that I have a strong gaze. Maybe that means I look tough, too?");
