INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0041", /*message*/"My eyes look like the color of autumn leaves? Ooh. No one&apos;s ever described them like that before!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0044", /*message*/"Don&apos;t stay up late, or my sisters will be angry.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0045", /*message*/"Seeing your smile makes me happy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0046", /*message*/"Do you pick off all the white bits when you eat mikan? Or do you just eat them?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0047", /*message*/"The dance we&apos;re currently practicing is hard, but I really want you to see me do it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0048", /*message*/"*Yawn* I&apos;m still sleepy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0049", /*message*/"You&apos;re waking up already? Why not sleep a bit longer?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0050", /*message*/"I&apos;m thinking of wearing a different hairpin today. Which one do you think looks nice?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0051", /*message*/"Since we&apos;re here and all, could I hear you say I&apos;m cute?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0052", /*message*/"Mmm. I get sleepy after I eat. *Yawn*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0053", /*message*/"Even the hardest practices aren&apos;t so bad when I know you&apos;re rooting for me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0054", /*message*/"That was a looong practice today. I&apos;m exhausted.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0055", /*message*/"I hope I get to see you again tomorrow, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0056", /*message*/"Whoa! What did you do that for?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0057", /*message*/"*Giggle* Pat me on the head again.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0058", /*message*/"Hmm? Is there something on my face?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0059", /*message*/"It&apos;s a little embarrassing when you stare like that.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0060", /*message*/"Hmm? What did you want?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0061", /*message*/"It&apos;s nice to know that you want my attention.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0062", /*message*/"Ahahah! That tickles.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0063", /*message*/"No! Stop! That&apos;s my weak spot.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0064", /*message*/"Happy Birthday! I&apos;m really glad I get to celebrate it with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0104", /*message*/"Apparently there is story waiting to be read!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0105", /*message*/"We&apos;re all prepared! Let&apos;s do a live show.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0106", /*message*/"You and I should practice!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0107", /*message*/"It&apos;s time for training!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0108", /*message*/"Together, we can achieve our new goal.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0109", /*message*/"A notification has arrived! Hurry up and read it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0110", /*message*/"I hear you got a present! What could it be?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0111", /*message*/"I hear there&apos;s an event going on! Doesn&apos;t that sound like fun?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0112", /*message*/"There&apos;s a new chapter waiting to be read!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0113", /*message*/"We earned something really nice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0114", /*message*/"Yay! That show went really well!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0115", /*message*/"Your support made all the difference!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0116", /*message*/"Hurray! That was a huge success!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0117", /*message*/"Thanks for hanging in there with me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0118", /*message*/"I&apos;m writing a new song, and I want you to be the first to hear it when it&apos;s done.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0119", /*message*/"I was given some really sweet mikan oranges! Why don&apos;t you share them with me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0120", /*message*/"There&apos;s so much I want to chat with you about, and so little time.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0123", /*message*/"I hope you&apos;ll continue to work hard with me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0126", /*message*/"If you have any questions, just ask.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0127", /*message*/"Are there any places you haven&apos;t visited yet?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0128", /*message*/"Is it all starting to make sense?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0129", /*message*/"What do you wanna do today?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0130", /*message*/"I&apos;m having a lot of fun, how &apos;bout you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0131", /*message*/"I&apos;m looking forward to hanging out with you all the time!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0132", /*message*/"Thanks! *Giggle* I&apos;m really happy you wanted to celebrate my birthday with me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0133", /*message*/"あう～、残念っ");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0101_0134", /*message*/"元気出してこう！ねっ♪");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0001", /*message*/"I never thought of myself as a school idol, but now that it&apos;s happening, I hope I really appear like one.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0002", /*message*/"What instruments do Aqours&apos; members remind me of? Hmm. Chika makes me think of castanets.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0003", /*message*/"I like to help out with the costumes, but my creations don&apos;t compare at all to Ruby or You&apos;s.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0004", /*message*/"You showed up. I&apos;ve been practicing a tune I want you to hear. Can I play it for you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0005", /*message*/"You want to wake up to my piano playing? A-Are you asking to stay over?! Oh. You meant a recording?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0006", /*message*/"The thought of you listening to my music makes writing it that much more fun.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0007", /*message*/"I had a dream last night that you were playing the piano with me. It was a lot of fun.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0008", /*message*/"Oh. Welcome back! You startled me. I was wishing you would return soon, and it must have gotten through to you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0009", /*message*/"I like cooking, but I can&apos;t make anything very fancy. Really?! You don&apos;t mind? *Gulp* Okay, I&apos;ll try.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0010", /*message*/"*Chuckle*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0011", /*message*/"Thanks. That&apos;s great.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0012", /*message*/"I&apos;m not mad.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0013", /*message*/"Whatever!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0014", /*message*/"*Sigh*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0015", /*message*/"Aw.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0016", /*message*/"Everything seems to be going well.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0017", /*message*/"I feel a bunch of new tunes just bursting to come out.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0018", /*message*/"Uranohoshi&apos;s sailor outfits are a refreshing change after the blazer uniforms at Otonokizaka.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0019", /*message*/"I really like this red scarf, but its color will change as we go up in grade levels.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0040", /*message*/"I see a mikan orange in Chika&apos;s bag. Do you think it&apos;s her dessert for lunch, or a snack?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0041", /*message*/"The temperature sure has dropped. Be careful you don&apos;t catch a chill.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0044", /*message*/"Did you eat breakfast? You better. It&apos;s the best way to start the day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0045", /*message*/"Seeing you first thing in the morning guarantees today is going to be a great day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0046", /*message*/"I&apos;d love to capture the beauty of Uchiura in a painting, but I could never do justice to that lovely blue ocean.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0047", /*message*/"When I look at that bright blue sea, I know it wouldn&apos;t be half as spectacular without you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0048", /*message*/"*Yawn* Oh! Sorry! I must have dozed off there.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0049", /*message*/"Don&apos;t force yourself. If you&apos;re at all tired, just relax and close your eyes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0050", /*message*/"I tried making egg salad sandwiches. Have one if you&apos;d like.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0051", /*message*/"I feel grateful the gods let us spend all these peaceful days together.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0052", /*message*/"Doesn&apos;t it feel nice when you can suddenly accomplish something that was beyond you before?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0053", /*message*/"My hair looks softer than usual? I did change shampoos, but I&apos;m impressed you noticed.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0054", /*message*/"Before coming to Uchiura, I never would have dreamed I&apos;d be singing and dancing almost every day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0055", /*message*/"Great work today. I&apos;ll see you again tomorrow, okay?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0056", /*message*/"Wh-What? Did you want something?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0057", /*message*/"Thanks for brushing my hair aside. It feels nice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0058", /*message*/"Eeek!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0059", /*message*/"Whaa! Please don&apos;t pinch my cheeks.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0060", /*message*/"Did you want something?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0061", /*message*/"*Chuckle* What?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0062", /*message*/"Eek! That tickles!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0063", /*message*/"*Chuckle* *Giggle* S-Stop that!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0064", /*message*/"Happy Birthday. Your encouragement gives us all the strength we need. I appreciate it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0104", /*message*/"I think there&apos;s some of the story you haven&apos;t read.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0105", /*message*/"Let&apos;s put on an exciting live show.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0106", /*message*/"I want to go practice! That way I can get better!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0107", /*message*/"Going out for training like this is kind of exciting.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0108", /*message*/"I think there&apos;s a goal we can clear. Wanna give it a try?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0109", /*message*/"It seems a notification arrived.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0110", /*message*/"I think you have a present waiting. I&apos;m excited to see what it is.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0111", /*message*/"There&apos;s an event happening. Want to try entering it with me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0112", /*message*/"I hear there&apos;s a new chapter. Want to go take a look?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0113", /*message*/"Is... Is it really okay to take this?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0114", /*message*/"Yay! The live show was a success!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0115", /*message*/"I&apos;ll remember this day for as long as I live.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0116", /*message*/"Amazing! That was a great success!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0117", /*message*/"I feel like I&apos;m dreaming.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0118", /*message*/"Every time I&apos;m near you, I hear sweet melodies playing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0119", /*message*/"I feel so awkward up on stage. Sure, I had recitals and whatnot when I was learning to play piano, but... No really! I&apos;m not kidding!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0120", /*message*/"Want to go for a walk with our lunches one of these days? I found a wonderful place to go while I was out drawing recently.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0123", /*message*/"Let&apos;s give it all we&apos;ve got, okay?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0126", /*message*/"If you have any questions, just ask me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0127", /*message*/"Are there any places you have yet to visit?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0128", /*message*/"Getting the hang of things?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0129", /*message*/"What do you wanna do today?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0130", /*message*/"This is starting to get fun.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0131", /*message*/"I&apos;m looking forward to hanging out with you all the time!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0132", /*message*/"Wow. You remembered my birthday? Thanks.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0133", /*message*/"また一緒に頑張りましょう");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0102_0134", /*message*/"大丈夫。きっと次に繋がるわ");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0001", /*message*/"Maybe our efforts will help bring some excitement to Uranohoshi and Uchiura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0002", /*message*/"The ocean can be really moody. You never know when it&apos;s going to start throwing a tantrum.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0003", /*message*/"I&apos;m so glad Chika started Aqours. It&apos;s what gave me the chance to come back.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0004", /*message*/"Your support really keeps us all going. Don&apos;t give up on Aqours!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0005", /*message*/"I&apos;ve been sitting here waiting for you. What should we do today?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0006", /*message*/"You think you could learn to like diving? *Chuckle* The ocean has captured another heart.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0007", /*message*/"You&apos;re back. I started to think you might not show today, and was growing a little lonely.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0008", /*message*/"I plan on hanging out until I get bored today. Of course, that means you&apos;re stuck with me for good.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0009", /*message*/"It&apos;d be great if I could have you all to myself without the others finding out.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0010", /*message*/"Hee, hee.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0011", /*message*/"*Giggle* That&apos;s great.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0012", /*message*/"Wait a second!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0013", /*message*/"*Sigh*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0014", /*message*/"Aw.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0015", /*message*/"No way.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0016", /*message*/"*Chuckle*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0017", /*message*/"Tee-hee.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0018", /*message*/"Our Uranohoshi uniforms aren&apos;t very fancy, but they&apos;re cute, don&apos;t you think?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0019", /*message*/"I sometimes wonder if we wear sailor uniforms because we live in a beach town. But I know there&apos;s probably no connection.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0040", /*message*/"This time of year, the clubroom is always stocked with mikan oranges. I wonder if Chika is the one bringing them in?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0041", /*message*/"Whether we&apos;re enjoying the blue summer ocean, or the colorful fall hills, I love spending time with you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0044", /*message*/"Every morning when I wake up, I greet the ocean, and the sound of the waves answers me back.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0045", /*message*/"I love your hands. Wherever they touch, I can feel my troubles and worries melting away.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0046", /*message*/"The ocean wraps all around the world without any breaks, right? So when you&apos;re in it, it&apos;s like you&apos;re connected to everything.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0047", /*message*/"I love wakame seaweed, and put lots of it in my miso soup. You should try it. It&apos;s really good.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0048", /*message*/"I love diving in the ocean here in Uchiura, since this is where I grew up. But I&apos;d like to dive in lots of other places, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0049", /*message*/"If you&apos;re ever feeling troubled, you can tell me about it. Feel free to unload whatever might be weighing your heart down.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0050", /*message*/"I saw a shooting star last night! Unfortunately, it happened so suddenly I couldn&apos;t make a wish.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0051", /*message*/"Why the long face? Don&apos;t worry, I have no intention of going anywhere.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0052", /*message*/"Dancing and singing for long stretches of time isn&apos;t easy, but the sense of accomplishment afterwards is unbeatable.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0053", /*message*/"You think one hug is going to make me forgive you? Oh, all right. You&apos;re forgiven.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0054", /*message*/"Working hard is admirable, but it&apos;s also important to rest. Don&apos;t push yourself.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0055", /*message*/"I know a little spell to help energize you. Close your eyes, and open your arms. *Hug*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0056", /*message*/"I can&apos;t remember the last time someone patted me on the head.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0057", /*message*/"Let me pat you back. That&apos;s a good kid.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0058", /*message*/"My skin isn&apos;t that soft, is it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0059", /*message*/"Hey. Stop trying to tease me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0060", /*message*/"Did you want something?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0061", /*message*/"If you need my help, just say the word.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0062", /*message*/"Whoa! You startled me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0063", /*message*/"I told you, that tickles!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0064", /*message*/"Happy Birthday. After all the happiness you&apos;ve brought me, today is my chance to return the favor.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0104", /*message*/"There&apos;s some of the story you haven&apos;t read.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0105", /*message*/"It&apos;s time for a live show! How exciting.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0106", /*message*/"Come on. Let&apos;s go practice! I feel like I&apos;m ready to make some big progress!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0107", /*message*/"Training will help forge our bodies and minds!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0108", /*message*/"Shouldn&apos;t we accomplish those goals before they stack up?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0109", /*message*/"A new notification has arrived.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0110", /*message*/"Did you receive your present yet?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0111", /*message*/"There&apos;s an event happening. Have you taken part?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0112", /*message*/"A new chapter is available.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0113", /*message*/"How lucky! This should be used with care.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0114", /*message*/"Yay. We did it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0115", /*message*/"That was a great stage performance! Thanks.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0116", /*message*/"I&apos;ll never forget today&apos;s live show.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0117", /*message*/"Well done. Thanks to you, it was a huge success!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0118", /*message*/"I&apos;ve started to get a feel for what&apos;s on your mind. Right now...you want to go diving in the ocean! Am I right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0119", /*message*/"I&apos;m your sun? That&apos;s a bit of a stretch. But I could definitely say the same for you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0120", /*message*/"Hug from behind! Ahahah! Did I surprise you?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0123", /*message*/"Let&apos;s do our best going forward!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0126", /*message*/"If you don&apos;t understand anything, just ask me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0127", /*message*/"Is there any place you haven&apos;t gone yet?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0128", /*message*/"Are you starting to get the hang of things?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0129", /*message*/"What do you want to do today?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0130", /*message*/"Isn&apos;t this starting to get fun?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0131", /*message*/"You and I are going to have lots of fun together!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0132", /*message*/"Wait. You remembered today is my birthday? Thanks. I&apos;m so happy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0133", /*message*/"次があるよ。頑張れ！");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0103_0134", /*message*/"失敗や後悔は海に飲み込んでもらおう");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0001", /*message*/"All of our members stand out in one way or another, but that&apos;s Aqours for you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0002", /*message*/"School idols look so cheerful, but it&apos;s a harsh world. The nine of us are going to conquer it, though!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0003", /*message*/"I&apos;m not being unreasonable in any way. I just don&apos;t like lying to myself.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0004", /*message*/"Would you like to share my pudding with me? It was a gift from a famous confectionery shop, and very limited.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0005", /*message*/"I&apos;ve been waiting for you to show up. You and I have plenty to discuss about the future of Aqours.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0006", /*message*/"Every minute of our time together is precious to me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0007", /*message*/"I plan on seeing a movie this upcoming weekend. Would you like to join me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0008", /*message*/"I have a feeling you&apos;re a bad influence on me. You simply spoil me way too much when you&apos;re around.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0009", /*message*/"I&apos;m feeling a bit...run down. Would you mind if I borrowed your shoulder a moment?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0010", /*message*/"How wonderful.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0011", /*message*/"Thank you very much.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0012", /*message*/"What was that?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0013", /*message*/"Please behave yourself.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0014", /*message*/"I&apos;d like to be alone a moment.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0015", /*message*/"Oh. How dreadful.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0016", /*message*/"*Chuckle*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0017", /*message*/"*Chuckle* How amusing.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0018", /*message*/"The uniforms signify our diligent pursuit of knowledge. Decoration would be inappropriate.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0019", /*message*/"I started school with a brand new uniform. Now, after three years, though, it is looking a little tired.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0040", /*message*/"The trees are so colorful this time of year. Why don&apos;t we take the long way home today?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0041", /*message*/"Can I interest you in a chat? It&apos;s a good way to spend the rather long autumn evenings.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0044", /*message*/"Sleeping in won&apos;t be tolerated.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0045", /*message*/"Do I ever braid my hair? Well, not really. Do you think braided hair looks attractive?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0046", /*message*/"Why is it that seeing the same old, familiar sights can feel so reassuring?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0047", /*message*/"I could never lie to you, because even if I tried, I know you would see right through it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0048", /*message*/"They say the early bird gets the worm. As phrases go, it&apos;s short, and simple, but far from insignificant.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0049", /*message*/"Your hair looks like you just woke up. Good grief. Sit down, and I&apos;ll fix it for you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0050", /*message*/"Would you like to take a break? I&apos;ll make you a cup of matcha tea.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0051", /*message*/"When I&apos;m with you, I can feel all of my tension simply dissolve away.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0052", /*message*/"Our student council meeting may run late. But then, practice... No. The student council meeting is equally important!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0053", /*message*/"Please stay around a little longer. Just another minute or two is all I ask, and then I&apos;ll be satisfied.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0054", /*message*/"Occasionally when I read at night, I&apos;ll wake up with the book lying at my feet, or underneath me even. I can&apos;t explain it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0055", /*message*/"Why not close your eyes and rest? Don&apos;t worry, I&apos;ll wake you up in plenty of time.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0056", /*message*/"Did you wish to tell me something?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0057", /*message*/"I appreciate the kind attention, but it won&apos;t gain you anything.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0058", /*message*/"Y-You startled me. What do you want?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0059", /*message*/"Mmm. That feels surprisingly good.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0060", /*message*/"Did you have a question? I&apos;m listening.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0061", /*message*/"There&apos;s no need for concern, I&apos;m not going anywhere.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0062", /*message*/"Eek! Next time please say something before just touching me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0063", /*message*/"*Giggle* *Squeal* That&apos;s enough. Please, stop!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0064", /*message*/"Happy Birthday. Nothing has brought me more happiness than making your acquaintance.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0104", /*message*/"Have you considered reading some of the story?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0105", /*message*/"It&apos;s time for our live show. Prepare yourself, and let&apos;s go!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0106", /*message*/"I feel we need to practice if we wish to further improve ourselves.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0107", /*message*/"This kind of training is a valuable experience. What are we waiting for, let&apos;s go!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0108", /*message*/"We have a new goal. A systematic approach should allow us to accomplish it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0109", /*message*/"A notification has apparently arrived for you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0110", /*message*/"It seems there is a present waiting to be received.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0111", /*message*/"You wish to enter an event, with me? I don&apos;t see any reason not to.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0112", /*message*/"I hear there are new chapters available.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0113", /*message*/"That is much appreciated.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0114", /*message*/"That went exactly as expected.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0115", /*message*/"That was fantastic!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0116", /*message*/"Words cannot express how happy I am!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0117", /*message*/"That was absolutely perfect!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0118", /*message*/"I look forward to your company as we continue on the path to becoming school idols.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0119", /*message*/"A school idol quiz? Sure. I&apos;m willing to accept that challenge!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0120", /*message*/"You think the mole by my mouth is attractive? M-Mind your tongue! The thought alone is outrageous!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0123", /*message*/"Let&apos;s continue giving our best effort!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0126", /*message*/"Please feel free to ask me any questions you might have.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0127", /*message*/"Are there any places you have yet to visit?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0128", /*message*/"Is everything beginning to make sense?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0129", /*message*/"What would you like to do today?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0130", /*message*/"This is becoming quite enjoyable, don&apos;t you think?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0131", /*message*/"I can see myself hanging out with you all the time!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0132", /*message*/"Thank you. I really appreciate you being here to celebrate with me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0133", /*message*/"結果は結果です。受け止めて、次へ行きましょう");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0104_0134", /*message*/"次こそは成功させましょう！");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0001", /*message*/"Aye aye! Someday, I hope you&apos;ll join me on my boat, and the two of us will sail the world.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0002", /*message*/"Sailor uniforms are brimming with all the romance of the deep blue sea!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0003", /*message*/"When I spot an article of clothing designed after a sailor&apos;s uniform, it&apos;s impossible not to stop and admire it. Know what I mean?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0004", /*message*/"You showed up. I figure since I end up talking all the time, today is your turn to talk for a change.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0005", /*message*/"Today is diving practice. I hope you&apos;ll come watch, and see how great my form is.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0006", /*message*/"When I go out on stage, all my confidence comes from the knowledge that you&apos;re watching me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0007", /*message*/"You&apos;re finally back. Get over here, I&apos;ve been waiting for you!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0008", /*message*/"When I gaze at the ocean with you, it feels like it sparkles prettier than any jewel in the world!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0009", /*message*/"I&apos;m so excited by the thought of hanging out with you today, that my heart is about to fly out of my chest!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0010", /*message*/"*Chuckle*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0011", /*message*/"That&apos;s great!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0012", /*message*/"What?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0013", /*message*/"Grr.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0014", /*message*/"Are you kidding?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0015", /*message*/"*Sigh*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0016", /*message*/"Yahoo!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0017", /*message*/"Yay!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0018", /*message*/"I told myself I wouldn&apos;t go to any school that didn&apos;t have sailor uniforms.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0019", /*message*/"The scarf on our Uranohoshi uniform is worn differently depending on whether it&apos;s summer or winter; unless you&apos;re a senior.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0040", /*message*/"It&apos;s yummy mikan orange season! We&apos;re all stocked up with them at my house.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0041", /*message*/"Ooh. Patches of red are showing up on the mountains! It&apos;ll be time for a stroll in the autumn leaves soon.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0044", /*message*/"Aye aye! Let&apos;s take today full speed ahead!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0045", /*message*/"The seat next to you is always reserved for me. *Giggle* I wasn&apos;t serious.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0046", /*message*/"Hmm? It&apos;s starting to feel like...rain!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0047", /*message*/"You&apos;re interested in the high dive?! That&apos;s great. I have videos of our past competitions at home if you wanna see them.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0048", /*message*/"Good morning. Aye... Zzz...");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0049", /*message*/"I have no problem sleeping when you&apos;re around.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0050", /*message*/"It feels so good to run when the weather is nice, doesn&apos;t it? Hey, hurry up or I&apos;ll leave you behind!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0051", /*message*/"*Groan* I can&apos;t decide on an outfit design. Pat me on the head, and maybe I&apos;ll come up with some good ideas.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0052", /*message*/"There&apos;s sashimi for dinner tonight. I know I should eat it all but...I just can&apos;t!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0053", /*message*/"Can you wait a few more minutes? I&apos;m almost done with practice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0054", /*message*/"It&apos;s completely dark out. Let&apos;s hurry home!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0055", /*message*/"I wonder what tomorrow will bring? I can&apos;t wait to find out!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0056", /*message*/"*Giggle* Yes?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0057", /*message*/"No way. My hair is sticking up?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0058", /*message*/"Whoa!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0059", /*message*/"Your hands are so nice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0060", /*message*/"Hmm?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0061", /*message*/"Just call, and I&apos;ll immediately come running!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0062", /*message*/"Eek! Warn me next time.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0063", /*message*/"Ahahah! Oh! Phew. Stop!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0064", /*message*/"Happy Birthday! All the Aqours members have a huge party planned!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0104", /*message*/"If you don&apos;t read the story, I&apos;m gonna read it for you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0105", /*message*/"I think we&apos;re ready for any live show you can imagine.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0106", /*message*/"Come on, let&apos;s practice! I could use a whole lot more!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0107", /*message*/"I&apos;ve been waiting for this training. This should be exciting!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0108", /*message*/"Once our goal is finished, we can go have some fun!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0109", /*message*/"There&apos;s a new notification.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0110", /*message*/"Did you hear about your present?! Let&apos;s go get it!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0111", /*message*/"I wonder what event is going on? Let&apos;s go take a peek.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0112", /*message*/"I wonder whose chapter we&apos;ll be able to read?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0113", /*message*/"Oh wow! Look what we got!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0114", /*message*/"We certainly gave it our all.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0115", /*message*/"We can go a lot farther than this!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0116", /*message*/"That was a huge success.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0117", /*message*/"I hope you managed to catch the emotion in my voice.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0118", /*message*/"Turn toward the sea, and salute! Yup. That&apos;s the pose I&apos;m looking for.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0119", /*message*/"Which do I like more: you or boats?! That&apos;s an impossible decision to make!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0120", /*message*/"No matter where you go, I&apos;ll always be able to find you!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0123", /*message*/"Let&apos;s keep working hard at it together!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0126", /*message*/"Just ask me if there&apos;s anything you don&apos;t understand.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0127", /*message*/"Is there any place you haven&apos;t visited yet?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0128", /*message*/"Are you getting the hang of things?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0129", /*message*/"What do you wanna do today?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0130", /*message*/"This is starting to get really fun.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0131", /*message*/"The two of us are going to have lots of fun together!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0132", /*message*/"Thanks. I&apos;m really glad that you chose to celebrate my birthday with me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0133", /*message*/"どんまい、どんまい！");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0105_0134", /*message*/"失敗は成功の元、だよ☆");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0001", /*message*/"I told you, it&apos;s Yohane, not Yoshiko! Quit getting it wrong!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0002", /*message*/"Nine friends? I think this has to be a new record!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0003", /*message*/"I&apos;m trying to come up with demon names for everyone. Hmm. It&apos;s not easy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0004", /*message*/"I&apos;d like to hide you somewhere if I could. Beautiful, shiny things always end up attracting people.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0005", /*message*/"Romance games? I don&apos;t really play them. But I would if I had a chance of capturing you in one.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0006", /*message*/"You are now my little demon. I don&apos;t want to see your eyes wandering!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0007", /*message*/"You&apos;re finally back. Where have you been all this time?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0008", /*message*/"If you ever have a hard time cheering up, just call me. My fallen angel powers can dispel whatever troubles you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0009", /*message*/"I practically die of boredom when you&apos;re not around.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0010", /*message*/"*Chuckle*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0011", /*message*/"That&apos;s great.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0012", /*message*/"You have some nerve.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0013", /*message*/"Now I&apos;m angry.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0014", /*message*/"Aw.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0015", /*message*/"Why did it have to turn out like this?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0016", /*message*/"*Cackle*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0017", /*message*/"*Chuckle*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0018", /*message*/"What most people consider to be a normal school uniform is anything but normal for me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0019", /*message*/"Actually, I embroidered a magic sigil into my uniform. It&apos;s hidden, though-- Hey! Stop peeking under there!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0040", /*message*/"There&apos;s a huge basket of mikan oranges in the club room. I feel so alienated watching everyone else enjoying them!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0041", /*message*/"The temperature has really dropped lately. You better not get sick and leave me here all on my own.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0044", /*message*/"There was once a time when I thought being a school idol sounded frivolous, and beneath my interest level!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0045", /*message*/"One day, I will rule over all of humanity. But, don&apos;t worry, my relationship with you will never change.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0046", /*message*/"Being in Aqours still feels like a dream to me. How can I be having this much fun?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0047", /*message*/"I&apos;m a very generous fallen angel. These arms are always open for you any time you wish, my little demon.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0048", /*message*/"Mmm. What? Are you awake? I&apos;m still sleepy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0049", /*message*/"The spirit world mingles with the real world along the boundary between day and night. Be careful you don&apos;t end up lost on the other side.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0050", /*message*/"Nooo! I can&apos;t find my pass and the bus is about to come! Did I forget it at home? Or drop it somewhere?!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0051", /*message*/"I&apos;m staying right here beside you. That way no other angels or demons can take you away.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0052", /*message*/"Yikes! It&apos;s really pouring down! The rain spirits must be demanding my hand in marriage! I won&apos;t give in, though!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0053", /*message*/"Grr. Who were you just talking to? You could have chosen to talk to me instead.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0054", /*message*/"Night is when the demons awake, and we all rule the darkness. I can&apos;t be falling asleep now.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0055", /*message*/"I&apos;m exhausted. It&apos;s time to recharge my magical powers. Come over here and give me a big hug!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0056", /*message*/"Wh-What do you want?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0057", /*message*/"Feel free to pet me some more.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0058", /*message*/"Stop it already!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0059", /*message*/"Have I managed to bewitch you with my gaze?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0060", /*message*/"Were you hoping to hear my voice?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0061", /*message*/"My little demon must be feeling lonely.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0062", /*message*/"Don&apos;t you dare go poking at my weak spots.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0063", /*message*/"Hey! That tickles!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0064", /*message*/"Prepare to make a toast! My adorable little demon is celebrating a birthday.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0104", /*message*/"It looks like part of the story is still sealed away and unread.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0105", /*message*/"Our combined efforts upon that dark stage will be a sight to behold!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0106", /*message*/"It&apos;s time to achieve greatness. Off to practice!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0107", /*message*/"Take today&apos;s training as a chance to admire my splendor.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0108", /*message*/"There&apos;s a new goal? Well, hurry up and achieve it then!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0109", /*message*/"A sealed missive has arrived from the netherworld.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0110", /*message*/"There&apos;s a present waiting. I checked it to make sure it wasn&apos;t a trap from the heavens.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0111", /*message*/"It seems the humans are throwing another big event.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0112", /*message*/"I wonder whose chapter it&apos;ll be this time?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0113", /*message*/"I can really have this? It isn&apos;t some kind of a trick, right?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0114", /*message*/"Alright!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0115", /*message*/"Good job.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0116", /*message*/"Now you know the power of a fallen angel!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0117", /*message*/"Well done, my little demon!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0118", /*message*/"I knew from the first moment I saw you, that you had what it takes to become a magnificent little demon!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0119", /*message*/"From now on, each time you call me Yoshiko, you must give me a piece of chocolate; the flavor doesn&apos;t matter!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0120", /*message*/"What was it like being an angel? I don&apos;t remember that far back. Besides, wouldn&apos;t you rather know about my present life?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0123", /*message*/"Let&apos;s give it our best shot!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0126", /*message*/"If you have any questions, be sure and ask me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0127", /*message*/"Perhaps there&apos;s some place you have yet to visit?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0128", /*message*/"Are you getting the hang of things?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0129", /*message*/"What do you want to do today?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0130", /*message*/"This is getting entertaining, isn&apos;t it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0131", /*message*/"I look forward to hanging out with you all the time!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0132", /*message*/"That&apos;s right! Today is my birthday! Celebrate, my little demon!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0133", /*message*/"うぐぐ、また天使が邪魔したのかしら？");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0106_0134", /*message*/"まだまだ修行が必要ね");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0001", /*message*/"Dance lessons are hard, but I think they&apos;re helping my grade in PE, zura!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0002", /*message*/"When I was practicing a hymn at home, a worshiper overheard me and freaked out, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0003", /*message*/"I feel like my world has gotten bigger since starting Aqours.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0004", /*message*/"Do you like to read? I wanna hear about all the things you like.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0005", /*message*/"For all your hard work, you get my company, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0006", /*message*/"I wanna learn how to eat noodles right so we can eat udon and ramen together, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0007", /*message*/"I learn so much when I talk to you. It&apos;s so much fun!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0008", /*message*/"Do you like your bean paste lumpy or smooth? I like it both ways! But I like you more than bean paste.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0009", /*message*/"Whenever you&apos;re gone, I get lonely like there&apos;s a hole in my heart, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0010", /*message*/"We did it, zura!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0011", /*message*/"Tee-hee, I&apos;m so happy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0012", /*message*/"Hmph.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0013", /*message*/"Grr.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0014", /*message*/"*Sigh*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0015", /*message*/"I think I&apos;m gonna cry, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0016", /*message*/"Tee-hee!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0017", /*message*/"Hee-hee!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0018", /*message*/"Sometimes I forget to wear my uniform scarf to school, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0019", /*message*/"Do you think the upperclassman uniforms would suit me? The different-colored scarf makes a big difference.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0040", /*message*/"Pretty sunsets always catch my eye. The sky, ocean, and mountains are all dyed reddish-orange this time of year, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0041", /*message*/"Our pink cheeks match!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0044", /*message*/"Reading my favorite book while sipping tea to the sound of waves. Am I allowed to live this luxuriously?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0045", /*message*/"I loved the book you lent me! It was like my mind opened to a new world, zura. Thank you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0046", /*message*/"Finding food yummy is proof of good health, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0047", /*message*/"What should I read today? Maybe some foreign literature for a change?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0048", /*message*/"Good morning, zura. Mm. Good night, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0049", /*message*/"I&apos;ll sing a lullaby so you can sleep soundly.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0050", /*message*/"I love the smell of old books. It really brings home how long they&apos;ve been around.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0051", /*message*/"If you were a book, you&apos;d be with me when I went to school, when I slept, and always.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0052", /*message*/"Welcome home! I got a lot of mikan and I was waiting for you so we could eat them together, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0053", /*message*/"My room is overrun by books, so now I can&apos;t invite you over. Something must be done!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0054", /*message*/"Being by your side is like basking in spring sunlight. My heart&apos;s calm when I&apos;m around you, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0055", /*message*/"I hope I can see you in my dreams.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0056", /*message*/"When you pat my head, I feel like a little girl again.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0057", /*message*/"Your hand is so soft, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0058", /*message*/"Eek! You scared me, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0059", /*message*/"No poking!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0060", /*message*/"I feel like I heard someone call me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0061", /*message*/"Did you call my name?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0062", /*message*/"Tee-hee, that kinda tickles, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0063", /*message*/"Eek! No tickling!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0064", /*message*/"Happy Birthday. I hope your life stays happy.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0104", /*message*/"Let&apos;s read together, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0105", /*message*/"I really wanna perform right now, zura!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0106", /*message*/"I&apos;m gonna practice and get stronger, zura!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0107", /*message*/"I&apos;m gonna be late to training, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0108", /*message*/"How about starting with a goal we know we can do?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0109", /*message*/"You&apos;ve got a notification, zura!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0110", /*message*/"A present? What could it be? I hope it&apos;s something yummy, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0111", /*message*/"Looks like something fun is going on, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0112", /*message*/"I wanna see everyone&apos;s story, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0113", /*message*/"Red bean cakes hot off the shelf, zura. How lucky!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0114", /*message*/"Amazing!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0115", /*message*/"Today&apos;s gonna be a good day, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0116", /*message*/"You can always see results when you work hard.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0117", /*message*/"I&apos;m hungry. Let&apos;s have snack time.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0118", /*message*/"I know I speak weird, saying zura and everything... But can I stay by your side?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0119", /*message*/"Before, I&apos;d get engrossed in books as soon as I started, but now even when I open a book I start to think of you, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0120", /*message*/"I really love...how pretty the moon looks! Oh, sorry, zura! It was nothing! Forget what I was saying!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0123", /*message*/"Let&apos;s do our best, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0126", /*message*/"Lemme know if you have any questions!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0127", /*message*/"Is there anywhere we haven&apos;t gone yet?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0128", /*message*/"Are you getting the hang of it?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0129", /*message*/"What should we do today?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0130", /*message*/"This is getting fun.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0131", /*message*/"Let&apos;s keep playing together, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0132", /*message*/"Huh? You remembered my birthday? Thank you, zura.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0133", /*message*/"これも仏様の試練ずら……！");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0107_0134", /*message*/"美味しいものを食べて心機一転ずら！");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0001", /*message*/"You think it&apos;s hard being the chairwoman and a school idol at the same time? I&apos;m the only one who can do it all with style.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0002", /*message*/"You can only see me singing and dancing in Aqours.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0003", /*message*/"It&apos;s my dream to make Aqours the poster girls of my family&apos;s hotel. Don&apos;t tell anyone yet.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0004", /*message*/"No matter where you are, you&apos;re the only one I want to go home to.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0005", /*message*/"The nine of us can go anywhere, no matter how far. I am certain of that.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0006", /*message*/"I&apos;ll come get you once I&apos;m a star, so be good and wait for me.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0007", /*message*/"You can cry if you&apos;re sad. Don&apos;t worry. I&apos;m the only one here.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0008", /*message*/"Even I get depressed sometimes. That&apos;s why I want you to stay with me right now.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0009", /*message*/"Thanks to you, I&apos;m happy everyday.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0010", /*message*/"I&apos;m so happy!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0011", /*message*/"I&apos;m so glad!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0012", /*message*/"Hmpf.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0013", /*message*/"You won&apos;t get away with this.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0014", /*message*/"I&apos;m so sad.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0015", /*message*/"*Sniffle*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0016", /*message*/"Whee!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0017", /*message*/"*Giggle*");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0018", /*message*/"This uniform is very cute as is, but I&apos;d like to add my own touch.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0019", /*message*/"When I look at my freshman uniform tie, I think about how young I was back then.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0040", /*message*/"I saw a group of kids in kimono. They were so cute and looked like dolls.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0041", /*message*/"Now that it&apos;s cold, my clothes are all soft and fluffy. I especially feel very nice when hugged.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0044", /*message*/"Hmph. Why aren&apos;t Dia and Kanan letting me go shopping?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0045", /*message*/"You want to try horseback riding? Okay! I&apos;ll introduce you to my favorite horse.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0046", /*message*/"Do you take milk and sugar in your coffee? Tee-hee, there&apos;s no one to stop us from making it sweet today.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0047", /*message*/"You&apos;re not very flexible. Take a look at me!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0048", /*message*/"Mm. I&apos;m sleeping.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0049", /*message*/"I&apos;ll do anything you say if you let me sleep five more minutes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0050", /*message*/"The waves flow in and out. Listening to them fills me with an indescribable feeling.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0051", /*message*/"I can&apos;t believe you made me wait! Tee-hee, just kidding. I&apos;m so happy you&apos;re here.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0052", /*message*/"Your eyes are such a pretty color, I wish I could keep them in a jewelry box.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0053", /*message*/"Welcome home! Now you have to spend the rest of the day with me. No buts.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0054", /*message*/"You&apos;re still awake? Then, let&apos;s talk.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0055", /*message*/"A good day starts with a good night&apos;s rest. Sleep well and I&apos;ll see you again tomorrow.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0056", /*message*/"Don&apos;t ruffle my hair too much or you&apos;ll mess it up.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0057", /*message*/"Does my hair feel that nice?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0058", /*message*/"I take special care of my skin.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0059", /*message*/"Let me touch your cheek, too.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0060", /*message*/"Did you call me?");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0061", /*message*/"I had a feeling you would be visiting soon.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0062", /*message*/"Eek! Now you&apos;ve done it! Take that!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0063", /*message*/"Hahaha! Stop it already! I give up!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0064", /*message*/"Happy Birthday! I&apos;ve been waiting for this day. Now it&apos;s time for your party.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0104", /*message*/"Let&apos;s read a story!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0105", /*message*/"Standing by. I&apos;m ready to perform as soon as you give me the call.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0106", /*message*/"It&apos;s time to practice! My goal is an even stronger, shinier school idol!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0107", /*message*/"I can&apos;t wait for our training excursion!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0108", /*message*/"You have a goal. I&apos;ll reward you if you finish quickly.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0109", /*message*/"It looks like you have a message.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0110", /*message*/"I wonder what this important present is.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0111", /*message*/"Let&apos;s go to the event if you&apos;re free. I&apos;ll be your special escort.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0112", /*message*/"There&apos;s a new story. Tell me what it&apos;s about.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0113", /*message*/"You got a bonus! Today&apos;s your lucky day.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0114", /*message*/"Excellent!");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0115", /*message*/"You&apos;re the best! Thank you.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0116", /*message*/"That&apos;s great! I knew you could do it.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0117", /*message*/"It&apos;s a miraculous success! Today, we celebrate.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0118", /*message*/"I want to wake up to your voice and fall asleep gazing into your eyes.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0119", /*message*/"I would love to take the stage with you one day! Think it over.");
INSERT INTO `m_dictionary` VALUES (/*id*/"vo_na_m0108_0120", /*message*/"Let&apos;s go somewhere far away. Just the two of us. *Giggle* Did your heart skip a beat?");
