There are two status changing effects: Show Parameter Changes, and Base Parameter Changes.

Show Parameter Changes
These include temporary changes and changes that last until the end of the Live Show.

Base Parameter Changes
When these changes are active, they cannot be negated by any other effect during the Live Show and will continue until it ends.
However, Base Parameter Changes that occur during Appeal Chances will only be effective during Appeal Chances.");

・Show Skills
Skills activated during a Live Show when certain conditions are met. They have a variety of effects.

・Passive Skills
Skills dependent on your Show Formation. These mainly increase status parameters.

Passive Skills and some Show Skills have the &quot;Base Appeal&quot; label on them. Effects with the &quot;Base&quot; label on them cannot be negated after being activated, and will last until the end of the Live Show.

Additionally, Passive Skills and certain Show Skills will be marked with &quot;On Appeal.&quot;
&quot;On Appeal&quot; indicates hitting Notes on anything but a &quot;MISS.&quot;");

School idols in your formation that have the same type as the song will gain a boost to their stats as well as other possible effects, such as interacting with the song&apos;s Show Trick, gaining more Voltage, and other beneficial effects.

To find out more about school idol attributes, check the Attribute page under Strengthen School Idols.");

You will gain SBL Medals based on how well you do. These SBL Medals can be traded for a variety of items from the shop exchange.

You can only play the eligible songs if you have the required BP, or points needed to participate in Big Live Shows. Your BP will reset every day at 12:00 am JST. Please note that you will not be able to join the event if you do not have enough play chances.");

They will affect random players, and their effects will be randomly decided based on the type of the school idols in your formation.


・Vo Type
Gain 100% of the appeal of the school idol who hit the Note as Voltage.

・Gd Type
Gain 10% of the stamina of the school idol who hit the Note as shield points.

・Sp Type
Gain 50% of the Technique of the school idol who hit the Note as SP Gauge.

・Sk Type
All school idols&apos; skill activation rate increases by 100% for 3 Notes.");

・Voltage Award
The player who gained the most Voltage will be awarded this.

・Skill Award
The player who activated the most skills will be awarded this. In the case of a tie, the player who gained the most Voltage among the nominees will win.

・SP Skill Award
The player who activated their SP Skill the most will be awarded this. In the case of a tie, the player who gained the most Voltage will win.

The player who performs the best overall will be given the Best Performer Award. If players end the show with equal performance, the prize recipient may be randomly selected.

Winning these prizes will net you a large amount of SBL Medals as a reward.");

Daily Rankings
These rankings are calculated at the end of each day, beginning at 12:00 am JST and ending at 11:59 pm JST. Rankings will show the highest Voltage for each song during that day. To be eligible, a player must play all applicable songs at least once per day.

Overall Rankings
These rankings show the sum of players&apos; Voltage in the Daily Rankings throughout the event. To get higher ranks, players must compete in the Daily Rankings every day.");

