You can restore your LP by ranking up, using items, or simply letting time pass.

1. Time
One LP is restored every 4 minutes. Waiting will restore up to the maximum amount of your LP.

2. Ranking Up
Every time your rank increases, you will recover LP equivalent to your new maximum. Unless your LP was 0 before ranking up, you will recover LP beyond the maximum value.

3. Items
You can use 10 Star Gems to restore 100 LP.

You can also use Show Candy (50) or Show Candy (100) to restore that amount of LP. You can use Star Gems and items when you have less than twice the amount of your maximum LP.");
